INSERT INTO `bodley_main` (`id`, `date`, `orderdate`, `firstline`, `summary`, `ednote`)
VALUES
	('0606','17 April 1585','15850417','You shall in your way towardes Denmarke visite the','Instructions for Bodley to go to Denmark and visit the Duke of Brunswick en route, to try and persuade him to enter into a protestant confederation.',''),
	('0607','17 April 1585','15850417','To lett him understand howe the attempt of the duke of [...]','An extract of instructions for Bodley\'s negotiation in Denmark, comprising a set of points to be made to the King of Denmark in order to persuade him to commit to the Protestant cause.','An draft extract of Bodley\'s instructions. There is a florilegium on the address leaf.'),
	('0061','17 April 1585','15850417','You shall in your waye towardes','A copy of instructions for Bodley to go to Denmark and visit the Duke of Brunswick en route, to try and persuade him to enter into a protestant confederation.\n','The text is written in a central column.'),
	('0082','27 April 1585','15850427','To acquaynt him with what care hir Majestie hathe sondrie','Draft of some of the points included in Bodley\'s instructions concerning his visit to the Duke of Brunswick.\n',' A draft of points included in Bodley\'s instructions.'),
	('1324','27 April 1585','15850427','It is thought convenient that you take some apte oportunitie to','Copy of instructions to Bodley, advised to warn the King of Denmark that the House of Lorraine claim title to his kingdom.\n','An extract of instructions for Bodley. It is tightly compacted into the top quarter of the folio, with wide margins.'),
	('0077','27 April 1585','15850427','In your way towards Denmarke being','Instructions for Bodley to go to Denmark, and to visit the Duke of Brunswick and deliver letters en route.\n','A copy of instructions. The text is written in a centered column with a wide margin on each side.'),
	('0081','27 April 1585','15850427','If he lande at Embden or Hamburge, to be directed to goe to the Duke','Robert Beale\'s notes for Bodley\'s negotiation with the Duke of Brunswick on the necessity of forming a protestant alliance with the German princes.\n','The bottom half of the final verso also forms the address leaf.'),
	('0079','07 May 1585','15850507','Right honorable, my humble duty remembred, being newly','Bodley is unsure of his instructions regarding the delivery of a letter to the Duke of Holst, and other news relating to his mission.\n',' The address leaf has been pasted onto the verso of the letter.'),
	('1108','31 May 1585','15850531','Right honorable & my singular good Lorde, my duty first [re]','Bodley\'s report of his progress with the Duke of Brunswick.\n',''),
	('0080','31 May 1585','15850531','Right honorable, my humble duty to your H. most affectionatly','Report of Bodley\'s mission to the Duke of Brunswick.\n',''),
	('0611','23 June 1585','15850623','Sir I have receaved your twoo lettres the one dated at Hambrow the other','Confirms the receipt of Bodley\'s recent letters, and news of Elizabeth\'s dealings with various Northern European rulers.\n',''),
	('0612','28 June 1585','15850628','Right honorable, my dutifull affection most humbly premise[d]','Report on Bodley\'s reception and treatment at Elsinore by the King of Denmark.\n',''),
	('0083','17 July 1585','15850717','Right honorable, having signified first my bounden duty to','Despite the Duke of Brunswick\'s absence, Bodley has been advised to remain at Wolfenbuttel until his return.\n',' At the beginning of fol.200v, there is a florilegium marked in the margin.'),
	('0084','27 July 1585','15850727','Right honorable, not at any time forgetting my most dutifull','Bodley remains at Wolfenbuttel, waiting for the Duke of Brunswick to return.\n',''),
	('1308','1588','15880000','A Copie of the Treaty betweene her Majesties Com-','A list by Bodley of the various letters, notes, petitions and instructions given to him before his departure to the Low Countries.\n','A list by Bodley of letters and writings received before his voyage to the Low Countries. There is no address leaf.'),
	('0076','May 1588','15880500','The effect of the k. answer was, that he found','Bodley\'s account of the King\'s answer to his message from Queen Elizabeth, who has rejected the offer of assistance.\n','Bodley\'s report on the King of France\'s answer to a message from Queen Elizabeth.'),
	('0063','11 August 1588','15880811','You shall make your present repaire to Margate, where','A copy of instructions for Bodley on the subject of intelligence on the Spanish fleet and concerning his negotiation with the King and Governors of Denmark.\n','Instructions. The text appears in a wide column in the centre of the page.'),
	('0095','November 1588','15881100','That her Majesty fynding yt meet','Draft memorandum of some of the points in the first official instructions for Bodley on his ambassadorship to the Hague.\n',' A rough draft of points covered in Bodley\'s instructions. The address leaf is partly missing.'),
	('0096','November 1588','15881100','To charge them states with ther lyttle regard','A rough draft of points to be included in Bodley\'s instructions, concerning the frequent dissolution of the States General.\n','Memorial by Francis Walsingham of points to be included in Bodley\'s instructions.'),
	('0102','15 November 1588','15881115','Firstly that yow peruse all sutch Acts as were procured by the Assistantes in','Points to be negotiated and acted upon by Bodley regarding musters and pay.\n','Instructions.'),
	('1340','15th November 1588','15881115','First that the States according to their owne agreement with the Mus-','Copy of the first four paragraphs of Bodley\'s instructions to speak to the Council on the matter of musters.\n','A partial copy of the first four paragraphs of Bodley\'s instructions.'),
	('0101','15 November 1588','15881115','Whereas there were presented unto her Majestie in Februarie last','Annotated draft of instructions for Bodley concerning his response to the States General\'s dissatisfaction with Queen Elizabeth\'s answers to their requests of February 1588, concerning the matters of service money, cautionary towns and musters.\n','This letter is annotated by Burghley. There are two florilegia on the address leaf.'),
	('1307','20 November 1588','15881120','Whereas we have thought meet to call home our servant Henrie Killegrewe','Bodley\'s first official instructions from Queen Elizabeth on his departure to the Low Countries as resident ambassador to The Hague.\n','Instructions. The half-page of space between the letter text and Walsingham\'s signature on fol.266r is hatched over in ink. There are two florilegia in the margin of fol.265v.'),
	('0100','20 November 1588','15881120','And whereas we have heretofore','Draft of the fourth and fifth articles in Bodley\'s main instructions on his departure for the Low Countries as ambassador to The Hague.\n','A draft of the third and fourth articles of original instructions. There is no address leaf.'),
	('0099','20 November 1588','15881120','Whereas we have thought meete to call home our servaunt Henry Killi-','Unfinished copy of draft articles from Bodley\'s first official instructions on his departure to the Low Countries as resident ambassador to The Hague.\n','Instructions.'),
	('0098','20 November 1588','15881120','Whereas wee have thought meet to call home our','Draft of the first seven articles in Bodley\'s original instructions on his departure to the Low Countries as resident ambassador to The Hague.\n','Draft instructions annotated bySir William Cecil, Lord Burghley.'),
	('0097','20 November 1588','15881120','Wheras we haue thought meet to call home our servant Henrie','Bodley\'s first official instructions from Queen Elizabeth on his departure to the Low Countries as resident ambassador to The Hague.\n',' The paragraphs are clearly divided and numbered in the left-hand margin.'),
	('0103','20 November 1588','15881120','He is apointed a Counsellor for her Majestie in the Counsell of State','Notes summarizing Bodley\'s first instructions on his going into the Low Countries as resident ambassador to The Hague.\n','A list of points included in Bodley\'s instructions. The address leaf is partly missing.'),
	('1310','20 November 1588','15881120','Whereas we do presently send our trusty and welbeloved servaunt Thomas Bodley Esquire the','Bodley\'s passport for his departure to the Low Countries as ambassador to The Hague.\n','Thomas Bodley\'s passport. The document bears the royal seal.'),
	('0091','23 November 1588','15881123','Whereas there were presented unto her Majestie in Februarie last','Copy of instructions for Bodley to respond to the dissatisfaction of the States General with Queen Elizabeth\'s answers to their requests of February 1588, concerning the matters of service money, cautionary towns and musters.\n','There is no address leaf present.'),
	('1309','23 November 1588','15881123','Whereas there were presented unto her Majestie in Februarie Last certaine','Instructions for Bodley to respond to the dissatisfaction of the States General with Queen Elizabeth\'s answers to their requests of February 1588, concerning the matters of service money and cautionary towns.\n','Instructions. The address leaf is mutilated and mostly missing.Though they are not currently bound next to each other, the inked imprint of Bodley\'s cipher can be seen on the final verso, suggesting that they were stored together at some point. Towards the end of paragraph 5 (after the word \'dyscreete\') there is a lacuna of 1 word. There is a florilegium in the margin of fol.270v.'),
	('1312','28 November 1588','15881128','Whereas in her Majesties passeport graunted unto Thomas','An extension of Bodley\'s passport by Francis Walsingham, emphasising his right to assistance abroad.\n','Extension to Bodley\'s passport. There is no address leaf.'),
	('1311','28 November 1588','15881128','[cipher alphabet]',' Bodley\'s cipher.\n','Thomas Bodley\'s Cipher. The code is presented as columns and rows of corresponding symbols and keys. The address leaf is mutilated and mostly missing.'),
	('1313','06 December 1588','15881206','Sir I send you herewth a lettre to Counte Maurice and','Asking Bodley to intercede with the States in the cause of Monsieur Adrian Garania.\n',''),
	('0113','16 December 1588','15881216','It may please your H. I have written a former','Concerning complaints from the States of Zealand concerning the distribution of military bands.\n',''),
	('0112','16 December 1588','15881216','It may please your H. the 5. of this present I arrived at','Regarding his conversation with St. Aldegonde, in which he defended himself against recent rumours.',''),
	('1314','27 December 1588','15881227','Sir I send you herewith a lettre from her Majestie to Capten','Regarding Martin Schenck\'s offer to enter Elizabeth\'s service.\n',''),
	('0117','31 December 1588','15881231','It may please your H. I receaved yesternight your','Detailed account of Bodley\'s recent diplomatic dealings, Bodley asks permission to act as a source of intelligence to the principal politicians in The Hague.\n','Next to the word \'interpreter\' on f.152r, there are three tightly drawn lines in the margin.'),
	('0900','1589','15890000','A Memoriall for Master Bodeley','List of points to be undertaken by Bodley.\n','The list is bordered on the left side by a straight vertical line with 3 flourishes.'),
	('0899','1589','15890000','Her Majesties pay to a company of Lances','Summary of accounts of pay to a company of Lances.\n','There is a bracket around the second paragraph pointing to the marginal note.'),
	('0897','1589','15890000','Remembrances for Master Bodiley (hir Majesties Assistant','Remembrances for Bodley to solicit the Privy Council for letters to the States concerning the musters\n','The bottom quarter of the final verso forms the address leaf.'),
	('0122','03 January 1589','15890103','It may please your H. the post that brought your H. letters','Bodley encloses a copy of the resolution from the States of Utrecht, and has been admitted to the Council of State as Henry Killegrew\'s replacement.\n',''),
	('0127','07 January 1589','15890107','It may please your H. by Sir Edward Norreis I','Report that trouble is growing in the town of Utrecht, and that there are troops ready to embark at Rotterdam.\n',''),
	('0128','11 January 1589','15890111','Right honorable my singular good Lord, if that','Bodley has been admitted as counsellor to the Council of State but refuses to take the oath until it is modified.\n',''),
	('0130','12 January 1589','15890112','It may please your H. in my last I signified what','Bodley has been admitted as counsellor to the Council of State but refuses to take the oath until it is modified.\n','The words \'Uppon\' (line 10) and \'Councell\' (line 27) are marked by a three-sided box, framing the information within. At the point where Bodley discusses the \'debate\', someone has marked the margin with six tight lines.'),
	('0132','13 January 1589','15890113','It may please your H. this morning I receaved your','After modifications made to the oath, Bodley has been admitted formally to the Council of State.\n',''),
	('0791','16 January 1589','15890116','It may please your H. I signified in my former what [communicacion] passed','Report of a conversation had with Paul Buis, regarding the offer of sovereignty to Elizabeth, and also the general attitude towards France.\n','There are doodles on the last page of this letter.'),
	('0135','17 January 1589','15890117','It may please your H. howe all hath heere procee','Notes that the frequent threat by England to withdraw forces from the campaign will reduce confidence.\n',''),
	('0136','20 January 1589','15890120','It may please your H. I have newly receaved','Bodley has received an answer from the States regarding his instructions which is \'undecent\' and \'malepert\'.\n',''),
	('0797','30 January 1589','15890130','It may please your H. I have heerewith sent the copie of','Account of Bodley\'s diverse negotiations.\n',''),
	('0139','30 January 1589','15890130','It may please your H. I have heerewith sent the copie of','Detailed report of the States\' answer to Bodley\'s instructions.\n',''),
	('0142','20 February 1589','15890220','It may please your H. to receave suche further returns','Detailed report of the States\' reaction to Bodley\'s instructions, and other news.\n',''),
	('0802','20 February 1589','15890220','Right honorable, and my very good Lord, I presume','Account of Bodley\'s diverse negotiations.\n',''),
	('0804','28 February 1589','15890228','Sir. This bearer my servant being sent over for the','Request to Bodley to intercede with the States on behalf of Sir Thomas Morgan and Sir Thomas Knollys, in the case of their marriage plans.\n','The address leaf of this letter is mutilated, and the superscription mostly missing.'),
	('0157','March 1589','15890300','That her Majestie is not a litle discontented with the disorderly','Notes for a letter to Bodley concerning Geertruidenberg.\n',''),
	('0145','02 March 1589','15890302','Right honorable and my very good Lord, since my','Mixed military news.\n',''),
	('0146','09 March 1589','15890309','It may please your L. to be advertised, that','Concerning Count Maurice\'s military preparations to besiege Geertruidenberg.\n','At the word \'sundrie\' there are three tightly drawn lines marked in the margin.'),
	('0805','09 March 1589','15890309','It may please your L. to be advertised, that I','Report of Count Maurice\'s skirmish with the town of Geertruidenberg.\n','At the start of fol.104v, the letter is scribal.'),
	('0806','16 March 1589','15890315','After my very harty Comendations. on fryday at night last the L. willoghby','Regarding Elizabeth\'s forthcoming letter to Bodley regarding the situation at Geertruidenberg.\n',''),
	('0807','18 March 1589','15890318','Ryght honorable my veary good Lord, I writte in my laste of','Report concerning the siege of Geertruidenberg, how the fortification of the town has denuded the garrisons of Zealand and Overijssell.\n',''),
	('0149','19 March 1589','15890319','Right honorable my very good Lord, I writte in','Concerning the siege of Geertruidenberg.\n','At the word \'acquainted\' there are three tightly drawn marks in the margin. At the word \'Amsterdame\' there are two tightly drawn marks in the margin.'),
	('0808','27 March 1589','15890327','Sir. This gentleman Monsieur Caron the bearer hereof having','Introducing Monsieur Caron as the bearer, who is authorised to mediate on Elizabeth\'s behalf between her and the States.\n',''),
	('0809','28 March 1589','15890328','Sir. I have forborne to write unto yowe anie thing, since I','Updating Bodley on Elizabeth and the Privy Council\'s reaction to the siege of Geertruidenberg.\n',''),
	('0155','30 March 1589','15890330','It may please your L. Uppon the opportunitie','The Spanish forces march to Geertruidenberg, and news of the ongoing siege.\n',''),
	('0810','31 March 1589','15890331','It maye please your L. at the writinge of my last, the towne','Report that the siege of Geertruidenberg continues.\n',''),
	('0811','01 April 1589','15890401','It is nowe written hither, that th\'ennemy is in earnest parle with','Reporting the parley between the Spanish forces and the people of Geertruidenberg, and the number of Schencke\'s collusion with the Spanish.\n',''),
	('0159','01 April 1589','15890401','It may please your L. As at the writing of my','The siege of Geertruidenberg continues, and news of the actions of Sir John Wingfield and Lord Willoughby.\n','There is a small florilegium on the address leaf.'),
	('1358','28 April 1590','15900418','Yt may please your L. To bee advertized that with your lettre of the 14 of','Concerning the underhand methods of the States General, and the suspicions levelled against Ortel.','\n'),
	('0812','07 April 1589','15890407','It may please your Lord: to advertise hir majestie that I receaved not','Report that the garrison at Geertruidenberg are in negotiations with the States.\n',''),
	('0814','07 April 1589','15890407','It may please your L. to advertise her Majestie','Report that the garrison at Geertruidenberg are in negotiations with the States.\n',''),
	('0161','07 April 1589','15890407','It may please your H. I am often solicited','Regarding the involvement at Geertruidenberg of the persons mentioned of Sir Thomas Morgan and Lord Willoughby.\n',''),
	('0815','10 April 1589','15890410','It may please your L. in my last of the 7. of','Bodley\'s complaint that he is not being kept acquainted with resolutions agreed between the States and the Privy Council.\n',''),
	('0167','c.12 April 1589','15890412','Trusty and welbeloved we greete you well: The losse of the towne of Gertrudenbergh','Following the loss of Geertruidenberg, the Queen will send a nobleman to treat with the States General on the matter of keeping the states united under the government.','The letter is written quite tightly in the top two thirds of the folio. There is a florilegium below the endorsement on the address leaf.'),
	('0166','12 April 1589','15890412','Trusty and welbeloved we greete you well. Albeit you have of late receaved order','Bodley is to repeat the Queen\'s displeasure concerning Geertruidenberg.\n',''),
	('0171','13 April 1589','15890413','Sir, Her Majestie consideringe the good course holden by the','Concerning the States not honoring their treaty with Sonoy.\n','There is no address leaf. After the endorsement on the verso, there is a small florilegium.'),
	('0932','31 May 1590','15900531','It may please your L. to bee advertized that I have Rxd by persivall hir','Bodley\'s report that the insufficient forces available for the recovery of Groningen suggest that the Queen\'s letters be delayed until the enterprise begin.','\n'),
	('0917','18 April 1590','15900418','It may please your H. to be advertised that I rxd the lettres of','The States General has dispatched copies of Queen Elizabeth\'s letters to the provinces: Bodley awaits a reply.','\n'),
	('0172','15 April 1589','15890415','It may please your H. since the sealing of','Concerning Bodley\'s recent conversation with Barnevelt.\n','At the word \'requested\' there are two tightly drawn marks in the margin.'),
	('0817','15 April 1589','15890415','It may please your H. the letter whiche yow sent','Indicating that the States plan to send an embassy to England, and that a \'Placcart\' has been released against Geertruidenberg.\n','The superscription is written on fol.161v: there is no separate address leaf.'),
	('0818','22 April 1589','15890422','It may please your L. by this bearer Captaine','Concerning the dispatch of the Commissioners by the States General: Monsieurs Valke, Loosen and Kenningburgh.\n',''),
	('1351','22 April 1589','15890422','It may please your L. By this bearer Capten Hale I receaved 2 daies past, two letters','Concerning the dispatch of the Commissioners by the States General: Monsieurs Valke, Loosen and Kenningburgh.\n',''),
	('0173','22 April 1589','15890422','It may please your H. howe matters have passed','Concerning Caron\'s arrival and that Walsingham\'s letter of recommendation for Captain Morgan for sergeant-majorship of Bergen op Zoom arrived too late.',''),
	('0799','26 April 1589','15890426','Trusty and welbelovid, we greete you well. The losse of the Town of','Following the loss of Geertruidenberg, the Queen will send a nobleman to treat with the States General on the matter of keeping the states united under the government.','The wax seal remains on the address leaf.'),
	('0819','27 April 1589','15890427','Sir I was dyrected to send this dys','Marvels at the tactless publication of the \'Placcart\' at such a critical time.\n',''),
	('0821','29 April 1589','15890429','It may please your L. since the writing of my last, three','Account of the surprise skirmish outside Heusden,  other military news, and information about Schenck.\n',''),
	('0820','29 April 1589','15890429','It may please your L. It hath hapned since','Account of the surprise skirmish outside Heusden, and other military news.','This letter begins in Bodley\'s hand, and changes to a scribal hand three lines into fol. 176v,'),
	('0822','01 May 1589','15890501','Sir. Though I have verie litle Leisure at this tyme, yett the matter','Directions for Bodley to instruct the States to have special regard to the fortifications of Ostend, and asking him to try and secure the release of the Wingfield family.\n',''),
	('0176','02 May 1589','15890502','Sir. though I have verie litle leisure at this tyme, yett the matter','Concerning the urgent need for Ostend to be adequately fortified.\n','On fol.151v there are two lines where the writing fades out into lacunae.'),
	('0824','03 May 1589','15890503','Trusty and welbelovid we greet you well. Where we have heretofore at sundrie','Bodley is to inform the States General that they must take control of Ostend as its fortification and upkeep have proved too costly for the Queen.\n','The address leaf, on a separate folio, is mostly missing. This is the enclosure of 0823.'),
	('0823','05 May 1589','15890505','Sir. the lettre included from her Majesty procedeth uppon dayly','Regarding Ostend, and the continued imprisonment of the Wingfield family.\n',''),
	('0827','08 May 1589','15890508','Mr bodeley I do delyver to this bearer these few lynes, to shew','Requires Bodley to press the States on the matter of fortifying Ostend, and that the Commissioners have not yet arrived.\n','The address leaf is partially mutilated, and the superscription missing.'),
	('0177','08 May 1589','15890508','It may please your L. so to welcome Mr','Recommending Monsieurs Loosen and Valke on their arrival as Commissioners to England from the States.\n',''),
	('0826','08 May 1589','15890508','It may please your L. so to welcome Mr Loozen and Mr Valk, as they','Asking Burghley to afford a good welcome to the Commissioners, recommending in particular Valcke and Loosens but not Egmond.\n',''),
	('0825','08 May 1589','15890508','It may please your honour I have byn visited with a paynefull','Asking Walsingham to afford a good welcome to the Commissioners, recommending in particular Valcke and Loozens but not Egmond.',''),
	('0829','11 May 1589','15890511','It may please your H. to advertise her Majestie that','Reporting that the Commissioners departed for England 3 days ago, and that the \'Placcart\' is widely available in print, and the Lord Willoughby\'s answer is anxiously awaited.\n','On fol. 222v there is a manicule in the margin at the words \'were charged so unjustly\'.'),
	('1352','11 May 1589','15890511','Yt may please your H to advertise her Majesty that the 8th of this','Reporting that the Commissioners departed for England 3 days ago, and that the \'Placcart\' is widely available in print, and the Lord Willoughby\'s answer is anxiously awaited.\n',''),
	('0561','13 May 1589','15890513','A lettre unto Master Bodley as followeth. After our harty Comendacions, whereas the','Instructions for Bodley to demand proof of the accusations against Lord Willoughby.\n','There is no address leaf.'),
	('0831','15 May 1589','15890515','It may please your L. yesterday I Rxd hir Majesties letter of the 3. of this','Concerning the imprisonment of the Wingfield family, and other matters.\n',''),
	('0832','18 May 1589','15890518','Trusty and welbelovid, we greete you well. We have receavid at this','Concerning discontent in Berghen over Thomas Morgan\'s governorship.\n','Instructions.'),
	('0833','23 May 1589','15890523','Sir. I receaved your lettres wherby I perceaved your','Reporting that the Commissioners have arrived and are to have audience today.\n',''),
	('0836','28 May 1589','15890528','It may please your H immediatly uppon the writing','Report of his negotiations with the English companies at Berghen Up Zome, the plight of the Wingfield family, and that of \'my Lady of Kent\'.\n','In some places where Bodley has addressed his correspondent, \'your L\' has been amended to \'your H\'.'),
	('0835','28 May 1589','15890528','It may please your LL. to be advertised, that being','Bodley promises to ask the states for proof supporting their accusations against Willoughby on his return to the Hague, and offers his own opinion.\n',''),
	('0186','28 May 1589','15890528','It may please your LL. to be advertised, that being at','Bodley promises to ask the states for proof supporting their accusations against Willoughby on his return to the Hague, and offers his own opinion.\n','The signature is in the bottom right corner, with ink lines covering the space above. The impression of the seal remains on the address leaf.'),
	('0188','29 May 1589','15890529','It may please your L. Mr Audley the','Recommends that the bearer Audley, brother of Captain Audley of Bergen op Zoom, be appointed to his brother\'s place, following his decease.',''),
	('0190','31 May 1589','15890531','It may please your H. of my being in Berghen','Bodley confirms that the townspeople of Bergen op Zoom are, contrary to fomer reports, obedient to the governor and Burghers.',''),
	('0191','10 June 1589','15890610','It may please your L. I have heerewith sent','Regarding the apprehending of Adrian Vasseur, Sir William Russel\'s secretary.\n','The document is badly eroded on the right hand edge.'),
	('0837','10 June 1589','15890610','It may please your L. I have heerwith sent a copy of the general','About the arrest of Adrian Vasseur, and on his return from Berghen Up Zome, Bodley has managed to secure the release of the Wingfield\'s child.\n',''),
	('0195','16 June 1589','15890616','After our hartie Commendacions. Her Majestie finding by','Instructions concerning the Commissioners lately sent to Queen Elizabeth. Bodley is to ask for proof of the accusations made against Lord Willoughby concerning Geertruidenberg.','The original draft text was written with widely spaced lines to allow for annotation. The annotation is less neat than the original text and may be a second hand, probably that of Walsingham. There is a cross in the margin next to the second deleted line.'),
	('0567','19 June 1589','15890619','After our hartie Commendacions: Her Majestie: findinge by the Commissioners latelie sent','Instructions concerning the Commissioners lately sent to Queen Elizabeth. Bodley is to ask for proof of the accusations made against Lord Willoughby concerning Geertruidenberg.','No address leaf. Privy Council copy of sent letter.'),
	('0839','19 June 1589','15890619','After our hartie Commendacions. Her Majesty finding by the Comissioners lately','Instructions concerning the Commissioners lately sent to Queen Elizabeth. Bodley is to ask for proof of the accusations made against Lord Willoughby concerning Geertruidenberg.','The address leaf bears heavy creases where it was folded, and the remains of a red wax seal.'),
	('0840','20 June 1589','15890620','It maye please your H. it is advertised out of Gueldres','Various military news, including the surrender of Bleijenbeek to the Spanish forces, and the States\' control of Farmsum.\n',''),
	('0841','23 June 1589','15890623','Sir, I send you hereinclosed aswell the gene','Urging Bodley to push the States for an answer to the English demands, and that there have been \'hot\' words between the Lords of the Council and the States\' special ambassadors.\n','The address leaf of this letter is mutilated, and most of the superscription is missing.'),
	('0842','26 June 1589','15890626','It may please your H. there are letters come hi','Reporting the arrival of secret letters from the special ambassadors to Barnvelt, and military news.\n',''),
	('0884','July 1589','15890700','Sir, Wheras the war by consente of the States uppon motion','Concerning the withdrawal of troops serving in the Low Countries and allocating them to the service of Portugal instead.\n',''),
	('0845','04 July 1589','15890704','Sir. For that the proceedings of our Fleete in Portingall','Concerning the state of the English fleet in Portugal, and that the troops have missed their rendezvous.\n',''),
	('0848','09 July 1589','15890704','It may please your H. the 2. of this moneth','Bodley is amazed to hear of the insolent speeches of the special ambassadors. Includes military news.\n',''),
	('0844','09 July 1589','15890709','It may please your LL. the 2. of this moneth, I','Report on issues concerning the different translations of the Articles from the Queen, and on Lord Willoughby\'s cause.\n','The remains of the seal is found on the address leaf. Bodley\'s signature is located in the bottom right corner, with an ink line covering the space above. Fol.2v may carry the endorsement to this letter, reading \'9 Julij 1589, To the LL. from Master Bodleigh.\''),
	('0198','15 July 1589','15890715','It may please your H. in my last of the 9.','Concerning the reply to certain articles put before the States, and news about Schenck\'s recent exploits.',''),
	('0849','15 July 1589','15890715','It may please your L. the last of the 9. of this moneth, which I sent','Military news, and sends a copy of the declaration of Utrecht against Deventer.\n',''),
	('0200','16 July 1589','15890716','Sir the enimy doth strike at the harte of theis countries: for he is','Concerning the Spanish forces\' latest attacks, and requesting Lieutenant Borlas to send 2 companies to the Cautionary towns for extra protection.\n',''),
	('0199','16 July 1589','15890716','Sir the Ennemie hath bin about Bommel, and hath','Recent military news, concerning the Spanish forces at Bommel.\n','At \'Sir, I knowe\', the script continues perpendicular to the main body of the letter.'),
	('0851','23 July 1589','15890723','It may please your H. to be advertised, that','Military news, including the revictualling of Beek.\n',''),
	('1353','24 July 1589','15890724','It may please your H. To be advertized, that as yet I have had','Military news, including the revictualling of Beek.\n',''),
	('0205','28 July 1589','15890728','Sir, In answere to your letters which I received, the one','Concerning Barnevelt\'s attitude towards England, and Bodley\'s instructions.\n',''),
	('0852','28 July 1589','15890728','Sir, In answere to your letters which I received, the one','Regarding the common opinion of Barnvelt, and other news.\n',''),
	('0862','August 1589','15890800','Directions to maister Bodiley her Majesties assistant in the councell of estate','Points to be negotiated and acted upon by Bodley regarding musters and pay.\n','Instructions. The directions are written in a central column. There is no address leaf present.'),
	('0853','02 August 1589','15890802','It may please your H. by my former lettres unto yow the','Lord Willoughby\'s answer to the \'Placcart\' is widespread, and other news.\n',''),
	('0207','02 August 1589','15890802','It may please your L. although I doe not writte','Confirms that the Spanish forces have had full pay of their arrears, and intelligence about their current military strategy.\n',''),
	('0206','02 August 1589','15890802','It may please your H. by my former letters','Concerning Lord Willoughby\'s answer to the Placcart, and Schenck\'s victory at Halteren.\n',''),
	('0854','02 August 1589','15890802','Yt may please your L. although I do not omyt to advertyse','Report on the movement of Spanish troops, and details of Bodley\'s negotiations.\n',''),
	('0855','02 August 1589','15890802','Sir. At the earnest sollicitation of the States some forces','Confirming the allocation of spare troops from the Cautionary towns.\n',''),
	('0208','03 August 1589','15890803','It may please your H. sins I writte my former','News that Colonel Martin Schenck has drowned trying to attack Niemegen.',''),
	('0856','03 August 1589','15890803','After owr vearie hartie Commendacions: By a lettre at this','Bodley is to ask the States for assistance in fortifying Ostend following stormy weather.\n','Instructions. There is no margin on the top or right side of f.73r. The signatures are spread out in the bottom quarter of this folio. The address leaf comprises a separate folio, partially missing, and retains its wax seal.'),
	('0210','09 August 1589','15890809','It may please your H. Uppon the receat of your','Concerning the secrecy surrounding the States\' answer to recent propositions by the English delegation.\n',''),
	('0857','09 August 1589','15890809','It may please your h. upon the Rxt of the lettre of the 25 July which I Rxt by this','Bodley\'s frustrations at the secrecy of the States in his negotiations, and the inhuman treatment of Schenck by the people of Nijmegen.\n',''),
	('0860','12 August 1589','15890812','It maye please your H. there came letters','Regarding numbers of horse and footmen, and military news.\n',''),
	('0858','14 August 1589','15890814','It may please your L. It should seem by consequence that I & Master','Regarding the possible appointment of Count Maurice as Lieutenant general of the English forces.\n',''),
	('0861','15 August 1589','15890815','Yt may please your H. this day the generall states have sent','Concerning recent correspondence with the states, and the weak state of the forces in the Low Countries.\n',''),
	('0211','15 August 1589','15890815','It may please your H. this day the Generall','Bodley has received the answer to his propositions from the States after much delay. Further news on the weak military companies across the campaign.\n',''),
	('0859','20 August 1589','15890820','Yt may please your H. immediately uppon the writing of the last','Diverse military news, including the loss of the House of Heel.\n',''),
	('0212','20 August 1589','15890820','It may please your H. immediatly uppon the wri','Regarding the loss of the House of Heel, and other military news.\n','After the endorsement on the address leaf there is a small florilegium.'),
	('0863','26 August 1589','15890826','yt may please your H. since the death of Schenck we have had much a doo','Financial matters concerning the payment of troops, and other news regarding the wars.\n',''),
	('0216','September 1589','15890900','First, that your peruse all such Acts, as were pro','Points to be negotiated and acted upon by Bodley regarding musters and pay.\n','Instructions. An eighteenth century copy.'),
	('0217','September 1589','15890900','Fyrst that you peruse all sutch Acts as were procured by the Assistants in Councell','Points to be negotiated and acted upon by Bodley regarding musters and pay.\n','Instructions. There is a wide left hand margin of approx. 3 inches.'),
	('0864','September 1589','15890900','Yt may please your H. to advertise my LL of the Counsell, that this day','Mixed news, with special emphasis on Groningen.\n',''),
	('0215','10 September 1589','15890910','It may please your H. since I writte the former','News that the Spanish forces have returned to besiege Bommelsweert.\n',''),
	('0214','10 September 1589','15890910','It may please your H. to advertise my LL of','Concerning the fortification of Ostend, and other military matters.\n','At the words \'the reparing\', \'to solicite\' and \'into her Majesties handes\' on fol.142r, there are three tightly drawn lines written in the margin.'),
	('0866','15 September 1589','15890915','It may please your Ho. since the departure of Persinat by whom I sent','Report of the movements of the Spanish forces, and the situation surrounding Groningen.\n',''),
	('0867','20 September 1589','15890920','Though I trust your L. hath sufficient true','Intelligence that the Spanish king is in possession of a large number of ships.\n',''),
	('0868','25 September 1589','15890925','Sir, Her Majestie hath bene made acquainted withe your Late','Instructing Bodley to arrange a meeting with delegates from Friesland.\n',''),
	('0870','28 September 1589','15890928','It may please your H. to the effect of that which yow write by this bearer','Regarding the imprisonment of Vasseur, and the States\' request to view Bodley\'s diplomatic commission.\n',''),
	('0218','04 October 1589','15891004','It may please your H. The bearer herof pre','Recommending the bearer for some kind of reward for services to Queen Elizabeth.\n',''),
	('0219','04 October 1589','15891004','Sir The Councell heere doth greatly dislike','Concerning the rejection by Lieutenant Borlas of the request for a company by the Council of State.\n',''),
	('0872','07 October 1589','15891007','It may please your H. whereas I was lately written by my LL of','Concerning the fortifications at Ostend and other military news.\n',''),
	('0220','08 October 1589','15891008','It may please your H. wheras I was lately','Regarding Bodley\'s negotiations with the States about the fortifications at Ostend, and that Count Neuenahr is injured in an explosion.',''),
	('0873','10 October 1589','15891010','It may please your H. the messenger that I sent to Embden about the','Regarding Bodley\'s negotiations with several special ambassadors, and military news.\n',''),
	('0874','19 October 1589','15891019','Sir I perceive by your Lettre how hardely and against','Regarding the imprisonment of Vasseur, and instructions for dealing with the States.\n',''),
	('0221','30 October 1589','15891030','It may please your H. to be advertised; that your','Concerning Groningen, and other military news, including the distribution of English foot companies across Holland.',''),
	('0876','30 October 1589','15891030','It may please your H. to be advertised that your Lettre by persyvall of','Concerning the recent rift in North Holland and other military news.\n',''),
	('0222','31 October 1589','15891031','It may please your H. after deliverie of my','News about Count Charles Mansfield\'s besieging of Rijs, and diplomatic information.\n',''),
	('0223','12 November 1589','15891112','It may please your L. Since the writing of my','Concerning the Spanish forces\' taking of Rijs, and of mutinies and problems in the English military companies and garrisons.\n',''),
	('0877','12 November 1589','15891112','It may please your H. at the earnest sute of some spetiall','Concerning the suit of a Dutch captain, and military news.\n',''),
	('0878','12 November 1589','15891112','It may please your L. since the writing of my last, we have had the','Report about the sconce of Rees surrendering to the Spanish forces, and other intelligence.\n',''),
	('0879','12 November 1589','15891112','After our hartye Comendacions Wheras you have bene heretofore by','Touching the repairs of the sea breaches at Ostend, and the States\' lack of response.','There is no right hand margin, with some damage to the text at the edge of the paper, though it remains legible. The address leaf comprises of a separate folio, with the remains of the wax seal still present.'),
	('0224','17 November 1589','15891117','It may please your H. at the earnest sute of','Regarding the delayed reward for the bearer, with news of the siege of Rijs and the widespread munities.\n','Fol.182v is also the address leaf.'),
	('0225','19 November 1589','15891119','It may please your H. There is of the','Vasseur\'s cause delayed due to the Commissioner\'s return from England, and Count Hollack out of favour with the States.\n',''),
	('0226','24 November 1589','15891124','It may please your H. The bearer herof Monsieur','The arrival of Monsieur Lect from Geneva, soliciting the States for aid.\n',''),
	('0881','24 November 1589','15891124','It may please your H. this bearer Monsieur Lect being sent','Regarding the arrival and negotiation of Monsieur Lect from Geneva.\n',''),
	('0882','24 November 1589','15891124','It may please your H. The bearer hereof Monsieur Lect is','Regarding the arrival and negotiation of Monsieur Lect from Geneva.\n',''),
	('0883','28 November 1589','15891128','Sir, For answeare unto your other letters you','Arguing that the town of Utrecht is unlikely to appoint Count Maurice as Governor, and other points relating to Bodley\'s recent letters.\n',''),
	('0227','29 November 1589','15891129','It may please your H. this gentleman Mr','Recommending Lieutenant Lashford for favour.\n',''),
	('1338','03 December 1589','15891203','After my very hartie commendations, The Queenes Majestie','Concerning the appointment of Captain Price to take charge of The Brill during Lord Burgh\'s illness.',''),
	('0885','08 December 1589','15891208','After our hartie comendacions, Whereas her Majestie ys geven to understaund that the vallues','Bodley is to speak with the States of Holland and Zealand, and if necessary with the States Generall, about the undervaluing of coin and the resulting financial loss to the Queen.','The remains of the wax seal are still present on the address leaf. The lettertext is tightly packed into the top half of f.207r, with the signatures spread out over the lower half.'),
	('0913','07 April 1590','15900407','After our harty Comendacions: Whereas we doe undrstand by Lettres from Sir','Bodley is to reject the request of the states to requisition a company from Ostend, since Sir John Conway there is unable to spare them, being surrounded by the enemy and already with few men.','Instructions. Only the superscription survives of the address leaf, and is pasted onto a new folio.\n'),
	('0880','18 December 1589','15891218','It may please your H. the prisonner Vasseur','The harsh weather has delayed correspondence relating to the matter of Groningen and other military news.\n','The final page (fol.196v) comprises the address leaf. The endorsement is hidden under the flap of paper from where the seal has been cut away.'),
	('0887','18 December 1589','15891218','It may please your H. the prisonner Vasseur is at length delivered','The harsh weather has delayed correspondence relating to the matter of Groningen and other military news.\n',''),
	('0890','21 December 1589','15891221','What is intended by the Magistrates of Utrecht I','Report that the Magistrates of Utrecht have resolved to depose at least 2 of their ministers.\n',''),
	('0228','21 December 1589','15891221','It may please your H. presently after the','The Council of State in negotiations to have their authority enlarged, plus military news including the siege of Rijs.\n',''),
	('0892','26 December 1589','15891226','It may please your LL. to be advertised, that','The States\' response concerning the fortifications of Ostend.\n','Bodley\'s signature is located in the centre of the base of the folio, with an ink line covering the area above it.'),
	('0893','26 December 1589','15891226','It may please your H. to understand, that','Concerning the fortification of the Isle of Biervliet, which might provide a safe harbour for the Spanish fleet.\n',''),
	('0894','26 December 1589','15891226','It may please your LL. to bee advertized that according to the tenor of your','The States\' response concerning the fortifications of Ostend.\n',''),
	('0229','26 December 1589','15891226','It may please your H. to understand that sins','Concerning the Isle of Biervliet, and its possible use as a harbour for the Spanish fleet.\n',''),
	('0922','09 May 1590','15900509','It may please your L. to be advertised that 4 days past','Bodley warns of the lies and impertinence in the States General\'s latest answer to Queen Elizabeth, and mentions the siege of Nieumegen.','\n'),
	('0241','12 May 1590','15900512','It may please your L. to be advertised, that sins','News of the Council of State\'s remonstrance against the States General, and recent news from Niemeghen.','\n'),
	('0924','12 May 1590','15900512','It may please your L. to bee advertised that since the writing of my last','Bodley updates Burghley on the situation in Guelderland, on rumours currently circulating, and on the complaints by the Council of State that the States General usurps their authority.','\n'),
	('0927','08 May 1590','15900508','After our hartie comendacions: Whereas the States generall by two severall','Regarding restitution of the goods taken from merchants of the United Provinces by English subjects, and the former\'s trade with Spain.','Instructions. No address leaf.\n'),
	('1357','27 April 1590','15900427','Right honorable, and my singular good Lord, having','Regarding an enterprise to be taken upon Groningen, and disagreements in Ostend that threaten that town\'s stability.','\n'),
	('0919','28 April 1590','15900428','Right honorable and my singular good Lord,','Regarding an enterprise to be taken upon Groningen, and disagreements in Ostend that threaten that town\'s stability.','On fol.121r there is a signature of a capital \'W\' at the base of the page.\n'),
	('0921','06 May 1590','15900506','After our verie hartie Commendacons. Whereas there remaineth at','Bodley is to deal with the town of Hoorn to recover the money from the sale of the goods of a ship taken from the Portugal voyage.','There is a signature \'Z\' on the bottom middle of f.114r.\n'),
	('0920','01 May 1590','15900501','Sir. By theise inclosed you maye perceive that one','Bodley is to refer a captain of the Low Countries, who has been seeking recompense from England, back to the States General.','\n'),
	('0923','11 May 1590','15900511','Sir. After my vearie hartie Commendacions: I have recei','Regarding the enterprise on Groninghen and the vital need for secrecy. Lord Buckhurst will go to the Low Countries shortly.','\n'),
	('0905','06 January 1590','15900106','It may please your H. shortly after the writing','Bodley conveys intelligence received of Monsieur Buis regarding the present state of the country, and gives an update of his discussions with the States General on the siege of Beek.','On fol.35r there is a signature of a capital \'G\' at the base of the page.\n'),
	('0906','12 January 1590','15900112','There hath bin some troble of late in the towne of Bom','Bodley reports of Catholic Burghermasters in Bommel and of a new messenger come from Beek. It is believed that if the Countess of Neuenahr obtains control of the town she will surrender it to the enemy for her own gain.','On fol.37r there is a signature of a capital \'H\' at the base of the page.\n'),
	('0904','14 January 1590','15900114','May it please your good L. to advertise her Majestie','Replies to several issues contained within recent letters from Burghley and the Privy Council. Bodley also requests to be sent home.','On fol.32r Burghley has drawn a pedigree of the Merode family, noting Sir Thomas Morgan and Sir Thomas Knollys as having married the two daughters.\n'),
	('0931','30 May 1590','15900531','It may please your L to bee advertized that your L letter of the 23. of this moneth','Bodley laments the delay of Lord Buckhurst\'s arrival.','\n'),
	('0930','31 May 1590','15900531','It may please your LL to be advertised, that this bearer Master Browne','A report concerning Master Browne\'s attempts to receive repayment from the Council of State, regarding captains, bills etc.','The top layer of the paper is effaced in places, removing the text.\n'),
	('0249','June 1590','15900600','Trusty and welbeloved we gret yow well. wher of late we','Instructions for Bodley to work with and advise Thomas Wilkes, sent from England to the States General.','Instructions. The address leaf is slightly ripped. There is a \'G\' symbol at the end of the lettertext.\n'),
	('0933','June 1590','15900600','It would be an occasion, that they will geve','An annotated draft of points of consideration in response to the Queen\'s letters and the contract between the United Provinces and England.','There is a signature \'FF.\' on f.174r, base left. There is a deleted, illegible sentence in the left margin of f.175r, next to point 22.\n'),
	('0243','31 May 1590','15900531','It may please your L. to be advertised that','Bodley\'s report that the insufficient forces available for the recovery of Groningen suggest that the Queen\'s letters be delayed until the enterprise begin.','\n'),
	('1123','1592','15920000','Mr Bodley I thank you very hartely for your','Thanks Bodley for his efforts to interceded on his behalf with the States, explains the necessity of the release of the English companies, and informs him of the latest actions of the Duke of Parma.','\r\n'),
	('1095','27 January 1592','15920127','May it please your good L. The Emperors Ambassador, of whose arrival at the','Concerning the Emperor\'s Ambassador (Bilandt) and Bodley\'s advice to the States for dealing with his proposed Treaty of peace.','This document is badly fire damaged.\r\n'),
	('0236','23 March 1590','15900323','It may please your L. to be advertised that','News that the enemy have taken the castle of Sevenbergen near Breda, and other military skirmishes.','\n'),
	('0237','28 March 1590','15900328','It may please your H. to Be advertised, that','Concerning the reduction in taxation by the Low Countries of English cloth.','At the words \'the Councel\' and \'signified unto them\' on fol.262r, there are three tighly drawn vertical lines in the margin.\n'),
	('0566','06 April 1590','15900406','A lettre to Master Bodley: Wheras wee do understand by lettres from Sir John','Bodley is to reject the request of the states to requisition a company from Ostend, since Sir John Conway there is unable to spare them, being surrounded by the enemy and already with few men.','\n'),
	('1099','10 January 1592','15920110','May it please your good L. with her Highnes letter unto me of the 19. of Dec','Bodley refutes accusations that he should have signified the fewer numbers comprising the English troops than had been previously claimed. The arrival of Bilandt, the Emperor\'s Ambassador.','This document is badly fire damaged.\r\n'),
	('0233','03 March 1590','15900303','It may please your H. having lately cer','The situation in Breda, regarding the numbers in garrison. Also, the news that several enemy garrisons have mutinied, and that the town of Hassell has transferred allegiance to Friesland from Overijssel.','\n'),
	('0234','15 March 1590','15900315','Sir, to the same effect, as the Councell of estate hath written unto you','Confirmation that the English forces in the Low Countries will only be directed by the Council of State.','\n'),
	('0911','15 March 1590','15900315','After our verie hartie Commendacions: The Quenes Majestie fynding it very strange, that to','Bodley is to convey the Queen\'s displeasure at their ungrateful and hard dealing, and gives instructions regarding soldiers\' pay in victual and clothing.','The text is particularly small and faint. There is a signature \'R\' on the base of fol.97r\n'),
	('0912','15 March 1590','15900315','Trusty and welbeloved we grete yow well. Uppon the arryvall of the Lord','Bodley is to dissuade the States General from proceeding further with their secret unilateral siege of Geertruidenberg and instead to use non-violent means to prevent the town from converting to the enemy.','The superscription is pasted onto a new folio sheet. F.101 is slightly shorter vertically than the standard folio size in the volume.\n'),
	('0901','1590','15900000','The effect of a motion made unto me, by a principal person of the states','Comprising of notes on items over which Bodley is to negotiate with the States General.','\n'),
	('0909','04 January 1590','15900104','After our hartye Comendacions: Whereas the Quenes Majestie is desirous to','The privy council enclose additional directions on the taking of musters in order to eliminate the usual fraud and abuse committed by the captains in this matter, which Bodley is to convey to the relevant parties.','There is no address leaf. In the centre of the lettertext it appears that a 2cm section was ripped away then re-attached; a few words are slightly unclear as a result.\n'),
	('0244','31 May 1590','15900531','It may please your L. to be advertised, that','Bodley laments the delay of Lord Buckhurst\'s arrival.','\n'),
	('0239','18 April 1590','15900418','It may please your H. to be advertised, that','The States General has dispatched copies of Queen Elizabeth\'s letters to the provinces: Bodley awaits a reply.','\n'),
	('0929','30 May 1590','15900530','Right honorable & my very good L. I am  don to witt that her majestie','Informing Buckhurst that the task facing him in the Low Countries is a difficult one.','\n'),
	('0571','24 May 1590','15900524','A lettre to Thomas Bodley Esquire. Wheras ther remaineth at Horne','Bodley is to deal with the town of Hoorn to recover the money from the sale of the goods of a ship taken from the Portugal voyage.','There is a curved bracket next to the marginalia, pointing towards the main body of the text.\n'),
	('0240','09 May 1590','15900509','It may please your L. to be advertised, that','Concerning the untruths written in a recent letter from the States General to the Privy Council. Also, news from the military campaign.','\n'),
	('0925','12 May 1590','15900512','Trusty and welbelovid wee greate yow well Wheare both by yowr Lettre directed to owr Threasuror','Warrant authorising Bodley to convey the Queen\'s letters and support to the town of Groningen, whose burghesses have entered into secret intelligence with Bodley as they are considering rejecting Spanish control.','The text is written in landscape format. There is a large rip in the top left corner, and the ink has bled through from the folio being folded in on itself. There is a signature - \'A\' - on the middle of the bottom edge.\n'),
	('0916','18 April 1590','15900418','It may please your LL to be advertised that I have performed the','Bodley reports back to the Privy Council that the States General are still deliberating over their answer to the last proposition. He has not yet been able to communicate their points to the Council of State, but will at the next available opportunity.','The letter is highly abbreviated and tighly written in the top right quadrant of the folio.\n'),
	('0928','23 May 1590','15900523','Sir. As I remember I have heretofore by my lettres lett yowe','Informing Bodley that Lord Buckhurst will not be sent as a further English delegate, but that Thomas Wilkes will be sent in his place.','\n'),
	('0926','17 May 1590','15900517','It may please your L. to be advertized that by lettres which I','Groninghen has expelled the King\'s governor and council, and entered into conversation with the States of Friseland. Bodley requests that a letter be written to Groningen from Queen Elizabeth.','\n'),
	('0242','17 May 1590','15900517','It may please your L. to be advertised, that','Urgent news that Groningen has ejected the Governor in favour of the King of Spain, and Bodley\'s request that letters be sent from England urging them to rejoin the allies.','\n'),
	('0907','15 January 1590','15900115','Sir, your proceadinges in your Charge there [General]','Walsingham conveys the positive response given to Bodley\'s last dispatches, but informs him that despite his efforts Queen Elizabeth does not look favourably on Bodley\'s request to return home for a few months.','\n'),
	('0908','16 January 1590','15900116','The late petition presented to the King by the states','Bodley recounts his conference with Monsieur Buis, touching the Council of State\'s lack of real power.','This letter is pasted into the volume slightly oddly: with the second page of the letter (fol.39r) presented first, and with a letter from the Privy Council to Bodley (Letter ID 0909) bound between the two leaves of the letter.\n'),
	('0230','19 January 1590','15900119','It may please your H. in my former letters, with','The appointment of a council to attend on Count Maurice, and the arrival of Agileus from England.','\n'),
	('1365','February 1590','15900200','Sir. The Argument of my letter will appeare to yowe to','Concerning the ambassadors sent from the Emperor to negotiate a peace treaty between the United Provinces and Spain.','\n'),
	('0231','21 February 1590','15900221','It may please your H. to be advertised, that the','The Council of State agrees to a general muster of Queen Elizabeth\'s forces. Bodley mentions his suit to return to England for a month.','At the words \'for a muster generall\' there are four tightly drawn lines in the margin.\n'),
	('0232','23 February 1590','15900223','It may please your L. to be advertised','News of the taking of Breda by Count Maurice.','\n'),
	('0910','01 March 1590','15900301','After our hartie commendacions: we are given to understand by the merchants Adventurers residing at','Bodley is to convey the displeasure of the Queen concerning a new taxation on cloth imposed by the States, as alerted to the Privy Council by the Merchant Adventurers.','Instructions. The address leaf is before the lettertext in the volume, and only superscription survives, pasted onto a new folio.\n'),
	('0238','18 April 1590','15900418','It may please your LL. to be advertised that I','Bodley reports back to the Privy Council that the States General are still deliberating over their answer to the last proposition. He has not yet been able to communicate their points to the Council of State, but will at the next available opportunity.','The remains of the seal are found on the address leaf. There are three vertical lines in the margin alongside lines eight to ten, and there is one large square bracket after \'demaunded\', and a space on same line.\n'),
	('0918','18 April 1590','15900418','It may please your L. to be advertised, that','Bodley discusses the idea of constructing a new treaty with the United Provinces, conveys their typical allegations against English support, and relates various rumours and pieces of intelligence.','\n'),
	('0869','27 September 1589','15890927','Right honorable & my singular good Lord, to the purpose of that motion','Reporting the amendment of the titles accorded Count Maurice and other military news.',NULL),
	('0935','June 1590','15900600','Concerning Monsieur St Aldegonde, it was thus','A description of St. Aldegond, explaining his recent overtures to the King of France.','\n'),
	('0934','13 June 1590','15900613','It may please your L. to receave a copie of that,','Concerning the harsh task that Thomas Wilkes faces in negotiating with the States General.','\n'),
	('0246','15 June 1590','15900615','It may please your L. There are two honest','Requesting that William Gent and John Chamberlain be given the charge of conveying the next packet of diplomatic mail, in order that their business with Bodley may be expedited.','\n'),
	('0247','15 June 1590','15900615','It may please your L. to be advertised that the','News that the Enemy has increased his troops in the Groningen area.','\n'),
	('0936','June 1590','15900615','It may please your L. There are two honest gentlemen in London','Requesting that William Gent and John Chamberlain be given the charge of conveying the next packet of diplomatic mail, in order that their business with Bodley may be expedited.','\n'),
	('0937','18 June 1590','15900618','Good Master Bodeley, though I receave from you many, and return to yow','Indicating that he has read Bodley\'s letters out loud to Elizabeth, and instructing him and Wilkes on how to proceed.','\n'),
	('0938','18 June 1590','15900618','Trusty & welbelovid we greate you well. Where of late we','Bodley is to assist Wilkes in his mission, and is congratulated for his good service.','Instructions. The folio is c.5cm shorter than the usual height. There is no address leaf.\n'),
	('0572','23 June 1590','15900623','A lettre to Master Wilkes and Master Bodley Wheras the Estates Generall','Bodley and Wilkes are to negotiate regarding ships from the Portugal voyage and their financial demands.','\n'),
	('0248','24 June 1590','15900624','After our right hartie Commendacions. Wheras the Estates Generall','Bodley and Wilkes are to negotiate regarding ships from the Portugal voyage and their financial demands.','The endorsement on f.308v is by Thomas Wilkes.\n'),
	('0939','06 July 1590','15900706','After my vearie hartie Commendacions to yowe both','Burghley writes to correct any previous impression he may have given that St. Aldegond is untrustworthy, or that the French King had stated as much.','\n'),
	('0940','09 July 1590','15900709','It may please your L. to be advertised, that I','Bodley gratefully acknowledges Burghley\'s patronage, and relates news that the Council of State intends to follow the military campaign from the nearest town possible. News of the siege at Niemegen.','On fol.195r there is a signature of LL.\n'),
	('0655','12 July 1590','15900712','Trusty and welbeloved we grete yow well wher as','Instructions ordering Bodley and Wilkes to present Monsieur Sonoy\'s cause to the States General, Council of State and if possible to Count Maurice.','\n'),
	('0941','14 July 1590','15900714','May it please your L. I was visited of late by','Information from a recent conversation with Paul Buis.','\n'),
	('0942','16 July 1590','15900716','Sir. After my vearie hartie Commendacions: with','Bodley and Wilkes are to dissuade the States General and the public from listening to arguments for peace.','On fol.204r there is the signature NN.\n'),
	('0944','18 July 1590','15900718','May it please your LL to be advertised, that','Bodley conveys the State\'s demand to have the goods taken by Sir Martin Frobisher returned, and requests an answer from the Privy Council to placate the States.','Wilkes\' signature is supplied by Bodley.\n'),
	('0945','18 July 1590','15900718','May it please your good LL. As by our former lettres we have already signified','Bodley explains in careful detail the State\'s unsatisfactory answers to the Queen\'s demands, and reports his responses and the conference between them. He also discusses slanderous rumours which have been circulating.','There is a signature \'OO\' in the middle of the bottom of f.208r. The manuscript is heavily annotated, with many interlinear additions. There is a deleted line written horizontally in the left margin of f.211r. Opposite this in the main body of the text a \n'),
	('0947','20 July 1590','15900720','Trusty and welbeloved, wee greete yow well. Whereas monsieur Snoy','Instructions ordering Bodley and Wilkes to present Monsieur Sonoy\'s cause to the States General, Council of State and if possible to Count Maurice.','The superscription is pasted onto a new folio. There is a slight folding crease and the remains of a piece of string on the outside vertical edge of the folio, suggesting it may have been cut and bound differently previously.\n'),
	('0948','21 July 1590','15900721','According to your L letter to Master Wilkes & mee I do alwaies endevor to make the best','Bodley defends his conduct regarding St. Aldegond and states that he will induce the States General to publish a restitution for parties concerned.','\n'),
	('0551','22 July 1590','15900722','May it please your good LLp: as by our former lettres we have','Bodley explains in careful detail the State\'s unsatisfactory answers to the Queen\'s demands, and reports his responses and the conference between them. He also discusses slanderous rumours which have been circulating.','\n'),
	('0251','22 July 1590','15900722','Trustie and welbeloved wee greate you well. Your','Bodley and Wilkes are to defend the cases of three captains who have petitioned the Queen about their service in the United Provinces.','No address leaf.\n'),
	('0950','22 July 1590','15900722','Trusty and welbelovid, we greate you well. ye shall understand that heer have','Bodley and Wilkes are to defend the cases of three captains who have petitioned the Queen about their service in the United Provinces.','The right hand edge of paper (c.2.5cm) is folded over onto itself. There is a discoloured oily blot present, probably from the wax seal. \'SS\' appears at the bottom of f.229r, below the text. The superscription is cut and pasted onto a later folio sheet. T\n'),
	('0951','24 July 1590','15900724','After our hartie Comendations, Wheras the Estates Genall have','Bodley and Wilkes are to negotiate regarding ships from the Portugal voyage and their financial demands.','\n'),
	('0253','26 July 1590','15900726','After our hartie commendacions. Yow shall understand that before your lettres','Concerning merchant ships from the Low Countries taken when coming out of Spain by Captains Frobisher and Hawkins.','The imprint of the seal is still present.\n'),
	('0574','27 July 1590','15900727','A Lettre to Master Wilkes and Master Bodley emploied at this','Concerning merchant ships from the Low Countries taken when coming out of Spain by Captains Frobisher and Hawkins.','No address leaf.\n'),
	('0553','29 July 1590','15900729','May it please your good LL: By our last of the xxijth of this presente we signifyed','An extensive report of Bodley\'s dealings with the States on the matter of shared power and authority.','\n'),
	('0254','29 July 1590','15900729','May it please your good LLp. By our Last of the xxiith of this present, we signifyd','An extensive report of Bodley\'s dealings with the States on the matter of shared power and authority.','\n'),
	('0955','29 July 1590','15900729','May it please your good L. What courses we','Concerning recent exchanges with the States General, and the general feeling of the inhabitants of the Low Countries.','\n'),
	('0954','29 July 1590','15900729','Maye it please your good Lordshipe by our Laste of the','An extensive report of Bodley\'s dealings with the States on the matter of shared power and authority. ','This is probably a later copy since the text is in a neat central column and there is no signature or address leaf. There is a signature \'VV\' at the base of fol.239r.\n'),
	('0958','06 August 1590','15900806','May yt please your good L. I sent my last unto yow the','Regarding those of the Provinces\' deputies who are ill-affected towards Queen Elizabeth, and the States\' feelings towards the English and the French.','\n'),
	('0959','07 August 1590','15900807','After my vearie hartie Commendacions: forasmuch as this','Burghley recommends the bearer Richard Allen to Bodley\'s service.','\n'),
	('0575','10 August 1590','15900810','A Lettre to Thomas Wilkes and Thomas Bodeley esquires. Whereas her Majestie','Regarding the appointment of Sir Edward Norris to replace Sir John Conway as Governor of Ostend, and the co-operation expected from the States.','No address leaf.\n'),
	('0555','10 August 1590','15900810','Uppon a lettre from the States generall addressed unto us at the Haghe','The States General continue to request a written account of Bodley and Wilkes\' answer to their objections over the articles regarding trade with Spain, which Bodley sees as a time-wasting tactic.','\n'),
	('0960','11 August 1590','15900811','After our hartie Comendacions: Whereas her Majestie for the better satisfaccion of','Regarding the appointment of Edward Norris to replace John Conway as Governor of Ostend, and the cooperation expected from the States.','No address leaf. There is a signature \'YY\' on the base of f.257r.\n'),
	('0255','19 August 1590','15900819','May it please your good L. It were to be tedious','Bodley mentions those in England who attempt to slander him, and recommends that Francis Allen be made captain of a company.','\n'),
	('0256','23 August 1590','15900823','May it please your good L. There is lately','Bodley recommends the promotion of John Throckmorton following the death of his captain.','\n'),
	('0961','23 August 1590','15900823','May it please your good L. there is lately','Bodley recommends the promotion of John Throckmorton following the death of his captain.','\n'),
	('0962','23 August 1590','15900823','May it please your good L. within these three','Information from a former inhabitant of Dunkirk, offering information to assist in beseiging the town.','On fol.226r there is the signature AAA.\n'),
	('0257','27 August 1590','15900827','May it please your good L. Heere is nowe in','Bodley conveys intelligence from several sources, including information on someone intending harm towards Queen Elizabeth.','\n'),
	('0963','27 August 1590','15900827','May yt please your good L. Heer is now in Delft one','Bodley conveys intelligence from several sources, including information on someone intending harm towards Queen Elizabeth.','On fol.269r there is the signature BBB.\n'),
	('0964','07 September 1590','15900907','After my very harty Comendations of late I have receaved','Bodley is to obtain further details on the proposed recovery of Dunkirk.','The address leaf is mostly missing, obscuring the superscription.\n'),
	('0967','08 September 1590','15900908','Sir. Hir Majestie being vearie desirous that at this time','Bodley is urged to encourage new attempts on the enemy\'s territory, especially in Flanders.','\n'),
	('0656','09 September 1590','15900909','Trusty and welbeloved we gret yow well.','Bodley is to encourage immediate incursions into Enemy territory on the opportunity of the Duke of Parma\'s troops being diverted into France.','fol.97 is a small slip of paper, burned around the edges up to the text.\n'),
	('0966','10 September 1590','15900910','Sir. Though the bearer herof Captaine Allen hath','Burghley explains why Captain Allen was not given the late Captain Smith\'s commission, and refers to other letters enclosed.','\n'),
	('0965','10 September 1590','15900910','Trusty and welbeloved we greet you well. Although we did verie latelie comaund our','Bodley is to encourage immediate incursions into Enemy territory on the opportunity of the Duke of Parma\'s troops being diverted into France.','The paper is particularly thin, with a prominant watermark. Conservation work on the verso renders some of the text very faint.\n'),
	('0968','15 September 1590','15900915','Sir. Since the retorne hither of Master Wilkes, and havinge','The Queen has signed letters to be delivered to twelve of the most important towns from the larger list Bodley and Wilkes had suggested.','\n'),
	('0259','21 September 1590','15900921','May it please your good L. to advertise her','Bodley has delivered Queen Elizabeth\'s letters to the States General, and reports on their response and relevant news, including an update on the enterprise of Dunkirk.','\n'),
	('0969','21 September 1590','15900921','May yt please your good L. To advertise her Hignes that according','Bodley has delivered Queen Elizabeth\'s letters to the States General, and reports on their response and relevant news, including an update on the enterprise of Dunkirk.','On fol.276r there is the signature CCC.\n'),
	('0260','22 September 1590','15900922','May it please your good L. my last unto yow, the','Bodley conveys news on recent letters from agents in France and on a visit by German ambassadors, and reiterates that he does not know the appearence of the malcontent said to be plotting against the Queen.','\n'),
	('0970','22 September 1590','15900922','May yt please your good L. my last unto you of the 21. of','Bodley conveys news on recent letters from agents in France and on a visit by German ambassadors, and reiterates that he does not know the appearence of the malcontent said to be plotting against the Queen.','On fol.279r there is the signature DDD.\n'),
	('0971','28 September 1590','15900928','May yt please your good L. before the taking of the house of','Bodley reports on the military situation following the taking of Hemert and Heel.','The endorsement on the address leaf is mostly faded and illegible.\n'),
	('0261','28 September 1590','15900928','May it please your good L. After the taking of','Bodley reports on the military situation following the taking of Hemert and Heel.','\n'),
	('0262','30 September 1590','15900930','May it please your good L. because Master','The States General and Council of State are sending a letter to Queen Elizabeth regarding the agreed exploit in Flanders.','\n'),
	('0264','07 October 1590','15901007','May it please your L. to be advertised that','Bodley requests that Queen Elizabeth sign letters addressed to all the principal towns for fear of bad feeling if some receive such but not others. He also recommends Master Buis.','\n'),
	('0972','07 October 1590','15901007','May it please your L. to bee advertised, that after I','Bodley requests that Queen Elizabeth sign letters addressed to all the principal towns for fear of bad feeling if some receive such but not others. He also recommends Master Buis.','The endorsement on the address leaf is mostly faded and illegible. On fol.282r there is the signature EEE.\n'),
	('0263','07 October 1590','15901007','Trustie and welbeloved wee greate yow well. Wee','Regarding deployment of men to Ostend and for an exploit in Flanders. Bodley is to secretly investigate the viability of this exploit.','\n'),
	('0265','08 October 1590','15901008','May it please your good L. The fitte','Regarding the surrender of the town of Steenberghen.','\n'),
	('0973','08 October 1590','15901008','May it please your good L. The fitte','Regarding the surrender of the town of Steenberghen.','\n'),
	('0974','08 October 1590','15901008','Sir. Collonell Steward nowe latelie sence his retorne','Bodley is to facilitate the payment owed to Colonel Steward in order to prevent him from using his letter of mark in place of financial restitution.','\n'),
	('0975','09 October 1590','15901009','Sir. I have this daye delyvered my lettres to a serrvant of Coronells','Bodley is to send to England the contact who proposed a new secret enterprise against Dunkirk.','\n'),
	('0266','28 October 1590','15901028','May it please your good L. Having written','Bodley sends Burghley copies of letters from the King of Spain to his ambassador to the Emperor.','\n'),
	('0267','28 October 1590','15901028','May it please your L. Fower daies past, I','Regarding Count Maurice\'s unsuccessful attack on Dunkirk.','\n'),
	('0978','28 October 1590','15901028','May yt please your L. 4 daies past I Rxd your L. Letter','Regarding Count Maurice\'s unsuccessful attack on Dunkirk.','On fol.305r there is the signature HHH.\n'),
	('0372','23 January 1592','15920123','May it please your good L. As I writte in','News that the Council of State has granted a passport for Bilant, the Emperor\'s Ambassador, to come to the Hague, and rumours that Duke Casimir and others have been poisoned.','\r\n'),
	('0977','28 October 1590','15901028','May it please your good L. Having written a','Bodley sends Burghley copies of letters from the King of Spain to his ambassador to the Emperor.','\n'),
	('0268','30 October 1590','15901030','Trustye and welbeloved wee greate yowe well. Wee have recei','Regarding deployment of men to Ostend and for an exploit in Flanders. Bodley is to secretly investigate the viability of this exploit.','Draft, endorsed by Burghley with the date and \'not sent\'.\n'),
	('0269','03 November 1590','15901103','May it please your good L. Notwithstanding the','Regarding the secret exploit [against Dunkirk], and news that the States General are sending a delegation to England to protest at the interruption of Low Countries\' trade with Spain.','\n'),
	('0979','03 November 1590','15901103','May yt please your good L. Nowithstanding the ill successe','Regarding the secret exploit [against Dunkirk], and news that the States General are sending a delegation to England to protest at the interruption of Low Countries\' trade with Spain.','On fol.312r there is the signature KKK.\n'),
	('0270','12 November 1590','15901112','May it please your good L. Having re-','Regarding the practise against \'s-Hertogenbosch by Count Maurice, and the delayed voyage of the delegation.','\n'),
	('0980','12 November 1590','15901112','Sir. At [one] time I haue received two of your letters both','A response to the copies of letters sent by Bodley concerning the King of Spain\'s recent correspondence with the Emperor.','\n'),
	('0981','12 November 1590','15901112','May it please your good L. having recom-','Regarding the practise against \'s-Hertogenbosch by Count Maurice, and the delayed voyage of the delegation.','\n'),
	('0982','19 November 1590','15901119','May it please your L. The pensyoner of whose intent I','Information about the topography of Dunkirk with reference to a map sent to Burghley. Bodley requests a cipher.','\n'),
	('0271','19 November 1590','15901119','May it please your L. The pensioner, of whose','Information about the topography of Dunkirk with reference to a map sent to Burghley. Bodley requests a cipher.','\n'),
	('0280','16 January 1591','15910116','May it please your good L. Wheras petition','Concerning the expansion of the English horse and foot bands.','\r\n'),
	('0272','07 December 1590','15901207','May it please your good L. Yesternight the','Concerning the answer of the States General, long overdue, and the reasons for the delay.','\n'),
	('0983','07 December 1590','15901207','May yt please your good L. Yesternight the generall states sent their','Concerning the answer of the States General, long overdue, and the reasons for the delay.','On fol.333r there is the signature OOO.\n'),
	('0273','14 December 1590','15901214','May it please your good L. The mater of Berghen','Concerning the issue of Sir Thomas Morgan, the Governor of Bergen op Zoom, and his father-in-law\'s attempts to turn him to the side of the enemy.','\n'),
	('0984','14 December 1590','15901214','May yt please your good L. The matter of Berghen wherof I','Concerning the issue of Sir Thomas Morgan, the Governor of Bergen op Zoom, and his father-in-law\'s attempts to turn him to the side of the enemy.','On fol.339r there is the signature PPP.\n'),
	('0985','16 December 1590','15901216','Sir. It hath pleased hir Majestie at this time by her','Regarding the ransom of Martin de la Faille.','\n'),
	('0986','22 December 1590','15901222','Trusty and welbeloved, We greete you well. Although we heare that certain','Instructions for Bodley, including comments on the lack of maintenance and defence of Ostend. The Queen threatens denying future favour if the States continue to deny and delay demands made of them.','Half of fol.344 is cut away, removing most of the superscription. There is a signature \'ZZZ\' on the base of fol.343r.\n'),
	('0274','23 December 1590','15901223','Trusty and welbeloved we Greet yow well.','Instructions for Bodley, including comments on the lack of maintenance and defence of Ostend. The Queen threatens denying future favour if the States continue to deny and delay demands made of them.','\n'),
	('0987','24 December 1590','15901224','Sir It is soe longe since I wroate unto yowe for the havinge','Answering the various points in Bodley\'s recent letters.','On fol.345r there is the signature RRR.\n'),
	('0275','25 December 1590','15901225','Trusty and welbeloved we great yow well. at this','Notes on bands to be taken out of Holland in aid of the French King in order to expel the Spanish from Brittany.','\n'),
	('0988','29 December 1590','15901229','May yt please your good L. to bee advertised that I sent y[ow] the [7 of]','News that the Emperor has sent ambassadors to negotiate a peace treaty.','\n'),
	('0276','29 December 1590','15901229','May it please your good L. to be advertised, that I','News that the Emperor has sent ambassadors to negotiate a peace treaty.','\n'),
	('0989','30 December 1590','15901230','After the closyng up of all my lettres I did as yesterday','Concerning the matter of Sir Thomas Morgan, Governor of Bergen op Zoom and his father-in-law\'s attempt to win him to the enemy\'s side.','\n'),
	('0281','23 January 1591','15910123','May it please your good L. I have yet','Mixed news, including the proposed trading restrictions with townes under the Catholic League\'s control.','\r\n'),
	('0282','03 February 1591','15910203','May it please your good L. to advertise her Majestie','Concerning the proposed levies of English soldiers, and other intelligence.','\r\n'),
	('0284','09 February 1591','15910209','May it please your good L. to be advertised, that','Report concerning the disbanding of the English troops in the Low Countries.','\r\n'),
	('0285','11 February 1591','15910211','May it please your good L. After I had written','Notice that the States\' answer to the recent Propositions has arrived, and is enclosed within this letter.','The enclosure mentioned in this letter is not present in the volume.\r\n'),
	('0286','16 February 1591','15910216','May it please your good L. for as muche as Sir','Report of the intended movement of English companies.','\r\n'),
	('0287','27 February 1591','15910227','May it please your good L. Heere is great expectation','Concerning the provision for the English military troops which are to be disbanded.','\r\n'),
	('0288','01 February 1591','15910201','Sir. Your latest lettres be of the xiijth & xvjth of this moneth','Concerning the dispute between Sir John Norris and the captains of the bands.','At the words \'hir Majesty\' towards the end of the page on fol.207v, Burghley continues writing perpendicular in the left hand margin.\r\n'),
	('0289','01 March 1591','15910301','Trustie and welbeloved wee greate yowe well./ Althowgh','Bodley is congratulated on his good service. Ambassadors have arrived from the Emperor to offer peace in the King of Spain\'s name. Bodley is to dissuade any assent to this.','\r\n'),
	('0290','16 March 1591','15910316','May it please your good L. I sent my last before','Concerning the enlarging of the Garrison of Ostend and other military items of news.','Fol.247r is the address leaf.\r\n'),
	('0291','18 March 1591','15910318','I have sent your L. the inclosed by a former','News that the town of Ostend is under threat.','A later addition by an archival hand incorrectly states this as 18 May 1590.\r\n'),
	('0292','23 March 1591','15910323','May it please your good L. a letter from yow of','Concerning the provisions made for an enemy attack against Ostend, Sir Edward Norris\' relationship with the States General, and recent correspondence with Sir Horatio Pallavicino.','Fol.278r is the address leaf. There are two florilegia beneath the endorsement. At the word \'expostulat\' on fol.279r, there are three vertical lines inscribed in the left hand margin.\r\n'),
	('0293','03 April 1591','15910403','May it please your good L. by Sir John Norreis','Concerning the additional protection of Ostend, dissuading the States from a peace treaty, and informing Lord Willoughby of the specification of the mercantile shipping of the Low Countries.','\r\n'),
	('0294','03 April 1591','15910403','May it please your good LL. Wheras the L','Bodley\'s answer to the matter concerning the money owed to Lord Willoughby during his governorship of Bergen op Zoom.','\r\n'),
	('0296','15 April 1591','15910415','May it please your good L. although no','Concerning the movements of the enemy and military finance.','\r\n'),
	('0297','17 April 1591','15910417','May it please your good L. This day I recea-','Concerning letters sent to the states, and the illegal election of Count Maurice to the government of Gelderland.','\r\n'),
	('0298','26 April 1591','15910426','Sir I can not choose in duty, being','Requesting extra troops.','At the word \'declare\' on fol.355r, the writing continues perpendicular to the body of the letter in the left hand margin.\r\n'),
	('0299','30 April 1591','15910430','Sir, The letter of this Councell, and the','Requesting the requisition of three companies of soldiers which were lately sent from Bergen op Zoom and Flushing.','\r\n'),
	('0300','05 May 1591','15910505','May it please your good L. There is order','News of military skirmishes, including the surprising of Westerloo.','\r\n'),
	('0301','14 May 1591','15910514','May it please your good L. to the effect of my','Various military intelligence, including news of the unrest in Niemegen, and a report of two ships which escaped from Cadiz.','\r\n'),
	('0302','16 May 1591','15910516','May it please your good L. being instantly re-','Concerning the suit of an assistant of the recent Dutch delegation to England.','\r\n'),
	('0303','17 May 1591','15910517','May it please your good L. by my letter','Concerning the besieging of Zutphen by Sir Francis Vere.','\r\n'),
	('0304','21 May 1591','15910521','May it please your good L. I declared in','A further report of the siege of Zutphen in which Count Overstein was shot in the head.','\r\n'),
	('0305','22 May 1591','15910522','May it please your good L. We have worde','News that the town of Zutphen has entered into parley with Count Maurice.','\r\n'),
	('0306','May 1591','15910500','Trusty &c. Wee dowbt not but yt is well seen','Bodley is to require that English troops currently in the Low Countries be diverted to aid the King of France, on promise that the numbers will be replenished in the United Provinces once the exploit against Rouen is over.','The intralinear annotations and final page are in Lord Burghley\'s hand.\r\n'),
	('0307','01 June 1591','15910601','May it please your good L. I receaved this','General news, including the surprise of Deventer.','\r\n'),
	('0308','02 June 1591','15910602','May it please your good L. because in','Sends a translated copy of the advertisments of the taking of Deventer.','\r\n'),
	('0309','03 June 1591','15910603','May it please your good L. because I stande','Regarding the submission of further sconces to the United Provinces.','This letter is endorsed as the 3 of June by Bodley. Burghely has annotated \'Julij\' adjacent to the subscription. The endorsement notes this letter\'s date of sending as 3 July 1591. A later hand in pencil notes the date as 3 June 1591.\r\n'),
	('0310','06 June 1591','15910606','May it please your good L. It is now de-','Concerning the plan to attack Groningen.','\r\n'),
	('0311','10 June 1591','15910610','May it please your good L. being come to Amster-','Informing Burghley that he has taken possession of the packet of letters and papers which concern \'Snowden\' (possibly John Cecil).','\r\n'),
	('0312','13 June 1591','15910613','May it please your good L. I am newly','Bodley\'s account of the progress of the siege of Groningen.','\r\n'),
	('0313','22 June 1591','15910622','May it please your good L. The 13th of this moneth','News of the taking of the fort of Delfziel, near to Groningen.','\r\n'),
	('0314','22 June 1591','15910522','May it please your good L. the 13th of this moneth','News of the taking of the fort of Delfziel, near to Groningen.','\r\n'),
	('0315','28 June 1591','15910628','May it please your good L. to bee advertised, that two','Report of the taking of the fort of [Opsterland], near Groningen.','\r\n'),
	('0316','29 June 1591','15910629','May it please your good L. The letter which yow','Concerning a letter in favour of Colonel Sonoy.','\r\n'),
	('0317','02 July 1591','15910702','May it please your good L. having no occasion','Report of Count Maurice\'s attack against the fort of Emmen [Emmentil].','\r\n'),
	('0318','11 July 1591','15910711','May it please your good L. to be advertised','Regarding military preparations for the attack of Arnhem.','\r\n'),
	('0319','13 July 1591','15910713','May it please your good L. to be advertised, that','Concerning the besieging of an enemy fort [Arnhem?].','\r\n'),
	('0320','13 July 1591','15910713','May it please your good LL. to be adver-','Concerning Bodley\'s discussion with Count Maurice regarding the request for assistance with raiding Spanish shipping.','There are four vertical lines of emphasis in the left margin against the statement that Maurice lacks the authority to deliver 10 ships.\r\n'),
	('0321','14 July 1591','15910714','May it please your good L. to be advertised','Report of intelligence from the fort of Knodsenburg, near Niemegen.','The subscription is written perpendicular to the margin.\r\n'),
	('0322','17 July 1591','15910717','May it please your good L. I have signified in','Report of the taking prisoner of significant members of the Duke of Parma\'s military support.','\r\n'),
	('0324','23 July 1591','15910723','May it please your good L. to be advertised','Concerning the request for additional shipping to be made available by the Councel of State and Count Maurice to defend against the Spanish fleet.','At the word \'imploied\' on fol.252r, there are three vertical lines inscribed in the margin.\r\n'),
	('0325','24 July 1591','15910724','May it please your good L. there were of our','News from an intercepted letter claiming the Duke of Parma intends to head for France, and that extra enemy troops are expected from Germany.','\r\n'),
	('0326','31 July 1591','15910731','It may plaise your L. to be advertised, that','Intelligence of the movements of the Duke of Parma, and the rumours of a fleet lying at [The Groine].','\r\n'),
	('0327','31 July 1591','15910731','May it please your good L. Although her Majestie','Regarding the appointment of Mr Chamberlain to the post of Provost Marshal of Bergen op Zoom.','\r\n'),
	('0328','08 August 1591','15910808','May it please your good L. there is nothing','Regarding the decision to be taken over Ostend, concerning Sir Edward Norris.','\r\n'),
	('0329','10 August 1591','15910810','May it please your good L. upon certaine intelligence','Report that after receiving intelligence of enemy movements, the Low Countries troops have been divided between garrisons in order to assemble at speed where necessary.','\r\n'),
	('0331','19 August 1591','15910819','May it please your good L. I have used towardes','Regarding the ransoming of the Spanish prisoners, and Bodley\'s full account of military movements and the situation with Sir Edward Norris.','On fol.298v Burghley has inscribed a symbol (resembling \'op\') in the margin at the word \'traffique\'. On fol. 300r, there is a later administrative list (struckthrough).\r\n'),
	('0333','23 August 1591','15910823','May it please your good L. I have answered','Concerning the appointment of a deputy to examine the States General\'s complaint against Sir Edward Norris.','\r\n'),
	('0334','31 August 1591','15910831','It may please your good L. to be advertised, that','Report of the likely towns where troops will be dispatched.','\r\n'),
	('0335','31 August 1591','15910831','It may please your good L. to be adver-','A report from a recent military survey of Hulst.','\r\n'),
	('0336','31 August 1591','15910831','May it please your good L. I send yow heere','Concerning the confession of Peter Corteken, and Sir Edward Norris\' intercession on his behalf.','\r\n'),
	('0337','04 September 1591','15910904','May it please your good L. In Writing what','News of the yielding of the castle of Coevorden.','\r\n'),
	('0339','09 September 1591','15910909','May it please your good L. I can not cer-','Report of the taking of the town of Anholt.','\r\n'),
	('0340','09 September 1591','15910909','May it please your good L. I receaved your','Concerning Sir Edward Norris, and the States\' charges against him.','\r\n'),
	('0342','30 September 1591','15910930','May it please your good L. sins the writing of','Report of intercepted letters concerning the proposed peace between the United Provinces and the Emperor.','\r\n'),
	('0343','30 September 1591','15910930','May it please your good L. There is nothing','Regarding the prevarication of the States General in resolving the issue with Sir Edward Norris.','\r\n'),
	('0344','04 October 1591','15911004','May it please your good L. Upon deli-','News that the Councel will return to the Camp, and the refusal of Groningen to join the United Provinces.','\r\n'),
	('0345','11 October 1591','15911011','May it please your good L. being parted from','Regarding the seizure of the town of Niemegen.','\r\n'),
	('0346','16 October 1591','15911016','May it please your good L. having signified','The surrender of Niemegen, and military plans for the coming winter.','\r\n'),
	('0347','26 October 1591','15911026','Right Woorshipfull &c. It is two yeres agoe','Invitation to the statesmen of Groningen to come under the protection of England.','\r\n'),
	('0348','27 October 1591','15911027','May it please your good L. to be advertised','Diverse news, including propositions drawn up by the Council of State for the regulating of sea traffic, and the people of Groningen unsure of which way to turn.','Fol.135r is the address leaf.\r\n'),
	('0349','29 October 1591','15911029','May it please your good L. I am made','News that a letter has arrived from the Emperor\'s Ambassadors.','\r\n'),
	('0350','29 October 1591','15911029','May it please your good L. I am informed','Bodley defends himself against the displeasure of the Privy Council.','\r\n'),
	('0352','03 November 1591','15911103','May it please your good L. to be adverti-','Concerning the debt owing Captains Wingfield and Randolph of Flushing, and confusion as to whom should disburse it.','At the words \'To this effect\' on fol.172v, there is a small manicule in the margin.\r\n'),
	('0353','06 November 1591','15911106','May it please your good L. I am earnestly','Renewing a suit for Herman Roderberg.','\r\n'),
	('0354','06 November 1591','15911106','May it please your good L. by letters inter-','Concerning intercepted letters from Rome containing directions on how to proceed following the Pope\'s recent death.','\r\n'),
	('0355','10 November 1591','15911110','May it please your good L. I thought before this,','Bodley requests to return home, following the death of his father.','\r\n'),
	('0356','11 November 1591','15911111','May it please your good L. I have sent yow','Regarding the approach of the Emperor\'s Ambassadors, touching the Treaty of Peace.','\r\n'),
	('0357','16 November 1591','15911116','May it please your good L. sins I sent yow','Concerning a letter from Duke Casimir advising the States General to proceed carefully with the Emperor\'s Ambassadors.','\r\n'),
	('0358','20 November 1591','15911120','May it please your good L. to advertise her','Regarding the sending of troops to France.','\r\n'),
	('0359','20 November 1591','15911120','May it please your L. to advertise her Majestie that after the','Regarding the sending of troops to France.','This may be a presentation copy, as it is extraordinarily neat.\r\n'),
	('0361','24 November 1591','15911124','May it please your good L. sins the writing','Concerning a recent letter written by Duke Casimir, and other intelligence.','\r\n'),
	('0362','28 November 1591','15911128','May it please your good L. to be advertysed, that','Intelligence that the enemy is raising troops in Germany.','\r\n'),
	('0363','30 November 1591','15911130','May it please your good L. Upon report of the','A letter in favour of Michael Dormer, petitioning for the company of the late Sir Coniers Clifford.','\r\n'),
	('0365','10 December 1591','15911210','May it please your good L. What successe I','Regarding the ransom of Mr [Thomas?] Winter.','\r\n'),
	('0366','11 December 1591','15911211','May it please your good L. I have heerewith','Reporting that another letter has arrived from the Emperor\'s Ambassadors.','\r\n'),
	('0367','12 December 1591','15911212','Right trusty and welbeloved wee greet yow well. Having longe','Bodley is praised for his loyal service and assured that it will not be forgotten.','\r\n'),
	('0368','15 December 1591','15911215','Sir. I knowe not what it is, that yow might looke for at my','Assuring Sir Edward Norris that he has always acted for his benefit, and that the rumours to the contrary are untrue.','\r\n'),
	('0369','22 December 1591','15911222','May it please your good L. It is but three','Reporting the delay on letters, and requesting his return homewards.','\r\n'),
	('0578','28 February 1591','15910228','A lettre unto master Bodley, Whereas we are informed by our very good L. the L.','Bodley is to approach the States on behalf of the Lord Willoughby, who is owed over 1,500 pounds, but whose goods have been taken in payment for his own debts, despite the larger amount due to him.','\r\n'),
	('0579','16 May 1591','15910616','A lettre to Master Bodlie to the like effect for Holland','Bodley is to ask Holland for assistance repelling Spanish attempts.','This comment refers to a letter to Robert Sidney \'requiring him to deale vearie earnestlie with the states of Zeland to send some of their warlick ships to lie arright Dunkerk until the retourne of her Majesties Ships emploied to the west partes of this Realme for the repulse of the Spanish attemptes\'.'),
	('0580','13 June 1591','15910613','A lettre to master Boddeley signifieng that her majestie is advertised aswell from','Bodley is to persuade the Count Maurice to contribute ten ships to a raid on Spanish ships with bounty from the Indies, on the promise of a share of the treasure.','\r\n'),
	('0581','11 July 1591','15910711','A lettre to Master Thomas Bodley Whereas the Estates generall of the united','The Privy Council claim that Sir Edward Norris has been falsely charged with abusing his power as governor of Ostend. Bodley is to defend him and reassure the states.','There are pen checking marks in the left hand margin.\r\n'),
	('0582','28 July 1591','15910728','A Lettre to Master Bodley Councellor of estate for her majestie with the','On the matter of a pension granted to Colonel Chester by the States General, and a suit made by Sir Walter Waller who has previously undertaken much of Chester\'s debt, and would like reimbursement. Bodley is to approach the States on Waller\'s behalf.','\r\n'),
	('0583','07 October 1591','15911007','A Lettre unto Thomas Bodley esquier Counsellor for','Concerning a placard that is intended for publication in the Low Countries, on the subject of the States\' answer to Queen Elizabeth\'s requirement that they don\'t transport victuals into Spain.','\r\n'),
	('0585','15 December 1591','15911215','A lettre to Master Bodeley and Sir Francis Vere, knight where','Concerning a commissary who has not returned certificates or muster rolls on his companies, who is to be sent back to England to give account.','\r\n'),
	('0990','06 January 1591','15910106','Trustie and welbeloved we greet you well. Where of late we','The Queen sends Sir John Norris following her decision to divert some troops from the Low Countries against the King of Spain in Brittany.','The letter comprises a half page of very thin paper, which is burned along the bottom right edge.\r\n'),
	('0991','14 January 1591','15910114','May it please your good L. to advertise her Majesty that','Diverse mixed intelligence, including information about the Merode family.','\r\n'),
	('0992','16 January 1591','15910116','May it please your good L. wher as petition hath bin made','Concerning the enlarging of the horse and foot bands, and the English contribution.','\r\n'),
	('0993','23 January 1591','15910123','May yt please your good L. I have yet no answere from','Regarding news of trading restrictions.','\r\n'),
	('0994','27 January 1591','15910127','Sir, Your latest letters be of the xiijth and xvjth of this moneth, ether','Concerning the dispute between Sir John Norris and the captains of the bands.','\r\n'),
	('0995','02 February 1591','15910202','May it please your good L. Heere is great expectation of','Concerning the provision of English troops for the summer military campaign.','On fol. 46r there is the signature \'K\'.\r\n'),
	('0996','02 February 1591','15910202','May it please your good L. in the conference','The report of a conversation between Bodley and the Emperor\'s Ambassador, regarding a treaty of peace with Spain, and Bodley\'s \'private\' responses to the Ambassador\'s queries.','On fol. 49r, there is the signature \'L\'.\r\n'),
	('0997','03 February 1591','15910203','May yt please your good L. to advertise her Majestie, that','Concerning the extracting of English forces from the Low Countries to help the French in Brittany, and the suspicion of the common people of the United Provinces that this heralds the withdrawing of the English forces from the conflict.','\r\n'),
	('0998','08 February 1591','15910208','Sir, Uppon my arryvall heer findinge the winde good to','Informs Bodley he is leaving for England.','\r\n'),
	('0999','09 February 1591','15910209','May yt please your good L. to bee advertised, that where her','Details of the communication between the governors of the English garrisons regarding the redistribution of the English troops.','\r\n'),
	('1000','09 February 1591','15910209','The more that I have to impart to your L the lesse is','News of the disbanding of troops.','On fol.68v there is the signature \'N.\'\r\n'),
	('1001','10 February 1591','15910210','Sir. itt hath plesed my Lord president as yow fortold mee to have','Asking Bodley for the official word on how to proceed.','\r\n'),
	('1002','11 February 1591','15910211','May it please your good L. After I had written','Signalling that the answer to Elizabeth\'s recent letter to the States General has arrived.','\r\n'),
	('1003','12 February 1591','15910212','Sir, In my opinion you have taken a good cowrse','Bodley\'s reply to Captain Lambert\'s request for clearer direction as to how to proceed in disbanding his garrison at Doesburgh.','\r\n'),
	('1004','13 February 1591','15910213','Sir, your last letters by mee receved at this time, were of the tyme of the','Burghley reports that his last few letters to Bodley seem to have gone missing. He urges Bodley to make strenuous efforts to persuade the common populace of the United Provinces against a treaty of peace with Spain.','\r\n'),
	('1005','14 February 1591','15910214','Sir It had bin very requesit that yow had taken a','Concerning the \'cassing\' of the English garrisons, and Bodley\'s advice to Wingfield on how to proceed.','\r\n'),
	('1006','15 February 1591','15910215','May it please your good L. forasmuch as Sir John Norris','Bodley waits for further direction from Burghley regarding the movement of the English troops.','\r\n'),
	('1007','17 February 1591','15910217','Sir. I receaved your letter of the xijth','Captain Lambert has stayed his troops\' march out of Doesburgh until further instruction.','\r\n'),
	('1008','18 February 1591','15910218','Sir as I do understand yow are commaunded by','Bodley requests Master Kennet to resume lending money to the English troops, countering the recent order by Sir John Norris for Kennet to cease lending.','\r\n'),
	('1009','18 February 1591','15910218','Sir, I have certified her Majestie What great','Bodley advises Captain Audley to delay discharging his troops until a formal direction arrives from England.','\r\n'),
	('1010','19 February 1591','15910219','I am of your L. opinion for medkerk: for which I have refraynd','Concerning Captain Medkerk, and the disbanding of the English companies.','\r\n'),
	('1011','22 February 1591','15910222','Sir. The Argument of my letter will appeare to you','Concerning the overtures by the Emperor towards a peace treaty, and enclosing a copy of a formal answer to the Emperor which Bodley should use to exhort the States against the treaty.','\r\n'),
	('1012','23 February 1591','15910223','Sir. Bicause it is convenient yowe should be acquainted with','Burghley relates the outcome of a meeting with the Commissioners regarding the unequal distribution of charges between England and the United Provinces; and the recent complaints about unauthorised piracy.','On fol.94v the postscript is written perpendicular in the margin.\r\n'),
	('1013','23 February 1591','15910223','Sir, this cowrse of Sir John norris in cassing the','Bodley urges Sir Thomas Morgan to delay in disbanding his garrison until further direction has arrived from the Queen.','\r\n'),
	('1014','25 February 1591','15910225','Sir, After my hartie Commendacions The Queenes Majestie','Sends an urgent resolution from the Queen regarding the withdrawing of her auxiliary troops.','\r\n'),
	('1015','01 March 1591','15910301','Trusty and welbeloved wee greete yowe well. Although wee doe','Bodley is congratulated on his good service. Ambassadors have arrived from the Emperor to offer peace in the King of Spain\'s name. Bodley is to dissuade any assent to this.','The folios are shorter vertically than most in the volume. There is ink hatching over the blank space of c.10cm above the text of fol.102v. There is a signature \'Q\' in middle of bottom fol.102r.\r\n'),
	('1109','23 January 1592','15920123','May it please your good L. As I writte','News that the Council of State has granted a passport for Bilant, the Emperor\'s Ambassador, to come to the Hague, and rumours that Duke Casimir and others have been poisoned.','This document is badly fire damaged.\r\n'),
	('1016','02 March 1591','15910302','After our harty Comendacons: Whereas we are informed by our very good L. the L. Willoughbuy','Bodley is to approach the States on behalf of the Lord Willoughby, who is owed over 1,500 pounds, but whose goods have been taken in payment for his own debts, despite the larger amount due to him.','There is slight fire damage around the top and bottom right corners, which partially obscure the \'Belgia\' later addition and what is presumed to be William Waad\'s signature.\r\n'),
	('1018','10 March 1591','15910310','May it please your good L. your letters of the 13. 22. and','Bodley has received the Queen\'s instructions to delay the disbanding of the English auxiliary companies until the supply troops arrive.','On fol.108r there is the signature \'R\'.\r\n'),
	('1019','12 March 1591','15910312','Sir I alwayse [singe] [our] [songe]','Has received no pay for his troops, news of Verdugo\'s movements.','\r\n'),
	('1020','16 March 1591','15910316','May it please your good L. I sent my last before this the 10th of','Concerning the enlarging of the Garrison of Ostend and other military items of news.','On fol.111r there is the signature \'S\'.\r\n'),
	('1021','19 March 1591','15910319','Sir. By such letters as have been written hither to my LLs of','Regarding the urgent defence of Ostend.','\r\n'),
	('1022','21 March 1591','15910321','Sir. Your letters of the xth of Marche are the latest that came','Regarding the defence of Ostend, and the proposed treaty of peace.','\r\n'),
	('1023','23 March 1591','15910323','May it please your good L. a letter from you of the 9.','Concerning the provisions made for an enemy attack against Ostend, Sir Edward Norris\' relationship with the States General, and recent correspondence with Sir Horatio Pallavicino.','\r\n'),
	('1024','28 March 1591','15910328','It may please your H. to be advertised, that','Concerning the relaxtion of the tax on English cloth, and of recent negotiations with Joachim Ortell.','\r\n'),
	('1025','03 April 1591','15910403','May it please your good LL. wheras the L. Willughby hath bin','Bodley\'s answer to the matter concerning the money owed to Lord Willoughby during his governorship of Bergen op Zoom.','\r\n'),
	('1026','03 April 1591','15910403','May it please your good L. by Sir John Norris report &','Concerning the additional protection of Ostend, dissuading the States from a peace treaty, and informing Lord Willoughby of the specification of the mercantile shipping of the Low Countries.','\r\n'),
	('1027','09 April 1591','15910409','Sir. By letters which this vearie daie wee have heare','Regarding the siege at Ostend, and the States\' failure to adequately defend the town, as well as Sir Thomas Morgan and Sir Robert Sidney\'s failure to provide troops towards the same.','\r\n'),
	('1028','11 February 1591','15910211','Understanding of the States being together, and that the','Petition from the Merchant Adventurers to Bodley, asking him to intercede on their behalf with the States General regarding the tax on English cloth.','\r\n'),
	('1029','14 April 1591','15910414','May it please your good L. although no present','News of the spring military campaign.','\r\n'),
	('1030','17 April 1591','15910417','May it please your good L. this daie I Rxd her Highnes lettre','Concerning letters sent to the states, and the illegal election of Count Maurice to the government of Gelderland.','\r\n'),
	('1032','30 April 1591','15910430','Sir The letter of this Counsell and the bearer therof will signifie their','Requesting Norris to release three companies.','\r\n'),
	('1033','05 May 1591','15910505','May it please your good L. There is order taken','News of military skirmishes, including the surprising of Westerloo.','\r\n'),
	('1034','07 May 1591','15910507','Sir. Uppon the comming hither of Capteine Vanderbronke wth','Concerning the plans to surprise Dunkirk.','\r\n'),
	('1035','12 May 1591','15910512','Sir. Yowe shall receve at this time a letter from her Majestie to','Directions for negotiating with the States to cease trading with the enemy.','The document is badly damaged by water.\r\n'),
	('1036','14 May 1591','15910514','May it please your good L. to the effect of my Laste which I','Various military intelligence, including news of the unrest in Niemegen, and a report of two ships which escaped from Cadiz.','\r\n'),
	('1037','16 May 1591','15910516','May it please your good L. Being instantly requested by','Concerning the suit of an assistant of the recent Dutch delegation to England.','On fol.145v (on which the endorsement is written), there are three horizontal lines stretching across the writing space.\r\n'),
	('1039','17 May 1591','15910517','May it please your good L. by my letter unto','Concerning the besieging of Zutphen by Sir Francis Vere.','\r\n'),
	('1040','27 May 1591','15910527','After our harty commendacions. Her Majestie understanding that the king of','The Spanish fleet are in the Narrow Sea so England requires support from ships, which are to stay near Dunkirk.','\r\n'),
	('1041','21 May 1591','15910521','May it please your good L. I declared in my last','A further report of the siege of Zutphen in which Count Overstein was shot in the head.','\r\n'),
	('1042','21 May 1591','15910521','Sir. As I wroate unto yowe this other daie that','Regarding the exporting of powder, munition and victuals to Spain and France, and that Bodley must request the States General to cease this practise.','\r\n'),
	('1043','22 May 1591','15910522','May it please your good L we have','News that the town of Zutphen has entered into parley with Count Maurice.','\r\n'),
	('1044','21 May 1591','15910521','[...]','Burghley asks [Bodley?] to make enquiries about a ship carrying illicit materials from Englishmen in Spain.','The top line of this letter is missing, due to fire damage.\r\n'),
	('1045','25 May 1591','15910525','Sir. Hir Majestie by hir letters in Januarie last where','Regarding the suit of Colonel Sonoy, and urging Bodley to press the states further.','\r\n'),
	('1046','01 June 1591','15910601','May it please your good L. I receaved this daie her Majesties lettres','General news, including the surprise of Deventer.','\r\n'),
	('1047','05 June 1591','15910605','It may please your good L. to be advertised','Regarding the States\' decision over the merchant traffic out of the Low Countries, and other military news.','\r\n'),
	('1048','06 June 1591','15910606','May it please your good L. It is now determined that the','Concerning the plan to attack Groningen.','\r\n'),
	('1049','06 June 1591','15910606','May it please your good L. the bearer hereof John','News of illicit naval practises by an English pensioner of the King of Spain.','\r\n'),
	('1050','10 June 1591','15910610','May it please your good L. being come to Am-','Informing Burghley that he has taken possession of the packet of letters and papers which concern \'Snowden\' (possibly John Cecil).','\r\n'),
	('1051','12 June 1591','15910612','May it please your good L. I am newly come to Doccum','Bodley\'s account of the progress of the siege of Groningen.','On fol.164r there is the signature \'AA\'.\r\n'),
	('1052','13 June 1591','15910613','After our hartie Comendacions: Her Majestie is advertised aswell','Bodley is to persuade the Count Maurice to contribute ten ships to a raid on Spanish ships with bounty from the Indias, on the promise of a share of the treasure.','\r\n'),
	('1053','16 June 1591','15910616','Sir. I dowt not but yow can consider, to how good purpose','Urges Bodley to persuade the States to join the  enterprise to seize the Havana treasure in the Azores.','\r\n'),
	('1054','18 June 1591','15910618','Sir. Hir Majestie having been made acquainted with the awnswer','Concerning the removing of \'Mr Chamberlain\' from the office of Provost Marshall in Bergen op Zoom.','\r\n'),
	('1055','22 June 1591','15910622','May it please your good L. the 13 of this moneth I','News of the taking of the fort of Delfziel, near to Groningen.','On fol.168r there is the signature \'BB\'.\r\n'),
	('1056','28 June 1591','15910628','May it please your good L. to be advertised, that two daies','Report of the taking of the fort of [Opsterland], near Groningen.','\r\n'),
	('1057','11 July 1591','15910711','After our hartie commendacions. whereas the Estates generall of the united provinces','The Privy Council claim that Sir Edward Norris has been falsely charged with abusing his power as governor of Ostend. Bodley is to defend him and reassure the states.','There is a signature \'D.D.\' on the middle bottom of 176r.\r\n'),
	('1058','11 July 1591','15910711','May it please your good L. to be advertised, that the 5th of','Regarding military preparations for the attack of Arnhem.','\r\n'),
	('1059','13 July 1591','15910713','May it please your good LL. to be advertised, that I Received','Concerning Bodley\'s discussion with Count Maurice regarding the request for assistance with raiding Spanish shipping.','\r\n'),
	('1060','17 July 1591','15910717','May it please your good L. I have signified in a former the','Bodley\'s account of the taking prisoner of key companies of the Duke of Parma\'s troops.','On fol.180r there is the signature \'FF\'.\r\n'),
	('1061','23 July 1591','15910723','May it please your good L. to be advertised, that as','Concerning the request for additional shipping to be made available by the Councel of State and Count Maurice to defend against the Spanish fleet.','\r\n'),
	('1062','25 July 1591','15910725','Sir. I have imparted unto hir Majestie sundrie of your lettres lately','Concerning the release of prisoners. Also, asks Bodley to tell Sir Francis Vere to improve his handwriting so Burghley can show his dispatches to the Queen.','\r\n'),
	('1063','24 July 1591','15910724','May it please your good L. There were of our souldiers','News from an intercepted letter claiming the Duke of Parma intends to head for France, and that extra enemy troops are expected from Germany.','\r\n'),
	('1064','31 July 1591','15910731','It may please your good L. to be advertised, that after the writing of','Intelligence of the movements of the Duke of Parma, and the rumours of a fleet lying at [The Groine].','\r\n'),
	('1065','31 July 1591','15910731','May it please your good L. Although her Majestie have vowchesafed','Regarding the appointment of Mr Chamberlain to the post of Provost Marshal of Bergen op Zoom.','\r\n'),
	('1066','08 August 1591','15910808','May it please your good L. there is nothing more understood','Regarding the decision to be taken over Ostend, concerning Sir Edward Norris.','On fol.192r there is the signature \'HH\', in the left hand margin and at the base of the page.\r\n'),
	('1067','10 August 1591','15910810','May it please your good L. Upon certain intelligence of the','Report that after receiving intelligence of enemy movements, the Low Countries troops have been divided between garrisons in order to assemble at speed where necessary.','\r\n'),
	('1068','19 August 1591','15910819','May it please your good L. I have used towards Count Maurice','Regarding the ransoming of the Spanish prisoners, and Bodley\'s full account of military movements and the situation with Sir Edward Norris.','\r\n'),
	('1069','23 July 1591','15910723','Sr. I have the xxiijth received your two severall letters the','Burghley notes with dismay that due to Bodley\'s instructions regarding Sir Edward Norris\'s actions in Ostend failing to arrive, no action has been taken.','\r\n'),
	('1070','23 August 1591','15910823','May it please your good L. I have answered your lettre of the 25 of July','Concerning the appointment of a deputy to examine the States General\'s complaint against Sir Edward Norris.','\r\n'),
	('1071','31 August 1591','15910831','It may please your good L to be advertised, that the resolution','Report of the likely towns where troops will be dispatched.','\r\n'),
	('1072','31 August 1591','15910831','May it please your good L. I send yow here the copye of Cortekens','Concerning the confession of Corteken, and Sir Edward Norris\' intercession on his behalf.','\r\n'),
	('1073','03 September 1591','15910903','Good Master Bodlye, I have receyved a lettre from the States','Asks Bodley to inform the States that the matter of English troops receiving victuals from towns in the United Provinces has been resolved.','\r\n'),
	('1074','09 September 1591','15910909','May it please your good L. I can not certifie','Report of the taking of the town of Anholt.','At the words \'the next day\' the script continues perpendicular in the left hand margin.\r\n'),
	('1075','09 September 1591','15910909','May it please your good L. I receaved your lettre of the 23. of the','Concerning Sir Edward Norris, and the States\' charges against him.','\r\n'),
	('1076','19 September 1591','15910919','Sir I have wondred as muche, that I never heard from you','Bodley tries to elecit some response from Sir Edward Norris regarding the dispute with the States.','The letter has suffered severe fire damage to the right hand margin.\r\n'),
	('1077','21 September 1591','15910921','Master Bodley I have receaved your lettre, which I','Sir Edward Norris\' reply to Bodley, regarding his dispute with the States.','\r\n'),
	('1078','30 September 1591','15910930','May it please your good L. There is nothing yet don by the Councel','Regarding the prevarication of the States General in resolving the issue with Sir Edward Norris.','\r\n'),
	('1079','30 September 1591','15910930','May it please your good L since the writing of my last the 9th','Report of intercepted letters concerning the proposed peace between the United Provinces and the Emperor.','\r\n'),
	('1080','04 October 1591','15911004','May it please your good L upon deliberation had between the','News that the Councel will return to the Camp, and the refusal of Groningen to join the United Provinces.','\r\n'),
	('1081','07 October 1591','15911007','After our hartie Commendacions you shall understand that Monsieur Charon hath','Concerning a placard that is intended for publication in the Low Countries, on the subject of the States\' answer to Queen Elizabeth\'s requirement that they don\'t transport victuals into Spain.','\r\n'),
	('1082','08 October 1591','15911008','Sir. After my hartie Commendacions: Neither the time','Regarding the dispute between Sir Edward Norris and the States, and a proposal to prohibit marine trading between the Low Countries and Spain.','On fol.229r there is the signature \'P.P.\'\r\n'),
	('1083','21 October 1591','15911021','Sir. I understand that notwithstanding the longe &','Regarding the money owed to Colonel Sonoy by the States.','\r\n'),
	('1084','19 October 1591','15911019','Right Worshipfull after our very harty comendationes','A petition by the Merchant Adventurers at Middleburg for Bodley to act on their behalf regarding their protestations against the heavy tax on English cloth.','On fol.232r there is the signature \'p.p.\'.\r\n'),
	('1086','27 October 1591','15911027','May it please your good L to be advertised that uppon the sight of a','Diverse news, including propositions drawn up by the Council of State for the regulating of sea traffic, and the people of Groningen unsure of which way to turn.','\r\n'),
	('1087','29 October 1591','15911029','May it please your good L. I am informed from my frindes out of England','Bodley defends himself against the displeasure of the Privy Council.','\r\n'),
	('1088','November 1591','15911100','Having lately understoode, aswell by those','Bodley\'s proposal to the Emperor\'s Ambassadors on behalf of the Queen and the United Provinces, rejecting any terms of peace with Spain.','On fol.245r there is the signature \'V.V.\'\r\n'),
	('1089','03 November 1591','15911103','Upon the sight of your letter, which I receaved by this bearer Master Wheeler I have','Bodley\'s assurances to the Merchant Adventurers that he will present their petition to the States when they reassemble.','\r\n'),
	('1090','03 November 1591','15911103','May it please your good L to be advertised, that wheras I was willed','Concerning the debt owing Captains Wingfield and Randolph of Flushing, and confusion as to whom should disburse it.','On fol.252r there is the signature \'W.W.\'\r\n'),
	('1091','06 November 1591','15911106','May it please your good L. by letters intercepted by certaine of the garrison of Bergen','Concerning intercepted letters from Rome containing directions on how to proceed following the Pope\'s recent death.','\r\n'),
	('1092','09 November 1591','15911109','Sir. The great hast which is required at this present for the','A quick digest of news, including an assurance to Bodley about his dealings regarding Sir Edward Norris.','\r\n'),
	('1093','09 November 1591','15911109','Trusty and welbeloved we grete yow well. We doubte not but it','Bodley is to require that English troops currently in the Low Countries be diverted to aid the King of France, on promise that the numbers will be replenished in the united provinces once the exploit against Rouen is over.','The unbound vertical edge of the paper has been singed and is missing some text. The remains of the large wax seal are still present. It appears that the superscription has been cut from the address leaf.\r\n'),
	('1094','10 November 1591','15911110','May it please your good L. I thought before this, that you had bin moved','Bodley requests to return home, following the death of his father.','\r\n'),
	('1207','16 November 1591','15911116','May it please your good L. sins I sent you my last the 12 of this','Concerning a letter from Duke Casimir advising the States General to proceed carefully with the Emperor\'s Ambassadors.','\r\n'),
	('1208','18 November 1591','15911118','After my very harty commendations. Whearas the Company of the','Concerning the recent restrictions on the trade in English cloth set by the States, and the petition of the Merchant Adventurers to challenge it.','\r\n'),
	('1210','20 November 1591','15911120','May it please your L. to advertise her Majestie that','Regarding the sending of troops to France.','\r\n'),
	('1211','20 November 1591','15911120','Sir. After my verrie hartie Commendacions. I have received','Burghley\'s answer to three of Bodley\'s previous letters, including his request to return to England, and instructions on how to proceed with the Emperor\'s Ambassadors.','\r\n'),
	('1213','26 November 1591','15911126','Sir. By your letter of the xxth of this moneth browght hither','Concerning the movement of English troops.','\r\n'),
	('1214','24 November 1591','15911124','May it please your good L. sins the writing of','Concerning a recent letter written by Duke Casimir, and other intelligence.','\r\n'),
	('1215','24 November 1591','15911124','By the Contentes of your worshippes Letters of the third','Petitioning Bodley to further their cause with the States, sending further letters to support their suit.','\r\n'),
	('1217','28 November 1591','15911128','May it please your good L. to be advertised that there is freshe intelli-','Intelligence that the enemy is raising troops in Germany.','\r\n'),
	('1218','30 November 1591','15911130','May it please your good L. upon report of the','A letter in favour of Michael Dormer, petitioning for the company of the late Sir Coniers Clifford.','On fol.292v there is the signature \'D.D.D.\'\r\n'),
	('1219','07 December 1591','15911207','Sir I have receaved the letter of Sir Horace','Assuring the Merchant Adventurers that he will advance their suit to the States when they reconvene for the next assembly.','\r\n'),
	('1220','10 December 1591','15911210','May it please your good L. what successe I have had in the','Regarding the ransom of Mr [Thomas?] Winter.','\r\n'),
	('1221','11 December 1591','15911211','May it please your good L. I have heerewith inclosed the copie','Reporting that another letter has arrived from the Emperor\'s Ambassadors.','\r\n'),
	('1222','December 1591','15911200','Master Bodley, I understand by Sir Robert','Concerning the dispute between the States and Sir Edward Norris.','\r\n'),
	('1223','15 December 1591','15911215','Sir I knowe not what it is, that yow might looke for','A firm protestation from Bodley, claiming he has pursued the matter between Norris and the States with as much care as has been requisite.','\r\n'),
	('1224','15 December 1591','15911215','After our vearie hartie Commendacions: where as by the negligence of','Concerning a commissary who has not returned certificates or muster rolls on his companies, who is to be sent back to England to give account.','There is a signature \'E.E.E\' on the middle of the bottom edge.\r\n'),
	('1225','19 December 1591','15911219','Trustie and welbeloved we greet you well. Having  longe observed yowe','Bodley is praised for his loyal service and assured that it will not be forgotten.','The remains of the seal are attached on the middle bottom edge.\r\n'),
	('1226','19 December 1591','15911219','After our vearie hartie commendacions: Where as it hathe appeared unto us under the','Concerning the number of mustered men who have arrived for the Earl of Essex\'s service.','\r\n'),
	('0370','10 January 1592','15920110','May it please your good L. with her Highnes Letter','Bodley refutes accusations that he should have signified the fewer numbers comprising the English troops than had been previously claimed. The arrival of Bilandt, the Emperor\'s Ambassador.','\r\n'),
	('1227','21 December 1591','15911221','Sir at this tyme I am sorry to accompany hir Majesties lettres of thanks','A letter of reprimand to Bodley and Sir Francis Vere for not ensuring that the English troops sent to France were larger in volume.','\r\n'),
	('1228','22 December 1591','15911222','May it please your good L. It is but three daies agoe, that your','Reporting the delay on letters, and requesting his return homewards.','\r\n'),
	('1229','31 December 1591','15911231','May it please your good L. there is an other Messenger come hither','Regarding the propositions towards a peace treaty put forward by the Emperor\'s Ambassadors.','On fol.319r there is the signature \'F F\'.\r\n'),
	('1366','November 1591','15911100','Having lately understoode, aswell by those letters which yow have written','Bodley\'s proposal to the Emperor\'s Ambassadors on behalf of the Queen and the United Provinces, rejecting any terms of peace with Spain.','The letter begins on fol. 192, and after fol.193v continues on fol.190r.\r\n'),
	('0373','27 January 1592','15920127','May it please your good L. The Emperors Am-','Concerning the Emperor\'s Ambassador (Bilandt) and Bodley\'s advice to the States for dealing with his proposed Treaty of peace.','\r\n'),
	('1096','02 February 1592','15920202','Master Bodley, after my verie hartie comendacio[ns]','Petitions Bodley to continue his efforts to mediate between the States and himself, regarding payments.','This document is badly fire damaged.\r\n'),
	('1097','February 1592','15920202','May it please your good L in the conference desired by the Emperors','Report of a conference between Bodley and the Emperor\'s Ambassador, Bilandt, and the unlikelihood of the Treaty of peace being accepted by any of the parties.','This document is badly fire damaged.\r\n'),
	('0374','02 February 1592','15920202','May it please your good L. In the conference desired','Report of a conference between Bodley and the Emperor\'s Ambassador, Bilandt, and the unlikelihood of the Treaty of peace being accepted by any of the parties.','\r\n'),
	('0376','04 February 1592','15920204','May it please your good L. because I would','The forces sent for France are delayed because of the lack of wind. Bodley suggests an alternative strategy for annoying the Enemy.','\r\n'),
	('1098','1592','15920204','May it please your good L, because I would not that the talk','Regarding the levies for the next season\'s service.','On fol.16r there is the signature \'T\'. The last page of this letter is missing. This document is badly fire damaged.\r\n'),
	('0377','10 February 1592','15920210','May it please your good L. In my former lettres','Reporting the state of the negotiations between the Emperor\'s Ambassador and the States, and regarding the forces sent for France.','\r\n'),
	('1105','1592','15920210','May it please your good L. In my former lettres of which I','Reporting the state of the negotiations between the Emperor\'s Ambassador and the States, and regarding the forces sent for France.','\r\n'),
	('1106','01 February 1592','15920212','Sir, I was in good hope, to have','That he has mentioned his suit to the Council of State, and that he has long expected a letter from Norris.','This document is badly fire damaged.\r\n'),
	('0378','12 February 1592','15920212','Sir, I was in good hope, to have seene','Bodley reprimands Norris for not replying to his last letter, and informs him that the States are unlikely to accede to Norris\' request for 3 per day.','\r\n'),
	('1102','24 February 1592','15920224','Sir. After my hartie Commendacions. Although I have','Regarding the suggestion of a general treaty between Spain and the United Provinces, and the queen\'s reasoning against considering such a move.','This document is badly fire damaged.\r\n'),
	('1104','25 February 1592','15920225','May it please your good L. there hath no occasyon falle[n]','Regarding the musters of forces, and the Emperor\'s Ambassadors\' arrival, with rumours that they intend to propose a treaty of peace.','This document is badly fire damaged.\r\n'),
	('0379','25 Februrary 1592','15920225','May it please your good L. there hath no','Concerning the muster rolls taken of all the English companies, and that only Ostend\'s is still pending notification.','\r\n'),
	('0380','10 March 1592','15920310','Sir It is long sins I expected to be revoked','Informs Killigrew of his desire to return home, and asks him to recommend that Gilpin be appointed as the other Councillor.','On fol.145r a section between \'It is a time\' to \'all against decorum\' on fol.145v is marked by a line in the margin.\r\n'),
	('1100','15 March 1592','15920315','Understanding of the meeting of the states General','Informs Bodley that the merchant adventurers are sending their secretary to collect information about the progress of their dispute.','\r\n'),
	('1110','15 March 1592','15920315','May it please your good L. Understanding by your lettre of the','Reports his latest conversations with the Emperor\'s ambassador regarding the proposed treaty of peace, and that he has indicated that the queen will be unlikely to consent to such a treaty considering the past record of the King of Spain.','This document has soiling to fol.98r, and some fire damage to fol.98v.\r\n'),
	('0381','15 March 1592','15920315','May it please your good L. Understanding','Reports his latest conversations with the Emperor\'s ambassador regarding the proposed treaty of peace, and that he has indicated that the queen will be unlikely to consent to such a treaty considering the past record of the King of Spain.','\r\n'),
	('1101','16 March 1592','15920316','Right woorshipfull. after our hartie comendacions, Her majestie','Thanks Bodley for acting on their behalf, and urges him to speed along the States\' answering of the queen\'s recent letters regarding the taring of English cloth.','\r\n'),
	('1113','17 March 1592','15920317','May it please your good L. As my duty requireth','News that an attempt upon Geertruidenberg is about to be made.','\r\n'),
	('1115','22 March 1592','15920322','May it please your good L. having written of late to Sir Robert Cecil','Concerning Count Maurice\'s strategy to besiege Geertruidenberg.','\r\n'),
	('1114','25 March 1592','15920325','Sir. Since the writinge of my other lettre of [my]','Burghley is aware that Bodley has not received any of his letters for the past four months.','This document is badly damaged by both fire and water.\r\n'),
	('1112','25 March 1592','15920325','Sir. Your last letter I have received is of the xvth of [this mo]','A response to Bodley\'s appeal for direction on how to deal with the Emperor\'s Ambassadors, the forces to be sent for France, and the States\' issue with Sir Edward Norris.','This document is badly fire damaged.\r\n'),
	('1116','27 March 1592','15920327','May it please your good L. The Emperors Am-','Concerning the Emperor\'s Ambassador\'s bid for his fellow commissioners to be permitted to leave Brussels for the Hague, and mixed intelligence about English forces into France, and the marriage of Count Hohenlo and Count Maurice\'s sister.','This document is badly fire damaged.\r\n'),
	('0382','27 March 1592','15920327','May it please your good L. The Emperors Am-','Concerning the Emperor\'s Ambassador\'s bid for his fellow commissioners to be permitted to leave Brussels for the Hague, and mixed intelligence about English forces into France, and the marriage of Count Hohenlo and Count Maurice\'s sister.','\r\n'),
	('0383','01 April 1592','15920401','May it please your good L. I was certified','Concerning the deployment of surplus English forces to France, and Buzenval and Count Maurice\'s objections.','On fol.177r and at the words \'liked of my motion\' there are two vertical lines in the margin.\r\n'),
	('1117','01 April 1592','15920401','May it please your good L. I was certified from you the','Concerning the deployment of surplus English forces to France, and Buzenval and Count Maurice\'s objections.','This document is badly fire damaged.\r\n'),
	('1118','02 April 1592','15920402','May it please your good L. touching that which you require, for some favor to','Concerning Bodley\'s intervention with the States on Sir Edward Norris\' behalf, and how he cannot continue with the suit if Norris, his friends and family continue to speak against him.','This document is badly fire damaged.\r\n'),
	('0384','02 April 1592','15920402','May it please your good L touching that which','Concerning Bodley\'s intervention with the States on Sir Edward Norris\' behalf, and how he cannot continue with the suit if Norris, his friends and family continue to speak against him.','\r\n'),
	('1121','03 April 1592','15920403','Right Worshipfull with our verry harty comendations &[c]','Asks Bodley to solicit a meeting of the States in order to conclude their appeal against the tax affecting their trade.','This document is badly fire damaged.\r\n'),
	('1120','03 April 1592','15920403','Sir. I dowbt not but yowe haue alreadie labored by all','Concerning the suit by Colonel Sonoy to have his expenditure defrayed by the States.','On fol.127r the signature \'N\' is expunged, with \'WL\' inserted. This document is badly fire damaged.\r\n'),
	('0385','07 April 1592','15920407','May it please your good L. Wheras an extraor-','Concerning forces to be sent into France and the Placart affecting the Merchant Adventurers.','At the first marginal annotation on fol.209r, there are three vertical lines in the margin.\r\n'),
	('1122','07 April 1592','15920407','May it please your good L. wheras an extraordinary','Concerning forces to be sent into France and the Placart affecting the Merchant Adventurers.','\r\n'),
	('1119','08 April 1592','15920408','Right worshipfull, in the cause recommended by your [lettre]','Suggests that their petition against the States against the tax on English cloth will not be successful.','This document has some fire damage.\r\n'),
	('1124','10 April 1592','15920410','Sir. After my hartie Commendacions. By your letter of the','Concerning the aid to be sent to France, and the problem of free trade between Spain and the Low Countries.','\r\n'),
	('1129','14 April 1592','15920414','Right worshipfull: We have received your letters','Thanks Bodley for the effort he has made in putting the Company\'s objections to the States General.','\r\n'),
	('1130','17 April 1592','15920417','Sir. At this present I have not leisure to write so much','Regarding a meeting with Noel de Caron regarding the provision of military assistance to France.','On fol.177r the signature \'R\' has been expunged and replaced with \'S\'.\r\n'),
	('1131','19 April 1592','15920419','Right Wurshipfull, yours of the 8th present I Rd by mr Whe[ller]','Thanks Bodley for his efforts on the Company\'s behalf.','\r\n'),
	('0387','21 April 1592','15920421','May it please your good L. Where I writte unto','Regarding the provision of forces against the Spanish around Brittany.','On fol.253r at the words \'knowledge of my purpose\' there are three vertical lines in the margin.\r\n'),
	('1133','22 April 1592','15920421','May it please your good L. Where I writte unto you last, the 7. of this','Regarding the provision of forces against the Spanish around Brittany.','\r\n'),
	('0388','22 April 1592','15920422','May it please your good L. Where I writ unto you laste the','Regarding the provision of forces against the Spanish around Brittany.','\r\n'),
	('1134','23 April 1592','15920423','May it please your good L. I have bin infor','Regarding a secret message sent by the Duke of Parma to Count Maurice.','\r\n'),
	('0389','23 April 1592','15920423','May it please your good L. I have bin infor','Regarding a secret message sent by the Duke of Parma to Count Maurice.','\r\n'),
	('0390','26 April 1592','15920426','May it please your good L. Heere inclosed is','Concerning the States General\'s forthcoming decision on trade and traffic with Spain.','\r\n'),
	('1135','26 April 1592','15920426','May it please your good L. heerinclosed is a letter from','Concerning the States General\'s forthcoming decision on trade and traffic with Spain.','On fol.182r the signature \'S\' is expunged and replaced by \'T\'.\r\n'),
	('1132','28 April 1592','15920428','Right worshipfull: this day the Magistrates of','Urges Bodley to push for an urgent committee to decide the merchant shipping.','\r\n'),
	('1137','01 May 1592','15920501','Right worshipfull: we have received twoo','Thanks Bodley for his letters, and asks him to ensure that the Committee they send will not be kept overlong at The Hague.','\r\n'),
	('1136','01 May 1592','15920501','May it please your good L. Mr Buzenval','Concerning his conversation with Buzenval regarding the levying of troops, and the recent Placart about the trade with Spain.','\r\n'),
	('1139','05 May 1592','15920502','Sir. Your last letters comen to my hands one of the xxvjth of the last','Concerning the trade and traffic with Spain and the harm it does to the English merchants, and the opportunity to redress the martial balance in northern France in the allies\' favour.','\r\n'),
	('1138','04 May 1592','15920504','Sir. to the self same effect as your lettres doth request','Advising Norris to make his excuses and return to Ostend, and Bodley will then argue with the States in his favour.','\r\n'),
	('1140','05 May 1592','15920505','May  it please your good L. Sins the writing of','A report of a conversation had with Buzenval regarding the deployment of English troops currently in the United Provinces to France.','\r\n'),
	('1141','08 May 1592','15920508','Sir. Your last lettres came yesterdaie to my hands, dated the','Informs Bodley that the queen has read his last letter, and approves of his dealing with Buzenval. Bodley should not aim to return to England until at least the end of the summer.','\r\n'),
	('1143','09 May 1592','15920509','Mr Bodley, if it had not beene for a','Norris has received Bodley\'s letter of advice to return to his garrison, but has received recent information that he will soon be contacted by the states so is staying put.','\r\n'),
	('1144','17 May 1592','15920517','May it please your L. Count Maurice it is though[t has]','Regarding the offer of a troop of soldiers from a man from Juliers, and the conditions attached to the contract of service.','\r\n'),
	('0392','17 May 1592','15920517','May it please your good L. Count Maurice, it','Regarding the offer of a troop of soldiers from a man from Juliers, and the conditions attached to the contract of service.','\r\n'),
	('1145','01 June 1592','15920601','May it please your good L. The 24. day of May within a daies','Concerning Bodley\'s discussion with Count Maurice about the distribution and maintenance of troops.','\r\n'),
	('0393','01 June 1592','15920601','May it please your good L. The 24. day of','Concerning Bodley\'s discussion with Count Maurice about the distribution and maintenance of troops.','At the words \'and to my self\' on fol.2r there are four vertical lines in the margin.\r\n'),
	('1367','01 June 1592','15920601','May it please your good L. The 24 day of May within a daies jorney','Concerning Bodley\'s discussion with Count Maurice about the distribution and maintenance of troops.','\r\n'),
	('0394','03 June 1592','15920603','May it please your good L. What answears','Incloses the States answers to the queen\'s request for troops to be sent to France.','\r\n'),
	('1147','09 June 1592','15920609','Right wurshipfull.. yours of these present is come to my handes, perceaving that myne of the','Is still waiting on the answer from the states regarding the decision on the trade in English cloth.','\r\n'),
	('1146','09 June 1592','15920609','May it please your L. I assure my self that the','News of the occurrences at the camp before Steenwick, and the Zeland merchants complaint about the seizure of their shipping from Spain.','On fol.219r there is the signature \'Bb\'.\r\n'),
	('0395','09 June 1592','15920609','May it please yor good L. Because I doe','Report of the progress at the siege of [Coevoerden], and the Zeeland merchants\' complaints.','\r\n'),
	('1128','10 June 1592','15920610','Right Worshipfull, yours of the 20th Ju[ne I]','Has received the copy of the letter Bodley has sent to the Company in London. Asks him to intercede in the selection of soldiers to be sent to France, that his kinsman may not be one of them.','\r\n'),
	('1148','12 June 1592','15920612','Right worshipfull: We understand that yt hathe pleased','The merchant adventurers are still waiting for an answer from the States General.','\r\n'),
	('1149','20 June 1592','15920620','Right worshipfull, that letter of her Majestie which was bro[ught]','Reports that there is still no decision taken on the agreement about trade.','\r\n'),
	('1150','25 June 1592','15920625','Right worshipfull: we pereive by yours of the 20th of','Concerning the delay in the States\' answer to their demands, and Bodley\'s advice.','\r\n'),
	('1151','25 June 1592','15920625','May it please your good L. Heere are certaine Ambassadors come','The arrival of Ambassadors from the Elector Palatine, regarding his dispute with his uncle the grand Duke of Simmern.','On fol.224r there is the signature \'H\'.\r\n'),
	('0397','26 June 1592','15920626','May it please your good L. I desired','News of the yielding of Steenwijk, and the tally of casualties on both sides.','\r\n'),
	('0396','26 June 1592','15920626','May it please your good L. Heere are cer-','Reports the arrival of ambassadors from the Elector Palatine, to seek aid against the Duke of Simeren.','Note that the endorsement writes \'May\' in error.\r\n'),
	('0398','27 June 1592','15920627','May it please your good L. The bearer','A letter of introduction for the bearer, the Baron of Winningberg, ambassador to the Elector Palatine.','\r\n'),
	('0399','29 June 1592','15920629','May it please your good L. Steenwicke being','The situation regarding whether the States will name Coevorden as the next town to besiege after Steenwijk.','\r\n'),
	('1152','29 June 1592','15920629','May it please your good L. Steenwicke being yelded, wherof I have advertised','The situation regarding whether the States will name Coevorden as the next town to besiege after Steenwijk.','\r\n'),
	('1155','02 July 1592','15920702','Sir. Yowe shall soe largelie understand her Majesties intention','Urging Bodley to ensure there is no hindrance or delay to the deployment of troops to France.','\r\n'),
	('0401','04 July 1592','15920704','May it please your good L. With muche deba-','News that the decision has been made to deploy Count William and his troops to attack either Oldenzaal or the castle of Grolle.','\r\n'),
	('1126','04 July 1592','15920704','May it please your good L. With muche debating and sending too and [fro be-]','News that the decision has been made to deploy Count William and his troops to attack either Oldenzaal or the castle of Grolle.','\r\n'),
	('1125','04 July 1592','15920704','[Ri]ght wurshipfull I very well perceyve of the lettres of our brethern at Middleburgh your care','Concerning the taxing of English cloth, and the restricting of trade.','\r\n'),
	('1157','13 July 1592','15920713','Sir sence my Returne hether I receyved these','Asks Bodley to advise the States not to withdraw the two companies of troops from Ostend to be deployed to France, and that he requires more money.','On fol.249r the signature \'HH\' is expunged and replaced by \'Gg\'.\r\n'),
	('1156','15 July 1592','15920715','May it please your good L. The 10. of this moneth being com[e]','Bodley has received the new letters from the queen to the States, but has noticed that they contain a clause which he thinks may be detrimental to the sending of English troops to France.','On fol.245r, there is the signature \'FF\'.\r\n'),
	('0403','16 July 1592','15920715','May it please your good L. The 10. of this moneth','Bodley has received the new letters from the queen to the States, but has noticed that they contain a clause which he thinks may be detrimental to the sending of English troops to France.','\r\n'),
	('0402','15 July 1592','15920715','May it please your good L. The 10th of this moneth','Bodley has received the new letters from the queen to the States, but has noticed that they contain a clause which he thinks may be detrimental to the sending of English troops to France.','\r\n'),
	('0404','16 July 1592','15920716','May it please your good L. to prevent the misca-','Concerning the States\' proposed aid for France, and their proposition to the Provinces to that end.','\r\n'),
	('1158','16 July 1592','15920716','May it please your good L. To prevent the miscarieng or','Concerning the States\' proposed aid for France, and their proposition to the Provinces to that end.','\r\n'),
	('0405','19 July 1592','15920719','May it please your good L. Of my publicke dealing with','Concerning the obtaining of the licence from the States to withdraw English troops from the United Provinces into France.','\r\n'),
	('1159','19 July 1592','15920719','May it please your good L. Of my publicke dealing with','Concerning the obtaining of the licence from the States to withdraw English troops from the United Provinces into France.','On fol.252r the signature \'KK\' has been expunged and replaced with \'Hh\'.\r\n'),
	('1160','20 July 1592','15920720','Sir I knowe not howe to Complaine, nor where to [imparte]','Complains that he has not received any letters from Bodley, and sends news of exploits by Verdugo and Mondragon.','\r\n'),
	('1370','20 July 1592','15920720','Right worshipfull. a few dayes paste we received this enclosed','Regarding the tax against their trade, and suggestions of ancient precedents which might help the argument.','\r\n'),
	('1164','25 July 1592','15920725','Right worshipfull daies past we sent a lettre unto you','Intends to send a merchant from the company in London to the Hague if necessary.','\r\n'),
	('0406','25 July 1592','15920725','May it please your good L. Upon my letters','Bodley communicates the urgent requirement of the States General that Engish troops be deployed around Doesburg. News of the death of Fauma, governor of Heusden.','\r\n'),
	('1168','25 July 1592','15920725','May it please your good L. upon my letters unto yow','Bodley communicates the urgent requirement of the States General that Engish troops be deployed around Doesburg. News of the death of Fauma, governor of Heusden.','\r\n'),
	('1169','28 July 1592','15920728','Sir. As yowe did gesse, so have the states written there','Informs Bodley that the queen wishes the English troops which have been at the siege of Steenwijk to be deployed to Britanny.','On fol.264r the signature \'MM\' has been expunged and replaced with \'Kk\'.\r\n'),
	('1165','29 July 1592','15920729','Sir. suche is my busines, which increaseth every day, that I can','Having received an answer from the States General to the Merchant Adventurers\' complaint, Bodley asks the company to clarify their grievance, and gives them advice on how to reply to the States.','\r\n'),
	('1163','29 July 1592','15920729','May it pelase your good L. Upon the sight of your lettre of the 20 of this','Bodley accounts for his whereabouts for the last couple of weeks, and reports intercepted intelligence.','\r\n'),
	('0407','29 July 1592','15920729','May it please your good L. Upon the sight','Bodley accounts for his whereabouts for the last couple of weeks, and reports intercepted intelligence.','\r\n'),
	('1166','01 August 1592','15920801','May it please your good L. I had yesterday a letter from','News that the States require more English troops upon news that enemy forces have assembled in Brabant.','\r\n'),
	('0408','01 August 1592','15920801','May it please your good L. I had yesterday','News that the States require more English troops upon news that enemy forces have assembled in Brabant.','\r\n'),
	('1170','03 August 1592','15920803','Righte worshipfull upon consideration of your letters','Regarding the agreement with the States General and the Merchant Adventurers over the \'tare\' on English cloth','On fol.265r there is the signature \'LL\'.\r\n'),
	('1172','04 August 1592','15920804','Sir. I have often written into yowe of late, concerning this matter','Concerning the States\' prevarication over a the word \'pourveu\' in the recent communications, regarding the deployment of English troops from Steenwijk to Zeland and France.','\r\n'),
	('1173','08 August 1592','15920808','May it please your good L. Wheras her Majestie hath eftsoons written in the case','Concerning various monies owed to Colonel Sonoy by the States.','\r\n'),
	('0409','08 August 1592','15920808','May it please your good L. Wheras her Majestie hath','Concerning various monies owed to Colonel Sonoy by the States.','\r\n'),
	('0410','11 August 1592','15920811','May it please your good L. I knowe not','Reporting the delivery of letters, and informing Burghley that he has sent a messenger of purpose to Sir Francis Vere.','The final part of the subscription is written perpendicular in the left margin.\r\n'),
	('1174','11 August 1592','15920811','May it please your good L. I know not who had undertaken','Reporting the delivery of letters, and informing Burghley that he has sent a messenger of purpose to Sir Francis Vere.','\r\n'),
	('0411','19 August 1592','15920819','May it please your good L. Her Majesties letter to','Gives Burghley the details of how he has passed the queen\'s letter to the States.','\r\n'),
	('1175','19 August 1592','15920819','May it please your good L. Her Majesties lettre to the states of the 23 of','Gives Burghley the details of how he has passed the queen\'s letter to the States.','\r\n'),
	('1176','20 August 1592','15920820','Upon the closing of my former, I received her Highnes lettre to the states','Informs Burghley that the troops are ready to go for France, but the decision has still not be signed off by the States, and Bodley doubts that they will agree.','\r\n'),
	('0412','20 August 1592','15920820','Upon the closing of my former, I receaved her','Informs Burghley that the troops are ready to go for France, but the decision has still not be signed off by the States, and Bodley doubts that they will agree.','\r\n'),
	('1177','21 August 1592','15920821','Sir. This matter that hath hounge in Balance so longe for','Informing Bodley of the queen\'s direction for the English troops to set off for Caen.','\r\n'),
	('1167','24 August 1592','15920824','Sir. Yesterdaie being the xxiijth of this moneth your lettres of the','Concerning the lack of Bodley\'s letters to the queen and privy council, in regard to the urgent requirement of the French King for military assistance.','\r\n'),
	('1180','29 August 1592','15920829','May it please your good L. I signified in my last the 19 and the 20 of','Informs Burghley that although the queen\'s instructions to deploy the troops have been received, there is still a delay, as the States\' army is depleted in the face of the Enemy\'s.','\r\n'),
	('0413','31 August 1592','15920831','May it please your good L. Heere are letters from','Reports that enemy forces are within half a league of Count Maurice\'s troops, and of a recent incursion into the camp.','\r\n'),
	('1181','31 August 1592','15920831','May it please your good L. Heere are letters','Reports that enemy forces are within half a league of Count Maurice\'s troops, and of a recent incursion into the camp.','\r\n'),
	('1184','04 September 1592','15920904','May it please your good L. I receaved the last of August at night, by the post','Reports how the States requested that Bodley delay informing Sir Francis Vere of the queen\'s latest instructions to send troops to France, as they are worried that the Enemy will think their forces depleted.','\r\n'),
	('1186','05 September 1592','15920905','After my lettres wrytten yesternight and not sent from hence','Has heard that Sir Francis Vere and his troops have arrived in Zeland, but has heard nothing of the other bands.','\r\n'),
	('0414','05 September 1592','15920905','May it please your good L. I receaved the last','Reports how the States requested that Bodley delay informing Sir Francis Vere of the queen\'s latest instructions to send troops to France, as they are worried that the Enemy will think their forces depleted.','\r\n'),
	('0416','06 September 1592','15920906','May it please your good L. I send with this letter','Encloses the States\' answer to the recent propositions, and notes that they will turn a blind eye to the movement of English troops. Other news, including intelligence that the Enemy is marching from Coevorden to Groningen.','\r\n'),
	('1185','09 September 1592','15920909','Sir, The enemy being at Coevoerden in that strength that','Due to the situation at Coevorden, Bodley informs Norris that the troops he requires are not available at this time.','\r\n'),
	('0417','13 September 1592','15920913','May it please your good L. Having moved','Reporting the States\' resistance to the queen\'s demand that the English horsebands be withdrawn.','\r\n'),
	('1182','13 September 1592','15920913','[May it] please your good L. Having moved','Reporting the States\' resistance to the queen\'s demand that the English horsebands be withdrawn.','\r\n'),
	('0418','14 September 1592','15920914','May it please your good L. The general states','Concerning the movement of troops, the freezing of pay, and the execution of mariners accused of piracy in Enchusen and Amsterdam.','\r\n'),
	('1187','14 September 1592','15920914','May it please your good L. The General states','Concerning the movement of troops, the freezing of pay, and the execution of mariners accused of piracy in Enchusen and Amsterdam.','\r\n'),
	('1188','16 September 1592','15920916','May it please your good L. In what I have proceeded','Concerning the fate of the English pirates.','\r\n'),
	('0419','21 September 1592','15920921','May it please your good L. I have sent with this','Concerning the mustering and reckoning of English forces under Sir Francis Vere and the remaining number in Sir Nicholas Parker\'s company.','Letter annotated by Burghley. On fol.240v there is a mark in the margin at the words \'Lastly it is some grief\'. On fol.242r at the words \'deale lesser summe\' there are three crossed spheres in the margin. The final part of the subscription and the postscript are inscribed perpendicular in the left hand margin.\r\n'),
	('1189','21 September 1592','15920921','May it please your good L. I have sent with this lettre','Concerning the mustering and reckoning of English forces under Sir Francis Vere and the remaining number in Sir Nicholas Parker\'s company.','\r\n'),
	('1190','29 September 1592','15920929','May it please your good L. Sir Francis Vere having bin in','Reports that the States have sent 4 companies to replace the 6 English companies being sent from Bergen op Zoom to France. Has informed the governor to send the 6 companies away anyway, so it will force the States to supply more men.','\r\n'),
	('0421','29 September 1592','15920929','May it please your good L. Sir Francis Vere having','Reports that the States have sent 4 companies to replace the 6 English companies being sent from Bergen op Zoom to France. Has informed the governor to send the 6 companies away anyway, so it will force the States to supply more men.','\r\n'),
	('1192','07 October 1592','15921007','Sir. I never had from yowe since yowe advertised mee of your','Concerning the English forces to be withdrawn from Bergen-op-Zome','On fol.336 there is the signature \'WW\'.\r\n'),
	('0422','10 October 1592','15921010','May it please your good L. I was lately requested to come','Concerning recent discussion with the States over the attacks on shipping by pirates, and the withdrawing of Engish forces to be sent to France.','\r\n'),
	('1193','10 October 1592','15921010','May it please your good L. I was lately requested','Concerning recent discussion with the States over the attacks on shipping by pirates, and the withdrawing of Engish forces to be sent to France.','\r\n'),
	('1196','25 October 1592','15921025','May it please your good L. With your lettres of the 7 and 8','Concerning the number of \'strangers\' within the English companies, and the obstacles facing the English troops heading towards Brittany.','On fol.349r there is the signature \'Yy\'.\r\n'),
	('1195','25 October 1592','15921025','May it please your good L. With your letters','Concerning the number of \'strangers\' within the English companies, and the obstacles facing the English troops heading towards Brittany.','On fol.344r there is the signature \'Xx\'\r\n'),
	('1198','02 November 1592','15921102','May it please your good L. being charged againe','Regarding the plan to ship the English forces to Jersey, and how his current instructions are to land the forces at Caen, not Jersey.','The last line of the letter runs perpendicular in the left hand margin.\r\n'),
	('0423','02 November 1592','15921102','May it please your good L. being charged againe','Regarding the plan to ship the English forces to Jersey, and how his current instructions are to land the forces at Caen, not Jersey.','\r\n'),
	('1199','16 November 1592','15921116','May it please your good L. Heere is litle other','Information about the composition of the fleet heading for Bordeaux, and the States\' request for the English troops now in Britanny to be returned after a certain time.','The subscription runs perpendicular in the left hand margin.\r\n'),
	('0425','16 November 1592','15921116','May it please your good L. Heere is litle other','Information about the composition of the fleet heading for Bordeaux, and the States\' request for the English troops now in Britanny to be returned after a certain time.','\r\n'),
	('1200','09 December 1592','15921209','Sir. I cannot omitt at this time, but to remember yowe, what good','Commands Bodley to urge the States to seize the opportunity created by the death of the Duke of Parma to take control of Flanders and Brabant.','\r\n'),
	('0426','20 December 1592','15921220','May it please your good L. I have bin lately','Concerning his petition to return home, and that due to the States\' assembly being adjourned, he has little to write.','\r\n'),
	('1202','20 December 1592','15921220','May it please your H. to be certified, that I','Thanks him for his intercession with the queen regarding his petition to return home.','\r\n'),
	('1201','20 December 1592','15921220','May it please your good Ladyship Within a lettre of Sir Francis Vere, of the','Gives thanks for her intercession with the queen regarding his petition to return home.','\r\n'),
	('1203','20 December 1592','15921220','May it please your good L. I have bin lately disquieted with a','Concerning his petition to return home, and that due to the States\' assembly being adjourned, he has little to write.','\r\n'),
	('0016','1593','15930000','May it please your good L: I writ in my Laste [yt]','Letter of petition to Essex, to further his suit to return home.','\r\n'),
	('0004','after 16 January 1593','15930100','May it please your good L. The bearer hereof','Regarding the bearer \'Mr Brune\', disorders in the Mint, and diverse intelligence.','\r\n'),
	('0002','03 January 1593','15930103','May it please your good L. Wheras her Majestie is informed,','Concerning how the States should wrest control of Brabant and Flanders following the death of the Duke of Parma.','On fol.2r there is the signature \'B\'.\r\n'),
	('0427','03 January 1593','15930103','May it please your good L. Wheras her','Concerning the lack of authority among the states in taking the initiative to urge the provinces of Brabant and Flanders to turn against Spanish rule following the death of the Duke of Parma.','\r\n'),
	('0428','06 January 1593','15930106','Right woorshipfull I have acording to your comyshon made dylligent','Report of the ships being sold from Amsterdam, and that he has intelligence to be imparted directly with the Lord Treasurer.','\r\n'),
	('0003','15 January 1593','15930115','May it please your good L. As touching ye two','Regarding \'two Menninches\' and their dealings in the Low Countries','\r\n'),
	('0429','16 January 1593','15930116','May it please your good L. As touching the two','Concerning the information Mr Brune has, and his reluctance to travel to England to impart it without a passport.','\r\n'),
	('0430','24 January 1593','15930124','May it please your good L. The bearer heerof','Regarding the bearer \'Mr Brune\', disorders in the Mint, and diverse intelligence.','\r\n'),
	('0006','04 February 1593','15930204','May it please your good L. The people of these contreis','Concerning the plans for the summer campaign.','\r\n'),
	('0007','11 February 1593','15930211','Sir. The States have wrytten often to her Majes[ty]','Sends copy of negotiations with the States, and insists on continued goodwill between himself and Bodley','\r\n'),
	('0005','15 February 1593','15930215','Sir I have of late received sondrie letters from youe, [which]','Concerning Mr Brune\'s report of the theft of English victual and shipping, and by a Scottish conspiracy to join with Spain in their invasion of England.','The postscript is written perpendicular in the left hand margin. On fol.7r is the signature \'D\'.\r\n'),
	('0012','18 February 1593','15930218','May it please your good L. Wheras by the Treatie there are allowed','Concerning the States\' complaints at the number of soldiers in the English garrison towns.','\r\n'),
	('0008','18 February 1593','15930218','May it please your good L. Wheras by the','Concerning the States\' complaints at the number of soldiers in the English garrison towns.','On fol.12r there is the signature \'E\'.\r\n'),
	('0018','10 March 1593','15930310','May it please your good L. Your lettre of the 15. of Feb','Assuring Essex of his intent to supply him with news and intelligence.','\r\n'),
	('0020','16 March 1593','15930316','May it please your H. to be advertised, that through the slackn[ess]','Information about the plan to besiege Geertruidenberg, and about his request to be recalled home.','\r\n'),
	('0431','22 March 1593','15930322','May it please your good L. Having written of late','Has received the letter for Buzenval and has forwarded it to Utrecht. Report of the siege of Geertruidenberg.','At the words \'may be practised by her Highnes Commissaries\' the writing runs perpendicular in the left hand margin.\r\n'),
	('0013','22 March 1593','15930322','May it please your L: The 20 of this moneth I receaved 2 lettres','Has received the letter for Buzenval and has forwarded it to Utrecht. Report of the siege of Geertruidenberg.','\r\n'),
	('0014','28 March 1593','15930328','Sir I have moved youer suites to the Councell of est[ate]','Regarding Sir Edward Norris\' suit to increase his forces.','This scribal letter features words inset by Bodley into the text, where it appears gaps have been left by the [inexperienced?] scribe.\r\n'),
	('0024','After 24 March 159[3]','15930400','May it please your good L: yesternight I rxd 2 lettres from yow, to wit of the','Regarding theunconfirmed plan to attack Dunkirk, and other military intelligence.','\r\n'),
	('0026','April 1593','15930400','Master Bodley sence my last I heare out','Military intelligence about Geertruidenberg, and a request for more war provisions.','\r\n'),
	('0021','05 April 1593','15930405','Sithence the writeing of this inclosed, I understand','Concerning military information obtained from intercepted letters, about the forces around Ghent and the sending of troops to protect Geertruidenberg.','Although it is not indicated on this letter, it is likely that the recipient was Bodley.\r\n'),
	('0434','07 April 1593','15930407','May it please your good L. That whiche I have','Regarding the intended marriage between the eldest daughter of the Princesse of Orange, the enemy\'s succour of Groningen and a misadventure at Geertruidenberg.','\r\n'),
	('0022','07 April 1593','15930407','May it &c. I have sent yow heereincl[osed]','Sends Burghley a copy of a libel against the queen of England by the Pope.','\r\n'),
	('0023','07 April 1593','15930407','former lettres as touching an intended matter be-','Concerning the proposed marriage between the Count Palatine and the eldest daughter of the Princesse of Orange.','The first line of this letter is missing due to fire damage.\r\n'),
	('0435','07 April 1593','15930407','May it please your good L. I have sent yow heer-','Sends Burghley a copy of a libel against the queen of England by the Pope.','\r\n'),
	('0436','12 April 1593','15930412','May it please your good L. I can not answear','Reporting that Sir Francis Vere has gone towards Count Maurice, and Bodley and he have not had the opportunity to confer over Vere\'s instructions.','\r\n'),
	('0025','12 April 159[3]','15930412','May it  please your good L. I can not answear','Reporting that Sir Francis Vere has gone towards Count Maurice, and Bodley and he have not had the opportunity to confer over Vere\'s instructions.','\r\n'),
	('0437','14 April 1593','15930414','May it please your good L. I am earnestly','Regarding the debts owed to the inhabitants of Flushing, incurred by Captains Randolf and Wingfield.','\r\n'),
	('0438','18 April 1593','15930418','May it please your good L. Having had some speeche','Military intelligence, including the news that Sir Thomas Morgan is to be removed from the Governorship of Bergen op Zoom.','\r\n'),
	('0027','18 April 1593','15930418','May yt please your good L. having had som speech with Sir Francis Vere who hath','Military intelligence, including the news that Sir Thomas Morgan is to be removed from the Governorship of Bergen op Zoom.','\r\n'),
	('0439','28 May 1593','15930528','May it please your good L. When I recea-','Informs Burghley that he has delivered the queen\'s letter to the Deputies of the Provinces, and has received his license to return home.','\r\n'),
	('0440','28 May 1593','15930528','May it please your good L. I had no sooner','News that Count Charles Mansfeld has returned out of France, and that the waters around Geertruidenberg have flooded.','The later addition on the address leaf erroneously states the date as April.\r\n'),
	('0010','24 September 1593','15930924','Sir I can not sufficiently thanke you for the good inclination you bea[r]','Appeal to Bodley and the rest of the Council of State that their charges might be eased.','\r\n'),
	('0019','10 March 1593','15931003','May it please your good L. It should seeme by your','Informs Burghley he has not received any letters from him in the last 4 months, and intelligence about Count Philip\'s actions and the successful suit of Colonel Sonoy.','\r\n'),
	('0764','14 February 1594','15940214','Maie it please your good L. Since I sent you my last the','Information regarding the embassy of Colonel Stewart.','\r\n'),
	('0760','14 February 1594','15940214','Maie it please your good Lordship: upon conference had with Master Barnvelt','Concerning the States\' reply to the queen\'s demand for payment, and the arrival of Colonel Stewart from Scotland.','\r\n'),
	('0763','22 February 1594','15940222','Maie it please your good Lp. besides that which I have','Information from Colonel Murray about where the money secured for James VI will be distributed.','\r\n'),
	('0765','26 February 1594','15940226','Maie it please your good L. here I send you the','Encloses the copies of two intercepted letters written by Scottish Jesuits.','\r\n'),
	('0761','March 1594','15940300','May it please your good L: So longe absence of the Deputies of Guel','Reports delays caused by the weather, preventing the return of the deputies sent to Guelderland and Overijssel, and other news.','\r\n'),
	('0766','02 March 1594','15940302','Maie it please your good Lp It was your pleasure','Concerning conversation had with Robert Devinston, the Scottish Ambassador.','\r\n'),
	('0769','04 March 1594','15940304','Maie it please your good L. Amonge divers lettres sent from','Encloses intercepted letters, and offers new intelligence.','\r\n'),
	('0767','04 March 1594','15940304','Maie it please your good L. Having sent my L.','Encloses a recently intercepted letter.','\r\n'),
	('0759','10 March 1594','15940310','Sir, I am nothing forgetfull of yow or your desire','Letter of friendship, containing intelligence','\r\n'),
	('0768','14 March 1594','15940314','Maie it please your good Lop. Th[at] sent being knowne and told me','Regarding James VI request for financial assistance from the States.','\r\n'),
	('0442','26 May 1594','15940526','May it please your good L. to be advertised, that','Reports the States\' reluctance to send a portion of their troops to France.','\r\n'),
	('0041','26 May 1594','15940526','Maye it please your good L. to be advertaised that I arryved in','Reports the States\' reluctance to send a portion of their troops to France.','\r\n'),
	('1368','6 June 1594','15940606','Maye it please your H. to be advertised that I receaved your lettres','Informing him that he has urged the States to equip their ships as soon as possible for the relief of France.','\r\n'),
	('0444','06 June 1594','15940606','May it please your H. to be advertised, that I','Informing him that he has urged the States to equip their ships as soon as possible for the relief of France.','\r\n'),
	('0031','06 June 1594','15940606','Maye it please your H. to be advertised that I receaved your lettres of the 24th','Informing him that he has urged the States to equip their ships as soon as possible for the relief of France.','This document is badly fire damaged.\r\n'),
	('1369','11 June 1594','15940611','Maye it please your good L. we have lived in good hope that Groeninghen','Details of the progress at the siege of Groningen, and the likelihood that it will soon surrender.','\r\n'),
	('0032','11 June 1594','15940611','Maye it please your good L: we have lyved in good hope that Groeninghen','Details of the progress at the siege of Groningen, and the likelihood that it will soon surrender.','This document is badly fire damaged, obscuring the endorsement.\r\n'),
	('1371','24 June 1594','15940624','Maye it please your good L. having nothing to negotiat till I heare','Gives Burghley an update on the siege of Groningen, and is waiting for a reply from the States regarding the provision of troops and ships for France.','\r\n'),
	('0445','24 June 1594','15940624','May it please your good L. having nothing to','Gives Burghley an update on the siege of Groningen, and is waiting for a reply from the States regarding the provision of troops and ships for France.','\r\n'),
	('0039','24 June 1594','15940624','Maye it please your good L. Having nothing to negotiat till I heare from','Gives Burghley an update on the siege of Groningen, and is waiting for a reply from the States regarding the provision of troops and ships for France.','\r\n'),
	('0446','[31 June 1594]','15940631','If it might please your L. among those that','A request that he not be taxed on the three tonnes of wine he imports from England every year.','\r\n'),
	('1375','7 July 1594','15940707','Sir I have acquainted her Majesty with all suche letteres as I have receaved from yow who','Concerning the provision of troops and ships by the States to aid the enterprise in France.','\r\n'),
	('0449','07 July 1594','15940707','Sir I have acquainted her majestie with [all suche lettres as]','Concerning the provision of troops and ships by the States to aid the enterprise in France.','The top right of this letter has been excised across the diagonal.\r\n'),
	('0040','07 July 1594','15940707','Sir, I have acquainted her Majestie with all suche lettres as I haue receaved','Concerning the provision of troops and ships by the States to aid the enterprise in France.','This is a copy by Bodley of Burghley\'s letter to him.\r\n'),
	('0447','07 July 1594','15940707','Sir I have acquainted her majestie withall suche lettres','Concerning the provision of troops and ships by the States to aid the enterprise in France.','From fol.5v, the text then jumps to fol.8r, and then back to fol.6v. This is a draft annotated by Burghley.\r\n'),
	('0448','07 July 1594','15940707','Sir, I have acquainted her majestie withall suche lettres as I have','Concerning the provision of troops and ships by the States to aid the enterprise in France.','\r\n'),
	('0034','10 July 1594','15940710','Maye it please your good L: I have nothing more to signifie for myne','Various news, including the Prince of Anholt\'s visit to Count Maurice concerning a proposed union with his sister.','This document is badly fire damaged.\r\n'),
	('1374','10 July 1594','15940710','Maye it please your good L. I have nothing more to signifie for myne owne nego-','Various news, including the Prince of Anholt\'s visit to Count Maurice concerning a proposed union with his sister.','\r\n'),
	('0450','10 July 1594','15940710','May it please your good L. I have nothing more to','Various news, including the Prince of Anholt\'s visit to Count Maurice concerning a proposed union with his sister.','\r\n'),
	('1372','10 July 1594','15940710','Maye it please your good Lordshipe I have nothing more','Various news, including the Prince of Anholt\'s visit to Count Maurice concerning a proposed union with his sister.','\r\n'),
	('0451','11 July 1594','15940711','May it please your good L. Since the writing of my','News that the surrender of Groningen is imminent.','\r\n'),
	('0035','11 July 1594','15940711','May it please your good L. since the writing of my','News that the surrender of Groningen is imminent.','\r\n'),
	('0452','13 July 1594','15940713','May it please your H. to be advertised, that the','Signifies that the States have made an answer regarding their trade with Spain, and that Groningen are preparing their terms for surrender.','\r\n'),
	('0453','13 July 1594','15940713','May it please your H. Presently upon the','News of the surrender of Groningen.','\r\n'),
	('0038','13 July 1594','15940713','May it please your H. to be advertised, that the inclosed','Signifies that the States have made an answer regarding their trade with Spain, and that Groningen are preparing their terms for surrender.','\r\n'),
	('0454','14 July 1594','15940714','Not to leave your H. doubtfull about the taking','Further intelligence about the siege at Groningen.','\r\n'),
	('0036','17 July 1594','15940717','Sir, I am lately returned hither, to request th[e as-]','A letter of credit for Brederode and Valke, the two deputies sent to attend the Christening of Henry, son of James VI of Scotland.','At the words \'I would there were any thing\' on fol.147r, the text continues perpendicular in the left hand margin. This document is badly damaged by fire.\r\n'),
	('0456','21 July 1594','15940721','May it please your good L. By your Letter of the 7 which','Can report that the States are committed to helping furnish the expedition to France as far as they can.','\r\n'),
	('0455','21 July 1594','15940721','May it please your good L. Assoone as I had','Concerning the queen\'s request of the states for assistance with shipping and victuals for the enterprise in France.','\r\n'),
	('1376','21 July 1594','15940721','Maye it please your good Lordshipe as soone as I had sealed my former unto yow','Concerning the queen\'s request of the states for assistance with shipping and victuals for the enterprise in France.','\r\n'),
	('0037','[21] July 1594','15940721','May it please your good L. Assoone as I had sealed my','Concerning the queen\'s request of the states for assistance with shipping and victuals for the enterprise in France.','This letter has been badly damaged by fire.\r\n'),
	('1377','21 July 1594','15940721','Maye it please your good L. by your lettre of the 7 which I receaved the 19','Can report that the States are committed to helping furnish the expedition to France as far as they can.','\r\n'),
	('1373','21 July 1594','15940721','Maye it please your good lordshipe by your lettere of the 7 which','Can report that the States are committed to helping furnish the expedition to France as far as they can.','On the fourth line of the letter, there is a lacuna between the words \'the\' and \'Brest\'.\r\n'),
	('0052','21 July 1594','15940721','Maye it please your good L: By your letter of the 7. which I recea-','Can report that the States are committed to helping furnish the expedition to France as far as they can.','\r\n'),
	('1378','21 July 1594','15940721','Maye it please your good L. Assoone as I had sealed my former unto yow','Concerning the queen\'s request of the states for assistance with shipping and victuals for the enterprise in France.','\r\n'),
	('0050','27 July 1594','15940727','Sir your last letters come to my hands weare','Concerning Bodley\'s continued employment in the United Provinces.','\r\n'),
	('0457','28 July 1594','15940728','May it please your good L. I reported in my last the 21.','Concerning the shipping required for the enterprise in Brittany, and the states attending the queen\'s decision.','\r\n'),
	('0049','28 July 1594','15940728','May it please your good L. I reported in my[ne]','Concerning the shipping required for the enterprise in Brittany, and the states attending the queen\'s decision.','\r\n'),
	('1379','28 July 1594','15940728','Maye it please your good L. I reported in my last the 21','Concerning the shipping required for the enterprise in Brittany, and the states attending the queen\'s decision.','\r\n'),
	('0055','After 08 September 1594','15940800','Wheras I was enjoined by her Majesties Instructions','Relating his negotations with the States regarding the additional shipping required for Brittany.','\r\n'),
	('0057','After 08 September 1594','15940800','Whereas I was enjoyned by her Majesties Instructions, to requyre','Relating his negotations with the States regarding the additional shipping required for Brittany.','\r\n'),
	('0458','03 August 1594','15940803','Sir, upon the first daie of this moneth at one instance I received','Directions to tell the States that the queen would be content to accept the assistance of 10 ships for the aid of France.','\r\n'),
	('0459','03 August 1594','15940803','Sir, Uppon the first daie of this moneth at one','Directions to tell the States that the queen would be content to accept the assistance of 10 ships for the aid of France.','\r\n'),
	('1380','3 August 1594','15940803','Sir uppon the fyrste daye of this monthe at one instante I Receaved 3 letteres','Directions to tell the States that the queen would be content to accept the assistance of 10 ships for the aid of France.','\r\n'),
	('0044','03 August 1594','15940803','Sir, upon the first daie of this moneth at one instant I receaved three','Directions to tell the States that the queen would be content to accept the assistance of 10 ships for the aid of France.','\r\n'),
	('0460','07 August 1594','15940807','May it please your good L. I can not but ad','Informs Burghley that the States are waiting to hear what the queen intends to send in terms of shipping, for the aid of Brittany.','\r\n'),
	('0461','14 August 1594','15940814','May it please your good L. For answear to your lettre','Concerning the movement of shipping, and the lack of instructions for Bodley since his return to the Low Countries.','On fol.99r there is a crossed mark in the margin at the wordes \'that the countermaunde had stoode\'. The bottom half of the final verso also forms the address leaf.\r\n'),
	('0053','14 August 1594','15940814','May yt please your good Lp. For answere to your lettre of the 3d of this present, I','Concerning the movement of shipping, and the lack of instructions for Bodley since his return to the Low Countries.','\r\n'),
	('1381','14 August 1594','15940814','May it please your good Lordshipe. For Answere to your lettre of the 3 of this present','Concerning the movement of shipping, and the lack of instructions for Bodley since his return to the Low Countries.','\r\n'),
	('0056','25 August 1594','15940825','Sir, Hir Majestie hath againe at this time written','Concerning the queen\'s efforts to resolve the dispute between Sir Thomas Morgan and the States.','\r\n'),
	('0054','27 August 1594','15940827','Sir.  I have the 26 daye of this August received yours of the 14. beyng','States that he has furnished Bodley with sufficient instruction, contrary to Bodley\'s recent complaints.','This letter is a scribal copy by Bodley.\r\n'),
	('1382','27 August 1594','15940827','Sir I have the xxvjth day of this August','States that he has furnished Bodley with sufficient instruction, contrary to Bodley\'s recent complaints.','\r\n'),
	('0046','31 August 1594','15940831','Sir. By my last I wroate unto yowe that by [the]','Encloses Bodley\'s license to return, and reports on the what the queen is likely to ask Bodley when he comes to Court.','\r\n'),
	('0058','October 1594','15941000','May it please your good L. I have newly','Has received his licence to return home.','\r\n'),
	('0059','07 December 1594','15941207','Maye it please your good L: to receave the originall lettres, which your','Returns Cecil\'s letters regarding the negotiation, and relates an account of his recent audience(s) with the queen.','\r\n'),
	('1275','1595','15950000','Wheras your L. doth require, that sith her Majestie','A lengthy paper giving detailed information on the States\' likelihood of paying back their loan.','\r\n'),
	('1247','1595','15950000','May it please your good L. upon hope every day to receave aunswear','Is still waiting for an answer from the States, and Colonel Stewart is waiting for his dispatch.','On fol.54r there is the signature \'O\'. It is drawn twice, once in pencil, and once in ink.\r\n'),
	('1239','1595','15950000','May it please your good L. to that effect that I writte the 14. of this mo','Report of the delivery of the recent propositions to the states, the arrival of Colonel Stewart from Scotland, and the death of Archduke Ernestus.','On fol.32r there is the signature \'H\', written once in pencil and once in ink. From the beginning of the letter to the penultimate line on fol.32v, the text has been marked with a perpendicular line in the margin. This is repeated from the underlining on fol.34v through to the underlining on fol.33r. The leaves of the letter have been misbound: fol.34r is the following leaf to fol.32v.\r\n'),
	('1237','1595','15950000','May it please your good L. upon conference with Mr Barnevelt, and','Concerning the delay in the States returning an answer to the queen\'s proposition, the arrival of Colonel Stewart from the King of Scotland, and the fortification of Huy.','\r\n'),
	('1232','January 1595','15950100','Oh, my lord Embassador, I had never','Excusing himself [for having a Jesuit among his troops] and recommending his suit to the States and the queen, via Bodley.','On fol.12r there is the signature \'C\'.\r\n'),
	('1233','23 January 1595','15950123','Sir, By your last dispatch, her Majesty is referred untyll fur-','Thanks Bodley for dealing with one of his clients, and informs him that the queen is displeased with the States\' froideur.','\r\n'),
	('1234','25 January 1595','15950125','Sir, Since your departure from hence, theare is [...]','Updates Bodley on the latest news about the Spanish forces in France.','Document is extremely faded in places.\r\n'),
	('0693','05 February 1595','15950205','Maye it please your good L: to be advertised, that when I came to the','Reporting that negotiations are delayed due to the States being at the marriage of Count Hohenlo, and the arrival of Colonel Stuart.','\r\n'),
	('0466','05 February 1595','15950205','May it please your good L. to be advertised, that','Various news, including the delay in the States\' answer regarding repayment of the loan to the queen, the German ambassadors for peace, and the fort of Huy.','\r\n'),
	('0692','05 February 1595','15950205','May it please your good L. When I came to Middel-','Reporting a conversation had with Monsieur Valke, regarding  Colonel Stuart\'s overture from the King of Scotland to the States General.','\r\n'),
	('1236','05 February 1595','15950205','May it please your good L. to be advertised, that when I came to the Hage the','Various news, including the delay in the States\' answer regarding repayment of the loan to the queen, the German ambassadors for peace, and the fort of Huy.','\r\n'),
	('0669','14 February 1595','15950214','May it please your good L. sins I sent yow my','Reporting information had from Colonel Murray about the reason and background to Colonel Stewart\'s visit to the States.','\r\n'),
	('0688','14 February 1595','15950214','Maye it please your good L: upon conference had with Mr Barne-','Reports conversations had with the States regarding the repayment of the loan, and various other intelligence.','\r\n'),
	('1238','14 February 1595','15950214','Right honorable, my very good L. Your lettre of the','News that the town and fort of Huy have been taken by soldiers of the alliance.','\r\n'),
	('0544','22 February 1595','15950222','To that effect that I writte the 14. of this moneth, there have','Report of the delivery of the recent propositions to the states, the arrival of Colonel Stewart from Scotland, and the death of Archduke Ernestus.','\r\n'),
	('0467','22 February 1595','15950222','May it please your good L. to that effect that I','Report of the delivery of the recent propositions to the states, the arrival of Colonel Stewart from Scotland, and the death of Archduke Ernestus.','\r\n'),
	('0670','22 February 1595','15950222','May it please your good L: to that effect that I writte the 14. of this moneth,','Report of the delivery of the recent propositions to the states, the arrival of Colonel Stewart from Scotland, and the death of Archduke Ernestus.','\r\n'),
	('0671','22 February 1595','15950222','May it please your good L. Besides that which I have','Reporting further information from Colonel Murray concerning how the King of Scotland is reputedly planning to distribute the money he hopes to receive from the States.','\r\n'),
	('0762','22 February 1595','15950222','Maie it please your good L: to the effecte that I writte the 14th of this','Report of the delivery of the recent propositions to the states, the arrival of Colonel Stewart from Scotland, and the death of Archduke Ernestus.','\r\n'),
	('1240','24 February 1595','15950224','May it please your H. to be advertised that having perused Sir','Concerning monies owing by Brabant, and the debt owed to the queen by the States.','On fol.36r there is the signature \'J\' twice, once in pencil and once in ink.\r\n'),
	('0468','24 February 1595','15950224','May it please your H. to be advertised, that having','Concerning monies owing by Brabant, and the debt owed to the queen by the States.','\r\n'),
	('0469','26 February 1595','15950226','May it please your good L. to receave the copies','Cover note enclosing two intercepted letters written from Jesuits in Brussels and sent to Rome.','\r\n'),
	('0672','26 February 1595','15950226','May it please your good L. Heare I send yow','Concerning letters intercepted sent from Creighton the Jesuit.','This letter is bound next to one of the enclosed ciphered letter.\r\n'),
	('1245','March 1595','15950300','After my hartie Commendacions [I heare have recevid]','Has received a number of Bodley\'s letters from the previous month, and replies to the points Bodley raises about his answers to the States regarding the repayment of the loan.','Document is extremely faded in places.\r\n'),
	('1241','March 1595','15950300','May it please your good L. Among dyvers lettres sent from Brussels','Informs Burghley that a third letter has been intercepted from Brussels, which suggests that there is discontentment in the Spanish camp.','\r\n'),
	('0673','02 March 1595','15950302','May it please your good L. It was your pleasure to','Report of the latest news about Colonel Stuart.','The ink on this letter is extremely faded.\r\n'),
	('0674','04 March 1595','15950304','May it please your good L. Having sent my L','Concerning a recent conspiracy in Scotland.','This is the cover letter for letter 0675.\r\n'),
	('0675','04 March 1595','15950304','May it please your good L. Among dyvers lettres sent from Brus-','Concerning the intercepted letters from Creighton the Jesuit, and the rumour of the discontent of towns under Spanish control, and their desire to join the United Provinces.','This letter is enclosed within 0674.\r\n'),
	('0470','04 March 1595','15950304','May it please your good L. Among divers lettres sent','Informs Burghley that a third letter has been intercepted from Brussels, which suggests that there is discontentment in the Spanish camp.','\r\n'),
	('1242','08 March 1595','15950308','May it please your H. to be advertised that according to your Lettr[e]','Concerning the monies owed to Sir Horace Pallavicine.','\r\n'),
	('0471','08 March 1595','15950308','May it please your H. to be advertised, that accor-','Concerning the monies owed to Sir Horace Pallavicine, and the affirmation by the Governor of Huy that the town will hold fast.','\r\n'),
	('0677','14 March 1595','15950314','May it please your good L. that point being','A note regarding the secret Instructions of Colonel Stewart, as also sent to William Cecil, Lord Burghley.','\r\n'),
	('0676','14 March 1595','15950314','May it please your good L. Soe long absence of the Deputies','Details of Colonel Stewart\'s instructions from the King of Scotland.','\r\n'),
	('1243','14 March 1595','15950314','May it please your good L. So long absence','Reports the delayed return of the deputies because of the recent inclement weather, and other mixed news and intelligence.','\r\n'),
	('1244','14 March 1595','15950314','May it please your good L. sins my last of the 14 ye states','Concerning the request of the King of Scotland for aid, and news of the surrender of Huy.','On fol.44r there is the signature \'L\', written once in pencil and once in ink.\r\n'),
	('0472','18 March 1595','15950318','May it please your good L. sins my last of the','Concerning the request of the King of Scotland for aid, and news of the surrender of Huy.','\r\n'),
	('0694','18 March 1595','15950318','May it please your good L. though many of my','Explains the delay in his other letters as a result of the west wind, and concerning Colonel Stuart\'s embassy from the King of Scotland.','\r\n'),
	('0695','18 March 1595','15950318','May it please your good L: sins my last of the 14. the States','Regarding the petition of Colonel Stuart, the taking of the fort of Huy, and the plans for the next military engagement.','\r\n'),
	('0473','22 March 1595','15950322','Sir. After my hartie Commendacoins. Theare have','Concerning the contents of Bodley\'s recent letters, and directions on how to proceed following the queen\'s decision.','\r\n'),
	('0709','13 April 1595','15950413','May it please your good L: Upon hope every day, to','Concerning the expected reply fom the States, and diverse intelligence.','\r\n'),
	('0689','13 April 1595','15950413','May it please your good L. The want of','Is waiting on an answer to his recent letters, and reports that there is nothing to report.','\r\n'),
	('0474','14 April 1595','15950414','May it please your H. The bearer heerof Mr','In recommendation of the bearer, Andrew Hunter, minister to the Scottish regiment.','\r\n'),
	('0774','23 April 1595','15950423','Maie it please your good Lop: in the matter of S[cherare]','Concerning the sute of [Sir Horatio] Pallavicino.','\r\n'),
	('0772','23 April 1595','15950423','May it please your Good L. A contrarie wynde hath','Concerning the states reply to the queen\'s demand for repayment, and his intention to deliver their answer in person.','\r\n'),
	('1388','23 April 1594','15950423','Their aunswear about the matter of remboursement is delivered','Concerning the States\' reluctance to repay their debt to the queen due to the recent catastrophic series of weather-related floods.','\r\n'),
	('1250','23 April 1595','15950423','May it please your good L. A contrarie wynde hath kepte me from your lettre','Concerning the states reply to the queen\'s demand for repayment, and his intention to deliver their answer in person.','On fol.64r there is the signature \'Q\', written once in pencil and once in ink. From the beginning of the letter to the underlining on fol.65r, the text is marked with a perpendicular line in the margin.\r\n'),
	('0710','23 April 1595','15950423','May it please your good L: A contrarie Wynde hath kept','Concerning the states reply to the queen\'s demand for repayment, and his intention to deliver their answer in person.','\r\n'),
	('0475','18 May 1595','15950518','May it please your H. upon your lettre unto me','Has been ill, but hopes to obtain an audience with Cecil soon.','\r\n'),
	('0476','20 May 1595','15950520','Sir. I cannot forbare wrytinge the last occasion','Has heard nothing from Bodley since he left for England. News of the military campaigns.','\r\n'),
	('0770','25 May 1595','15950525','Sir, I sturred not abroade these ten daies,','Hears of the queen\'s displeasure with him, and sends news out of Zeeland.','\r\n'),
	('0477','25 May 1595','15950525','May it please your H. to morowe to','Requests an audience with Cecil, and hopes for a warmer welcome than when he arrived back from the Low Countries.','\r\n'),
	('0776','05 June 1595','15950605','Maie it please your good L, Here came to visite me yester even Sir','Reporting that Sir Robert Sidney has paid him a visit, and assumes that Essex had shown him a recent \'schedule\'.','\r\n'),
	('0775','05 June 1595','15950605','Sir, none livinge saw the Scedule or inclosed paper. But','Insisting that the papers sent by Bodley were not viewed by Sir Robert Sidney.','\r\n'),
	('0771','06 June 1595','15950606','Sir, I send yow heereinclosed the copie of a','Sends copy of a letter for reading and return.','\r\n'),
	('0711','09 June 1595','15950609','May it please your H. of your favor, to make','Explains that he is too unwell to make the journey back to England, and suggests that a replacement be sent.','\r\n'),
	('0627','11 July 1595','15950711','May it please your good L. to vouchesafe to calle to','Requests the payment of his allowance for the previous year (328 days in total).','On fol.29r there is a marginal annotation made by Sir Robert Cecil.\r\n'),
	('0712','11 July 1595','15950711','May it please your good L. to vouchesafe to call to','Requests the payment of his allowance for the previous year (328 days in total).','\r\n'),
	('1256','22 July 1595','15950722','Wee haue giuen yow formerlie so sufficient Instruccons at yor late going','Bodley is to continue to press the States to repaying some of their debt to the English crown.','There is an initial signature and ink hatchings on the bottom of f.120r.\r\n'),
	('0481','25 July 1595','15950725','May it please your H. I will not faile to','Seeks audience to discuss the matters outlined in an enclosed document.','\r\n'),
	('0484','27 July 1595','15950727','It is expressed in her Majesties lettre to the states, and','Requires of Cecil clarification concerning his instructions.','This letter is annotated in the margin by Sir Robert Cecil.\r\n'),
	('1334','28 July 1595','15950728','May it please your H. to send me by this bea-','Requests two passports, for posthorses and himself.','Opposite fol.1r there is a engraved portrait (by M Burghers) of Thomas Bodley (centre), Sir William Pembroke (top left); William Laud (top left); Sir Kenelm Digby (base left) and John Selden (base right). An inscription at the front of this volume reads \'Original letters collected by William Upcott of the London Institution, Collectors of Books, Vol.1, 182[8]\'.\r\n'),
	('1261','August 1595','15950800','Sir That I have not er this made answer','Apologises for not replying sooner to his recent letter, and news of a skirmish in which Count Philip was injured.','\r\n'),
	('1389','17 August 1595','15950817','I had my audience with the States the 14 of this present: where','Reports his reception by the States after delivering the recent letter from the queen, and mixed intelligence.','\r\n'),
	('0486','17 August 1595','15950817','May it please your good L. I had my audience','Reports his reception by the States after delivering the recent letter from the queen, and mixed intelligence.','The final part of the subscription on fol.97v is written perpendicular in the left hand margin.\r\n'),
	('0713','17 August 1595','15950817','May it please your good L: I had my audi-','Reports his reception by the States after delivering the recent letter from the queen, and mixed intelligence.','\r\n'),
	('1260','27 August 1595','15950827','May it please your good L. By a former lettre written the 17 of','Reports that since the imparting of his answer to the States\' propositions, they have delegated members to report to Count Maurice and the Council of State.','\r\n'),
	('0715','27 August 1595','15950827','May it please your good L: by a former lettre written the','Reports that since the imparting of his answer to the States\' propositions, they have delegated members to report to Count Maurice and the Council of State.','\r\n'),
	('0705','11 September 1595','15950911','May it please your good L: Till the Deputies be re','While he waits for the Deputies of each Province to return with their answer regarding the payment of the loan, Bodley gives his opinion on whether they will honour the terms of the Treaty or not.','\r\n'),
	('1262','11 September 1595','15950911','May it please your good L. Till the deputies','While he waits for the Deputies of each Province to return with their answer regarding the payment of the loan, Bodley gives his opinion on whether they will honour the terms of the Treaty or not.','On fol.133r there is the signature \'CC\' written in pencil.\r\n'),
	('1263','24 September 1595','15950924','Sir. In my cominge hitherward to the Court uppon','Indicates that the queen demands that Bodley press the States for an answer.','On fol.185r there is the signature \'Gg\', written once in ink, and overlined in pencil.\r\n'),
	('0719','24 September 1595','15950924','Sir. In my coming hitherward to the Court uppon Monday','Has received Bodley\'s letters, and other matters','\r\n'),
	('0488','25 September 1595','15950925','May it please your good L. It is nowe ten daies','Reports the States\' delay in answering the recent requests made by the queen.','\r\n'),
	('1390','25 September 1595','15950925','It is now 10 dayes and more, that the Deputies of the States,','','\r\n'),
	('0716','25 September 1595','15950925','May it please your good L. It is nowe ten dayes','Reports the States\' delay in answering the recent requests made by the queen.','\r\n'),
	('1251','28 September 1595','15950928','Sr, To tell yow briefly my opinion as touching that course','Concerning the decision the [Merchant Adventurers?] Company in London have taken, in relation to the Placart about the rate of currency.','\r\n'),
	('0777','30 September 1595','15950930','Sir, I knowe not what to write, that might be well-','Concerning the stand-off between the enemy forces and those of the United Provinces.','\r\n'),
	('1391','19 October 1595','15951019','Whereas I am enjoyned to proceede without admitting anie','Report that the recent proposals States remain unanswered, and his frustration in obtaining any answer.','\r\n'),
	('0717','19 October 1595','15951019','May it please your good L: By your lettre of the 24. of Sept:','Bodley\'s frustration with the States\' delay in returning an answer about repaying the loan, and a report of his conversations in that behalf.','The pages are in a different order to the copy (1264).\r\n'),
	('1264','19 October 1595','15951019','May it please your good L. By your lettre of the 24. of Sept. I','Bodley\'s frustration with the States\' delay in returning an answer about repaying the loan, and a report of his conversations in that behalf.','On fol.188r there is the signature \'Hh\'. At the underlining \'I am en-[joined]\', until \'Peacemakers offer\' on fol.188v, the entire text following is marked by a perpendicular line in the margin. On fol.190r at the underlined word \'When\', the text is marked by a line in the margin until the underlined sentence on fol.190v. The pages are in a different order to the sent copy (0717).\r\n'),
	('0489','22 October 1595','15951022','May it please your good L. After so muche delibera-','Reports that the States have sent two deputies to confer with him over their answer to the queen\'s recent letters.','\r\n'),
	('0718','22 October 1595','15951022','May it please your good L. After so muche deliberation','Reports that the States have sent two deputies to confer with him over their answer to the queen\'s recent letters.','\r\n'),
	('1392','22 October 1595','15951022','After so much deliberation as in my last unto your L.','Reports that the States have sent two deputies to confer with him over their answer to the queen\'s recent letters.','\r\n'),
	('1265','22 October 1595','15951022','May it please your good L. After so muche deliberation as in my last','Reports that the States have sent two deputies to confer with him over their answer to the queen\'s recent letters.','A line has been drawn perpendicularly in the left hand margin, enclosing the text.\r\n'),
	('1267','07 November 1595','15951107','Mr Bodley: I am verie sorie to have cause at this present','Excuses his father\'s indisposition in not writing to Bodley, and writes to inform him that the privy council have met to ask Noel de Caron to signify to the states that the queen requests some assistance for naval defence.','\r\n'),
	('0492','07 November 1595','15951107','Mr Bodley. I am verie sorie, to have cause at this present','Excuses his father\'s indisposition in not writing to Bodley, and writes to inform him that the privy council have met to ask Noel de Caron to signify to the states that the queen requests some assistance for naval defence.','On fol. 219v there is an insertion on line 5 whose caret (the mark noting the insertion) appears on the line below. The insertion has been transcribed where this caret is located. The insertions on fol.219v are by Sir Robert Cecil.\r\n'),
	('0493','16 November 1595','15951116','May it please your H. sith in several lettres from','Bodley requests that his recent title of \'Ambassador\' be valid until his revocation.','\r\n'),
	('0064','25 November 1595','15951125','Sir, The lettre heerewith was sent me to convey','Regarding the States supplying shipping for preparations against the Spanish.','A later hand has inserted normalised spellings of several words.\r\n'),
	('1393','26 November 1595','15951126','For the point of defrayeng the auxiliary forces, they','Concerning the possibility of the queen terminating the treaty with the United Provinces, and the States\' response.','\r\n'),
	('0494','26 November 1595','15951126','May it please your H. to advertise her Majestie that the','Account of the States\' response to the queen\'s offers of assistance, and report of intelligence intercepted out of the Meditteranean.','\r\n'),
	('0736','26 November 1595','15951126','May it please your H. to advertise her Majestie, that the','Account of the States\' response to the queen\'s offers of assistance, and report of intelligence intercepted out of the Meditteranean.','\r\n'),
	('0778','26 November 1595','15951126','May it please your h: to advertise her majestie that the 18. of this moneth, I','Account of the States\' response to the queen\'s offers of assistance, and report of intelligence intercepted out of the Meditteranean.','\r\n'),
	('1268','26 November 1595','15951126','May it please your H. to aduertise her Matie that ye','Account of the States\' response to the queen\'s offers of assistance, and report of intelligence intercepted out of the Meditteranean.','From the point of the underlined sentences on fol.206v until fol.207r, there is a line marked in the margin. The correct sequence of text runs thus; fol.206, fol.208, fol.207, and fol.209.\r\n'),
	('0779','29 November 1595','15951129','May it please your good L: Being sudainely oppressed when I made my last','Reporting that the States\' have changed their minds about keeping the recent intercepted letters secret, and his bid to return home.','\r\n'),
	('1274','December 1595','15951200','It is expressed in her Majesties lettre to the States, and also sette','Requires of Cecil clarification concerning his instructions.','\r\n'),
	('1269','December 1595','15951200','My Lord Embassador: I s[ho]wld not','Sends his good wishes to Bodley.','\r\n'),
	('1271','05 December 1595','15951205','But forasmuche as none can better deale inwardly & privatly','Extract of instructions for how to deal with Oldenbarnvelt.','\r\n'),
	('1272','15 December 1595','15951215','Mr Bodley: Her Majestie hath ben acquainted with your dispatch of the','Informs Bodley that the queen is not content to withdraw her demand of assistance from the states, and Bodley must meet with Barnevelt to resolve the issue.','On fol.220v, at the words \'Her Majestie wroate\', a different scribe takes over. This section is not present in the copies.\r\n'),
	('0495','15 December 1595','15951215','Her majestie hath bene acquaynted with your dispatch of the xxvjth of November','Informs Bodley that the queen is not content to withdraw her demand of assistance from the states, and Bodley must meet with Barnevelt to resolve the issue.','\r\n'),
	('1394','15 December 1595','15951215','Her Majestie hath bin acquainted with your dispatche of the 26','Conveys the queen\'s response to his recent reports of the States\' conduct.','This is a fragment. No copy exists. It is in Bodley\'s hand.\r\n'),
	('0496','15 December 1595','15951215','Mr Bodley: Her majestie hath ben acquainted with your','Informs Bodley that the queen is not content to withdraw her demand of assistance from the states, and Bodley must meet with Barnevelt to resolve the issue.','\r\n'),
	('1270','16 December 1595','15951216','If the pitieng of your L. for your ill voiadge','Concerning the rumours about Norris, and offering support.','On fol.213r there is the signature \'D\', written once in pencil and once in ink.\r\n'),
	('0497','17 December 1595','15951217','we haue had since you went annother hott allaram, vppon a spitefull','Reports that rumours that were circulating about Norris selling Ostend to the enemy have been quashed by Norris\' supporters.','This is a copy of part of a letter from Bodley to Norris. The second descriptive paragraph is in a different hand.\r\n'),
	('1278','January 1596','15960100','May it please your H. The tenor of your lettre [of the]','Assuring Cecil that he will be ready to perform any service.','\r\n'),
	('1277','04 January 1596','15960104','May it please your good L. Upon the rea-','Reports on Oldenbarnvelt\'s movements, on which depends the states\' answer to the queen\'s recent letters.','On fol. 1r there is the signature \'A\'.\r\n'),
	('1280','09 January 1596','15960109','Though your lettre of the 5. be but newly come hither and the m[...]','Concerning a calumny against Norris, and Bodley\'s advice on how to proceed.','\r\n'),
	('1282','13 January 1596','15960113','Sir, After my hartie Commendacions. Although wee','Requires Bodley to request the States to permit the return of Sir Francis Vere to England to discuss the next military campaign.','\r\n'),
	('1283','20 January 1596','15960120','Take not, My very Honorable Lord Emba-','Regarding the calumnies made against him.','On fol. 10r there is the signature \'C\'.\r\n'),
	('0727','25 January 1596','15960125','May it please your good L. I have imparted as yow willed','Concerning Sir Francis Vere\'s recall to England, and the progress of the discussion with Oldenbarnvelt and the other deputies of the Provinces.','\r\n'),
	('1284','25 January 1596','15960125','May it please your good L. I have imparted as you willed','Concerning Sir Francis Vere\'s recall to England, and the progress of the discussion with Oldenbarnvelt and the other deputies of the Provinces.','On fol.13r there is the signature \'D\'. Also on fol.13r at the words \'goe foward\' there is a vertical line inscribed in the left hand margin, which continues until the words \'of tyme\' on fol.14v.\r\n'),
	('0780','25 January 1596','15960125','May it please your good L. I have imparted as yow willed her Highnes plea-','Report of his private and public dealings with the States, and a round-up of intelligence.','\r\n'),
	('0728','30 January 1596','15960130','May it please your good L. SInce I made my last dispatche','Reports that he has had private conference with Oldenbarnvelt  to advance the negotiations with the States.','\r\n'),
	('1287','05 February 1596','15960205','I am still of one opinion that your L. in your maters can not [.]','Promising Norris that he has been energetically supporting his case.','On fol.21r there is the signature \'F\'.\r\n'),
	('1288','14 February 1596','15960214','[May] it please your H. If so slender a token of my dutifull affection','Reports that the Deputies from Holland and Zeeland have arrived, and he hopes to have an answer to the queen\'s proposition soon.','\r\n'),
	('1292','21 March 1596','15960321','May it please your good L. The remises and disputes','Confirms the proposals put forward by the Deputies of the Provinces in response to the queen\'s demands.','On fol.27r there is the signature \'H\'. Also on fol.27r at the words \'The remises\' a line is drawn in the left hand margin which continues until the words \'their offer be accepted\' on fol.28r. On fol.28r at the words \'were the nature\' there is a vertical line inscribed in the left hand margin which continues until the words \'to take a resolution\' on fol.28v.\r\n'),
	('0783','23 April 1596','15960423','Sir I am first to render yow hartie thanks for your','Asks him to furnish Sir Anthony Standen with 200.','\r\n'),
	('0699','25 June 1595','15950625','Most hono: my syngular good Lorde, may it please yr','Intelligence, Bodley\'s \'overture\' to the Queen not embraced','\r\n'),
	('0375','02 February 1592','15920202','May it please your good L. to your letter','Confirms the news of Casimir\'s death, and reports that Bilandt, the Emperor\'s Ambassador has arrived at the Hague.','\r\n'),
	('0696','04 January 1596','15960104','May it please your good L: Upon the reading of your lettre of the','Regarding conversation had with Oldenbarnvelt, concerning the revision of the Contract for repaying the loan.','\r\n'),
	('0730','24 March 1596','15960324','May it please your good L: Upon the writing of my last','Reports that he intends to travel to Zeeland to await news of the States resolution.','\r\n'),
	('0781','04 January 1596','15960104','May it please your L. upon the reading of your lettre of the 15 of December: which','Reports his conversations with Oldenbarnvelt, and the likelihood of the Provinces agreeing to the repayment of the loan.','\r\n'),
	('0782','04 January 1596','15960104','May it please your good L. I can not remember for matter of occurrence, that','Report of progress at The Hague, and bemoaning the lack of fresh intelligence.','\r\n'),
	('1279','05 January 1596','15960105','Honnorable Sir. wee her majesties pore Captans','Petition to Bodley to present their suit to the States defending them selves against claims that they intend to betray Ostend to the enemy.','On fol.6r there is the signature \'B\'.\r\n'),
	('1281','12 January 1596','15960112','Master Gilpins lettre to your L will report what hath passed in the Councel of','Concerning the calumny brought against Norris by Burghers of the States.','\r\n'),
	('1285','January 1596','15960100','May it please your good L. Since I made my','Report of his discussions with the States\' deputies, including his private correspondence with Oldenbarnvelt.','On fol. 17r at the words \'I have prevailed and until the words \'short a poursuite\' on fol. 18v there is a verticle line drawn in the left hand margin.\r\n'),
	('1286','26 January 1596','15960126','My Lorde Embassador, sence my last I','Reports that he has followed Bodley\'s instructions, and has written to the Council of State.','On fol. 19r there is the signature \'E\'.\r\n'),
	('1289','18 February 1596','15960218','Sir. This bearer Sir Francis Vere retorneth soe fully','Sir Francis Vere brings his instructions along with this letter, and the stipulations for the new agreement.','\r\n'),
	('1293','22 March 1596','15960322','May it please your H. Having y[.]','Concerning the agreement with the States, and requests direction from the queen on how to proceed towards a final resolution.','On fol.30v there is the signature \'J\'. This letter is badly burned along the right hand edge. At the word beginning with \'T\' on the third line of fol.30r, there is a vertical line inscribed in the left hand margin which continues until the word \'inclined\' on the same page.\r\n'),
	('1294','24 March 1596','15960324','May it please your good L. upon the writing of my last of the','Reports that he intends to travel to Zeeland to await news of the States resolution.','On fol.31r at the words \'Upon the writing\' there is a vertical line inscribed in the margin which continues until the words \'my knowledge and report\' on fol.31v. A similar line accompanies the postscript until the word \'between\'.\r\n'),
	('1297','02 April 1596','15960402','And in regard of that, wherin it seemeth you insisted to have','Extract of a letter outlining Bodley\'s directions on how to proceed.','On fol.39r there is the signature \'L\'.\r\n'),
	('1395','29 May 1590','15900529','I have perused those Articles, which your L.','Thanks Sidney for the Articles he has sent, but informs him that he cannot perform any action unless endorsed by the queen.','\r\n'),
	('1396','9 February 1590','15900209',' The more that I have to impart to your Lordship','Concerning the cassing of the English bands.','At the words \'request, about your\', the text continues perpendicular in the left hand margin.\r\n'),
	('1397','12 February 1590','15900212','In my last Letter unto your Lordship, I forgotte to make','Refers Sidney to Captain Wray\'s report.','\r\n'),
	('1398','16 March 1590','15900316','Your Lordships of the 10th came two daies past','Concerning the movement of Sidney\'s troops.','After the postscript is written in the margin, perpendicularly, a note about Bodley\'s later refoundation of the Bodleian Library, Oxford. This seems to be the same hand as the numerous additions made to the documents in this collection.\r\n'),
	('1399','23 March 1590','15900323','There was nothing in my Letter, but your Lordship','Account of Bodley\'s negotiations with the States regarding the deployment of troops.','\r\n'),
	('1400','26 March 1590','15900326','Captain Wray hath bin heere, and we have','Concerning the proposals put forward in Sidney\'s letters, Bodley is reluctant to approach the States before warrant to do so arrives from the queen.','The postscript is located perpendicular in the left hand margin.\r\n'),
	('1401','4 April 1591','15910404','This bearer came to signifie of his going to','Concerning the deployment of troops.','At the words \'course will but falle\' the writing continues perpendicular in the left hand margin.\r\n'),
	('1402','8 April 1591','15910408','I assure your Lordship there hath wanted no','Concerning the deployment of troops.','\r\n'),
	('1403','16 April 1591','15910416','Upon the receat of your Lordships letter of the 12 of','Regarding the deployment of a company of troops.','\r\n'),
	('1404','19 April 1591','15910419','Sins my last unto your Lordship I receaved','Sends latest answer from the States General to the queen, and news of Count Maurice.','\r\n'),
	('1405','29 April 1591','15910429','I was at Enchusen, when your Lordships letter came','Requests the loan of \'Brownist\' books, and concerning his recall home.','\r\n'),
	('1406','20 May 1591','15910520','I assure your Lordship I knowe not what','Mixed military news, including the sieges of Ostend and Zutphen.','\r\n'),
	('1407','21 May 1591','15910521','Sins the writing of my former, which I','Sends news of the death of the Count Overstein, and the lucky escape of Sir Francis Vere.','\r\n'),
	('1408','4 June 1591','15910604','To shewe your Lordship my opinion in the mater','Concerning the enterprise of Dunkirk.','\r\n'),
	('1409','6 June 1591','15910606','For want of good leasure to discourse, as','Concerning a man posing as the distributor of money for Sidney\'s camp, who Bodley fears may be a conspirator.','\r\n'),
	('1410','6 June 1591','15910606','May it please your good Lordship, the bearer hereof','Recommending the bearer John Minche.','\r\n'),
	('1411','17 August 1591','15910817','I told your Lordship, at your being at Arnham','Informing Sidney of the States\' disatisfaction with Sir Edward Norris.','\r\n'),
	('1412','21 September 1591','15910921','Here is nothing sturring, that is worth the','Sends military intelligence, and requests his assistance should Sidney return to England.','At the words \'thorowly instructed\', the text continues perpendicular in the left hand margin.\r\n'),
	('1413','21 November 1591','15911121','I doe not doubt but your Lordship is informed','Concerning the queen\'s bid to dispatch companies from the Low Countries to Rouen.','\r\n'),
	('1414','10 January 1592','15920110','Although I come very weery from a tedi-','Asks Sidney to further his cause when Sidney returns to England.','At the words \'Ambassadors at Brussels, who\', the writing continues perpendicular in the left hand margin.\r\n'),
	('1415','1 March 1592','15920301','I doe assure your Lordship, if I goe not home the','About his desire to return home, payment for the troops in the cautionary towns, and other intelligence.','\r\n'),
	('1416','10 March 1592','15920310','I doe not wonder a whitte at that maner','Complains at the attitude of the States towards both Sidney and the queen.','\r\n'),
	('1417','9 April 1592','15920409','I am glad that my letter was opened by','Concerning the situation regarding Sir Edward Norris.','\r\n'),
	('1418','26 April 1592','15920426','Though I knowe not a jote of any newes','Reports that there is little news to report.','\r\n'),
	('1419','2 June 1592','15920602','Your Lordship may perceave by the copie of that','Concerning his recent dealings with the States.','\r\n'),
	('1420','11 August 1592','15920811','I doe rather salute your Lordship, for that this bear-','Regarding the levy of men in Juliers, and the military tactics at Groningen.','\r\n'),
	('1421','23 August 1592','15920823','I doe assure your Lordship, this mater of withdrawing','Concerning his dealings with the States General, and his desire for recall.','\r\n'),
	('1422','16 September 1592','15920916','Your Lordships letter of your hand, was my first','Regarding the English companies to be sent for France.','\r\n'),
	('1423','24 October 1592','15921024','I would I were departing together with your','Expressing his wish to leave The Hague and return home to England.','\r\n'),
	('1424','16 November 1592','15921116','I doe not write with any hope, that this my','Concerning his intended return to England.','\r\n'),
	('1425','22 January 1593','15930122','By your Lordships letter by this bearer, and by an','Communicates his frustration at not being permitted to return home.','At the words \'it is also proposed\', the writing continues perpendicular in the left hand margin.\r\n'),
	('1426','17 December 1595','15951217','Sir, For as much as yow had written to have','Concerning a recent letter from the queen to Sidney concerning the provision of his troops, and how Bodley cannot present it to the States if it does not mention him by name.','The subscription is located in the left hand margin.\r\n'),
	('0009','04 March 1592','15920304','After our verie hartie commendations','A letter in support of a suit requesting reimbursement from the States.','Severe fire damage obscures much of the text.\r\n'),
	('0011','07 March 1593','15930307','After our hartie Comendacions. Sir Edwarde Norreys Gouvernor','John Poley\'s company is to move from Berghen op Zoom to Ostend, after petition by Edward Norris, governor of Ostend.','A signature \'F\' is on the middle of the lower edge of f.23r.\r\n'),
	('0015','30 March 1593','15930330','May it please yowr good LL. That which I had in','Concerning the transfer of Sir John Poley\'s horse bands to Ostend, and Sir William Reade\'s suit.','Fire damage obscures some of the text on f.31v.\r\n'),
	('0017','1593','15930000','Most sacred souveraigne, It is nowe fower yer[es]','Bodley seeks revocation after being in the Low Countries for four years, and claims that in that time the situation has vastly improved.','The signature is partly obscured as the folio has been cut. There is significant fire damage.\r\n'),
	('0028','After 10 April 1593','15930400','Trusty and welbeloved we greete youe well. Wheras youe have serv[ed]','The Queen grants Bodley permission to return home to deal with personal business following his father\'s death. Bodley is to write instructions for George Gilpin who will hold his post.','\'George\' of George Guilpin is fainter than the rest of the text and appears to have been written into a lacuna left for the purpose. Some fire damage.\r\n'),
	('0029','03 May 1594','15940503','3 Maij 1594. Instruction given to Master Thomas Bode-','Bodley is to ask for military assistance against the Spanish with the threat that if left unchecked the Spanish will dominate trade westwards.','The text is copied into a central column.\r\n'),
	('0030','04 May 1594','15940504','You shall use all expedition to deliver our lettres to the generall States, or in','Detailed instructions for Bodley on how to get greater military assistance from the States.','Fire damage obscures some of the text. There are ink hatchings along the bottom margin of each page.\r\n'),
	('0045','30 August 1594','15940830','Trusty and welbeloved We greete youe well. Wher[as]','Bodley is granted permission to return home, before which he is to advise how best to pursue England\'s reimbursement by the States General.','Remnants of the royal seal at the end of the lettertext. Some fire damage.\r\n'),
	('0047','22 July 1594','15940722','Instructions for our Servant Thomas','Instructions given to Bodley on his return to the States, concerning their unfavourable reply. Bodley is given licence to use his own judgement.','Fire damage obscures some of the text. The sign manual is not autograph.\r\n'),
	('0371','10 January 1592','15920110','May it please your good LL. to be adverti','Bodley writes concerning the inadequate mustering of the English captains, and what actions he has taken in this regard.','There are three vertical lines in the left hand margin on f.13r, alongside lines four to six.\r\n'),
	('0386','16 April 1592','15920416','Trusty &c. Wheareas yowe haue served us a longe time','Bodley is given permission to return home on the death of his father.','A lacuna is left before \'Guilpin\'.\r\n'),
	('0391','07 May 1592','15920507','Trusty and welbeloved we gret yow well','Bodley is to persuade the States of the necessity of sending troops out of the Low Countries to aid the French King.','\r\n'),
	('0400','30 June 1592','15920630','Wher we did in May last by our lettres signify to yow our','Directions to Bodley regarding extra forces to be made ready to be sent to France, and complaints made by merchants over piracy by English ships','\r\n'),
	('0424','02 November 1592','15921102','May it please your good LL. for that Whiche is','Regarding Nicholas Parker and John Poley\'s troops.','\r\n'),
	('0432','30 March 1593','15930330','May it please your good LL. That whiche I had in','Concerning the transfer of Sir John Poley\'s horse bands to Ostend, and Sir William Reade\'s suit.','The binding obscures some of the text of the verso, as the text crosses the spine of the volume.\r\n'),
	('0433','30 March 1593','15930330','To a second lettre of your Lps of the 4th of this present which I received','Extract from a letter of Bodley\'s concerning Sir William Reade.','\r\n'),
	('0441','03 May 1594','15940503','Yowe shall use all expedicion to deliver owr lettres to the','Instructions for Bodley regarding the levying of troops.','A lacuna is left in the postscript concerning the number of pounds to be given to Bodley. There are two florilegia on the address leaf.\r\n'),
	('0462','December 1594','15941200','First her majestie hath had just cause these manie yeres to have','An extended account of England\'s involvement with the Low Countries, explaining the need for reimbursement.','There is a lacuna where there should be a number of horse and two lines down a number of footmen, on f.279r, and regarding the number of years on f.282r\r\n'),
	('0463','December 1594','15941200','Suche doe wee knowe by observacon of yowr former','Credit for Bodley','\r\n'),
	('0465','04 January 1595','15950104','First her majestie hath had just cawse thes manie yeares','An extended account of England\'s involvement with the Low Countries, explaining the need for reimbursement.','There is a lacuna where there should be a number of horse and two lines down a number of footmen, on .5v. A figure eight symbol indicates that the marginal text on f.7v should follow on from the end of f.8r.\r\n'),
	('0479','22 July 1595','15950722','Wee have giuen yow formerlie so sufficient Instructions, at yowr late going','Bodley is to continue to press the States to repaying some of their debt to the English crown.','There are two florilega on the address leaf.\r\n'),
	('0490','October 1595','15951000','After our hartie commendacions: Her Majestie hath seen all','The Queen praises Bodley and gives him further instructions on his dealings with the States.','There are two crosses in the margin by the text on f.214r, one after \'to be betrayed\' and one before \'Yet rather then any\'.\r\n'),
	('0491','04 November 1595','15951104','Trusty and welbeloved, wee greete yow well. Wee have seen of','Bodley is praised for not giving in to the State\'s argument. Letters to the Queen and her council are described, and Bodley is instructed how to respond.','\r\n'),
	('0587','25 March 1592','15920325','A lettre to Master Bodeley. The Councellor of the States generall havinge receaved therin','Concerning the accusations made against Sir Edward Norris.','\r\n'),
	('0593','09 July 1592','15920709','A Lettre to Master Bodley. Her Majesties pleasure is you shall','The Queen has received intelligence that the enemy will attack Ostend.','\r\n'),
	('0594','18 July 1592','15920718','A lettre to Master Bodley, Counsellor of Estate for her','Bodley is to persuade the States General to grant allowances to Thomas Baskerville, commandant at the cautionary town of Rammekins.','\r\n'),
	('0598','17 October 1592','15921017','A lettre to Thomas Bodley, esquire, Counsellour for her','Bodley is to insist that Parker\'s company go to Brittany as directed.','\r\n'),
	('0599','04 March 1593','15930304','A lettre to Master Bodley. Wheras Sir William Reade, knight,','Bodley is to deliver the Queen\'s letter to the States, regarding the reimbursing of William Reade.','Privy Council copy.\r\n'),
	('0600','07 March 1593','15930307','A lettre to Master Bodley. Sir Edward Norreys, Gouvernour','Bodley is to aid the movement of Sir John Poley\'s company from Berghen op Zoom to Ostend.','Privy Council copy.\r\n'),
	('0603','21 December 1595','15951221','After our &c. There is order given by the Officers','Bodley is to assist William Beale in his supplying of match to the Queen\'s army.','Privy Council copy.\r\n'),
	('0604','30 January 1596','15960130','A lettre unto Master Bodley and Master Gilpin, Agentes for her Majeste','Privy Council summary of a letter requiring Bodley and Gilpin to assist merchants in the Low Countries.','\r\n'),
	('0624','26 August 1592','15920826','Trusty &c. Since our last lettres unto yow for the','One hundred horsemen are to be added to the troops going into France, to be made up from either Nicholas Parker or John Poley\'s bands.','Annotations are in Burghley\'s hand.\r\n'),
	('0625','26 August 1592','15920826','Trusty &c. Since our last lettres unto yow for the spedy sending away of','One hundred horsemen are to be added to the troops going into France, to be made up from either Nicholas Parker or John Poley\'s bands.','\r\n'),
	('0653','21 August 1592','15920821','Trustie and welbeloved &c Wheare <...> owr lettres of','Regarding troops to be sent into France.','The text of the final paragraph is smaller than the rest of the document. The annotations are by Burghley.\r\n'),
	('0750','03 January 1597','15970103','To Master Thomas Bodeley','Regarding troops to be sent to the French King. John Norris is sent over to facilitate this.','This is an annotated draft in Burghley\'s hand.\r\n'),
	('0773','14 May 1595','15950514','Most gratious souveraigne, I send yowr Majeste','Bodley returns to England without proper permission to secretly deliver the States\' offer, which when revealed will earn him greater sway and respect with them, and with the Queen.','\r\n'),
	('1103','24 February 1592','15920224','Trusty & welbelovid we greete you well. We have heertofore caused our Tresorer','The Queen writes to demand that Charles Chamberlen be restored to his former place as Provost Marshall at Berghen Op Zoom, since he has been replaced by one of lower status. The soldier who replaced him is to be found another position.','\r\n'),
	('1111','25 March 1592','15920325','After our hartie Comendacions. The Councell of the States Generall hauvinge received','Concerning the accusations made against Sir Edward Norris.','\r\n'),
	('1127','09 July 1592','15920709','[...]','The Queen has received intelligence that the enemy will attack Ostend.','The first line is completed eroded.\r\n'),
	('1142','09 May 1592','15920509','Trusty and welbeloved we greete youe well. Wheras','Bodley is to persuade the States of the necessity of sending troops out of the Low Countries to aid the French King.','The wax seal is still present. Fire damage obscures some of the text. There is a signature \'Y\' on the middle of the lower edge of f.206r.\r\n'),
	('1153','01 July 1592','15920701','Trustie and welbeloved. We greet you well. Where we did in','Directions to Bodley regarding extra forces to be made ready to be sent to France, and complaints made by merchants over piracy by English ships.','Some fire damage. The wax seal remains. There is an initial signature on the bottom middle edge of f.228r.\r\n'),
	('1161','21 July 1592','15920721','After our hartie commendacions. Wheras Sir Thomas Baskerville knight','Bodley is to persuade the States General to grant allowances to Thomas Baskerville, commandant at the cautionary town of Rammekins.','There is a signature on the middle base edge of f.256r.\r\n'),
	('1178','22 August 1592','15920822','Trusty and welbelovid we greet you well Wheras by our lettres of the first of Julie','Regarding troops to be sent into France.','There is an initial signature at the bottom edge of f.279r, and a large seal still present.\r\n'),
	('1179','26 August 1592','15920826','Trusty and welbelovid we greet you well. Since our last lettres unto you for the speedier','One hundred horsemen are to be added to the troops going into France, to be made up from either Nicholas Parker or John Poley\'s bands.','\r\n'),
	('1194','17 October 1592','15921017','After our hartie commendacions. Wheras direction was given unto Sir','Bodley is to insist that Parker\'s company go to Brittany as directed.','\r\n'),
	('1197','02 November 1592','15921102','May it please your good LL. for that whiche','Regarding Nicholas Parker and John Poley\'s troops.','\r\n'),
	('1204','22 December 1592','15921222','Trustie and welbeloved we greet you well. It is well knowne to you that we have often heretofore both written to the States in','Bodley is to advance the interests of Colonel Sonoy more strongly.','The letter is written landscape across two folios.\r\n'),
	('1230','1595','15950000','Although it be not unknowne to you by th\'experience that you have had of our','An extended account of England\'s involvement with the Low Countries, explaining the need for reimbursement.','Heavy fire damage. An initial signature is present on the middle of the base edge on f.3r. A lacuna is left for the date in the letter\'s title, and regarding the number of footmen and horsemen.\r\n'),
	('1231','03 January 1595','15950103','Elizabeth by the grace of god &c. To the Treasurer and Chamberlaines of our','Warrant for Bodley\'s diet and entertainment of 40 shillings per day.','\r\n'),
	('1253','May 1595','15950500','Most gratious Souveraigne, I send your Majestie heere','Bodley returns to England without proper permission to secretly deliver the States\' offer, which when revealed will earn him greater sway and respect with them, and with the Queen.','Fire damage.\r\n'),
	('1254','1595','15950000','The effect of a motion made unto me by a principall person of the States','An account of a motion made to Bodley regarding the States\' view on articles required by Queen Elizabeth.','\r\n'),
	('1255','14 May 1595','15950514','Most gratious souveraigne, I send your Majestie heer','Bodley returns to England without proper permission to secretly deliver the States\' offer, which when revealed will earn him greater sway and respect with them, and with the Queen.','Fire damage. There is a pen mark at the end of the endorsement on the address leaf.\r\n'),
	('1266','04 November 1595','15951104','Trusty and welbeloved Wee greete you well. Wee have seen of late dyverse','Bodley is praised for not giving in to the State\'s argument. Letters to the Queen and her council are described, and Bodley is instructed how to respond.','Fire damage. There are brackets in the margins around sections of text on f.199r.\r\n'),
	('1290','18 February 1596','15960218','[After] our hartie commendacions: Her majesie doth nowe','Sir Francis Vere is sent to the United Provinces, where he is to inform Bodley of his task and obtain Bodley\'s assistance.','Fire damage.\r\n'),
	('1299','October 1596','15961000','A memoriall of the proceedinges with the Deputies of the States','Journal of Bodley\'s negotiations, from January 1595 to October 1596.','The concluding comment before the section dated 29th September 1596, and the titular comment on f.97r, are indented.\r\n'),
	('1336','04 May 1595','15950504','Elizabeth by the grace of God Queene of England Fraunce &','Warrant for the allowances to be made to Bodley, upon his going to negociate with the states of the Low countries','\r\n'),
	('1387','27 April 1589','15890427','Trusty and Welbeloved, we greete you well, The losse of the','Following the loss of Geertruidenberg, the Queen will send a nobleman to treat with the States General on the matter of keeping the states united under the government.','\r\n'),
	('0729','21 March 1595','15950321','May it please your good L. The remises and disputes','Confirms the proposals put forward by the Deputies of the Provinces in response to the queen\'s demands.','\r\n');
